INSERT INTO `category` (`id`, `code`, `category_id`, `order_no`, `title`, `short`, `description`, `meta_key`, `meta_des`, `image`, `icon`, `banner`, `status`, `create_date`, `create_by`, `last_update`) VALUES
(19, 'CAT-19', 0, 1, 'Computers,IT&Networking', 'The commoditization of computing, along with the global communications it enabled, has empowered ordinary people to do things the richest, most powerful, dictators could not even dream of doing twenty years ago.', '<p>Computer is a general purpose device that can be programmed to carry out a set of arithmetic or logical operations automatically. The commercialization of computing, along with the global communications</p>\r\n\r\n<p><strong>The commoditization of computing, along with the global communications it enabled, has empowered ordinary people to do things the richest, most powerful, dictators could not even dream of doing twenty years ago.</strong></p>\r\n\r\n<p><strong>Information Technology has grown enormously over the few decades and new is a dominant force in the global market.</strong></p>\r\n\r\n<p>But the impact of computing goes beyond the geopolitical shifts and everyday conveniences it enabled, to profound revolutions in the way humans understand the world, as well as our own minds and thoughts.</p>\r\n', 'Computer accessories,routers,switches,dongles,hard disk,rams,motherboard,', '', 'hm_pg_cat_laptops888.jpg', 'computer.png', 'categ_banner_IT_Netwkng.jpg', 1, '2016-03-26 07:03:54', 1, '2016-08-13 09:00:35'),
(25, 'CAT-25', 24, 0, 'test 1', 'test', '<p><strong>We are honored to present you our products</strong>. We provide auto spare parts and our main goal is to satisfy all of our customers. The secret of our success is that our goods are an unbeaten combination of high quality and fair price. We produce and sell only professional parts - that&rsquo;s why we have a great number of devoted clients all over the country and there is nothing better than the happy and satisfied customers. Our goods are real bestsellers; we are offering a great list of some unique spare parts that have no analogues. We believe that everything must be perfect in our business.</p>\r\n\r\n<p><strong>Our parts are the standard of real reliability and durability</strong>. We use the achievements of progress and provide some new technologies. Our manufacturers and vendors guarantee its high quality. Just remember that we estimate our clients and improve our support and delivery systems. And don&rsquo;t forget you can save your money with the help of our system of benefits and discounts.</p>\r\n', '', '', NULL, NULL, 'fashion-clothing.jpg', 1, '2016-03-31 07:03:42', 1, '2016-04-04 05:42:38'),
(26, 'CAT-26', 0, 2, 'Electronics & Electrical Appliances ', '"One of the most prevalent trends in today''s society is widespread of use consumer electronics device. in fact consumer electronics have made life for the modern man more efficient, convenient and comfortable. ', '<p>&quot;One of the most prevalent trends in today&#39;s society is widespread of use consumer electronics device. in fact consumer electronics have made life for the modern man more efficient, convenient and comfortable. People in one or other hands used to these appliances because its sales times, portable, modern convienent, comfortable and fast.</p>\r\n\r\n<p>Electric appliannces and electronics devices come in various color this allows you to decorate your homes and work place by choosing styles.</p>\r\n', '', '', '2016-10-07-PHOTO-00000157.jpg', 'electronic1png.png', 'categ_banner_Electro_homeAppl1.jpg', 1, '2016-04-04 12:04:52', 1, '2016-10-08 10:59:04'),
(28, 'CAT-28', 0, 4, 'Mobiles & Tablets', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, co', '<p>Providing the best mobile phone prices in Sri Lanka from the biggest brands in the world!&nbsp;<a href="http://www.wow.lk/mall/buyonline/smartphones/">Smart phones</a>, budget phones,&nbsp;<a href="http://www.wow.lk/mall/buyonline/tablets/">tabs</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-cases-covers/">covers and cases</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-chargers/">charges</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/screen-protectors/">screen protectors</a>&nbsp;and more! Installment plans available for phones over Rs. 30,000!</p>\r\n', '', '', 'hm_pg_categ_tab.jpg', 'mobl_tab1.png', 'categ_banner_Mobile_Tabs.jpg', 1, '2016-04-11 02:04:00', 1, '2016-08-02 07:24:35'),
(29, 'CAT-29', 28, 0, 'Mobile Phones', '', '<p>Smart phones, tablets, PDAs and budget mobile phones galore! Choose from a sky-high range of the latest mobile phones and tabs from the world&rsquo;s biggest brands under one roof. Comprehensive warranty and Credit Card / Non Credit Card Installment Schemes are available.</p>\r\n', '', '', NULL, 'notebook-5122.png', 'categ_banner_mobiles2.jpg', 1, '2016-04-12 04:04:32', 1, '2016-07-12 14:10:20'),
(30, 'CAT-30', 28, 0, 'Tablets', '', '<p>Looking for an affordable tablet PC? Choose from a range of high tech tabs from world leading brands at amazing discounts. Comprehensive warranties and Credit Card / Non Credit Card Installment Schemes are available.</p>\r\n', '', '', NULL, NULL, 'categ_banner_tab.jpg', 1, '2016-04-12 04:04:02', 1, '2016-07-13 08:08:15'),
(31, 'CAT-31', 28, 0, 'Accessories', NULL, '<p>Looking for phone and tablet accessories? Get your fill of&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-cases-covers/">cases and covers</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/power-banks/">power banks</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/bluetooth-connectors/">Bluetooth headsets</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/mobile-batteries/">batteries</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-chargers/">chargers</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/memory-cards/">memory cards</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/screen-protectors/">screen protectors</a>&nbsp;and more all under one URL. Choose from branded items to non-branded items with warranty.</p>\r\n', '', '', NULL, NULL, 'GalaxsyNexus_RichMedia-Banner_12.jpg', 1, '2016-04-12 04:04:51', 1, '2016-04-12 04:22:51'),
(32, 'CAT-32', 28, 0, 'Home Phones', NULL, '<p>Providing the best mobile phone prices in Sri Lanka from the biggest brands in the world!&nbsp;<a href="http://www.wow.lk/mall/buyonline/smartphones/">Smart phones</a>, budget phones,&nbsp;<a href="http://www.wow.lk/mall/buyonline/tablets/">tabs</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-cases-covers/">covers and cases</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/phone-chargers/">charges</a>,&nbsp;<a href="http://www.wow.lk/mall/buyonline/screen-protectors/">screen protectors</a>&nbsp;and more! Installment plans available for phones over Rs. 30,000!</p>\r\n', '', '', NULL, NULL, 'GalaxsyNexus_RichMedia-Banner_13.jpg', 1, '2016-04-12 04:04:10', 1, '2016-04-12 04:25:10'),
(33, 'CAT-33', 0, 3, 'Perfumes & Fragrance ', '"Perfumes are reminiscent of freshness in Daily Life"  A fragrance that doesn''t differs dramatically in its development. Its top notes shows little variations from bottom notes, So you experience right away its character.  ', '<p>&quot;Perfumes are reminiscent of freshness in Daily Life&quot; &nbsp;A fragrance that doesn&#39;t differs dramatically in its development. Its top notes shows little variations from bottom notes, So you experience right away its character. &nbsp;A small degree of sharpness can cut the richness and create an interesting interplay of sensation of human Life.</p>\r\n', '', '', '2016-10-07-PHOTO-00000155.jpg', 'perfumes1.png', 'categ_banner_Perfumes.jpg', 1, '2016-04-13 10:04:29', 1, '2016-10-08 10:58:21'),
(35, 'CAT-35', 0, 7, 'Games & Gift Cards', '            " Discover the world of Games" \r\n"A Games A Day helps you make, Work, Rest and Play"', '<p>It is the way to focus one&#39;s mind on the present and alleviate the stress that life can cause. Games can help to develop physical skills. it also benefits a variety of brain function.</p>\r\n\r\n<p>&quot; Sweet as the moment when the Itunes went Pop&quot;</p>\r\n', '', '', 'hm_pg_categ_games.jpg', 'games2.png', 'categ_banner_Games1.jpg', 1, '2016-04-16 08:04:01', 1, '2016-10-18 16:01:10'),
(36, 'CAT-36', 0, 7, 'Car Care Products ', '"Simply the best, Splash love your Car. Drive it Clean"', '<p>Car care involves finding the best car polish and dedicated car cleaning products and accessories to keep looking innovative of one on one service for your complete satisfaction.</p>\r\n', '', '', 'hm_pg_categ_carCare11.jpg', 'car3.png', 'categ_banner_Beauty_CarCare.jpg', 2, '2016-04-16 08:04:34', 1, '2016-08-04 09:09:54'),
