(58, 'CAT-58', 0, 9, 'Supplements & Fitness', 'People ask such silly questions about supplements...or do they? We feel it is extremely important for you to understand what, how and why you take your supplements. That''s why we have laid out all the A, B and C''s to supplement success via our Supplement ', '<p>Sometimes is can be difficult to describe to others what supplements are, especially when you have no idea yourself. Our Supplement Guide for Dummies has all the answers and explanations for you to understand exactly what a supplement actually is. Now you can tell others and not only LOOK like you know what you are taking about, but have confidence that you KNOW what you are talking about.</p>\r\n', '', '', '23_G_BOMB_ORAN_JUICE_FLAV.jpg', 'supplements.png', 'Supplement_Main_Slide.jpg', 1, '2016-05-18 01:05:33', 1, '2016-10-15 14:29:15'),
