(17, 0, 29, 0, 10, 'PRO-17', 'Samsung Galaxy J110HD Dual SIM White ', '246360_zoom.jpg', '4.3-inch display, at 216 ppi / dpi (pixels per inch) \r\n1.3GHz 2-core processor \r\n0.512GB RAM\r\n4GB internal memory\r\n5 Megapixel main camera\r\n1800-mAh battery\r\nAndroid 4.4 KitKat', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Color</th>\r\n			<td>White</td>\r\n		</tr>\r\n		<tr>\r\n			<th>UPC</th>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<th>EAN</th>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Brand</th>\r\n			<td>Samsung</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Type</th>\r\n			<td>Smart Phone</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Feature</th>\r\n			<td>Bluetooth, Dual SIM, FM Radio, GPRS, GPS, Primary Camera, Secondary Camera, Touch Screen, WI-FI</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Screen Size</th>\r\n			<td>4 Inches - 4.9 Inches</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Form</th>\r\n			<td>Touch</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Capacity</th>\r\n			<td>4 GB</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Operating System</th>\r\n			<td>Android</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Make the perfect style statement with the alluring Galaxy J1 Ace, sporting softened edges and classy design. Giving complete control on the power, save your battery with the ultra power-saving mode. Powering a mighty dual core 1.2 GHz Cortex-A7 processor and CMOS 5.0 MP camera delivering bright and super clear pictures, this device is a complete media device having a lustrous 4.3&rsquo;&rsquo; TFT capacitive screen. It features a decent 4 GB internal storage and 512 MB RAM that enables the device to work smoothly. Entirely built out of plastic, this light weighted, elegant white beauty is resistant to smudges and fingerprints.</p>\r\n', 'Samsung Galaxy J110HD Dual SIM White ', 'Samsung Galaxy J110HD Dual SIM White ', 295, '10', NULL, NULL, 2, '2016-04-12 04:04:22', 1, 0, '2016-07-23 06:19:59'),
(18, 0, 29, 0, 10, 'PRO-18', 'Samsung Galaxy J110F Dual SIM Black ', 'J110f_big_img1.jpg', 'Quad-Core 1.2 GHz , 4.3" inch Display , 5 MP Rear Camera + 2 MP Front Camera\r\n', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Color</th>\r\n			<td>Black</td>\r\n		</tr>\r\n		<tr>\r\n			<th>UPC</th>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<th>EAN</th>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Brand</th>\r\n			<td>Samsung</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Type</th>\r\n			<td>Smart Phone</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Feature</th>\r\n			<td>Bluetooth, Dual SIM, FM Radio, GPRS, GPS, Primary Camera, Secondary Camera, Touch Screen, WI-FI</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Screen Size</th>\r\n			<td>4 Inches - 4.9 Inches</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Form</th>\r\n			<td>Touch</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Capacity</th>\r\n			<td>4 GB</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Operating System</th>\r\n			<td>Android</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Make the perfect style statement with the alluring Galaxy J1 Ace, sporting softened edges and classy design. Giving complete control on the power, save your battery with the ultra power-saving mode. Powering a mighty dual core 1.2 GHz Cortex-A7 processor and CMOS 5.0 MP camera delivering bright and super clear pictures, this device is a complete media device having a lustrous 4.3&rsquo;&rsquo; TFT capacitive screen. It features a decent 4 GB internal storage and 512 MB RAM that enables the device to work smoothly. Entirely built out of plastic, this light weighted, midnight black beauty is resistant to smudges and fingerprints.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Samsung Galaxy J110F Dual SIM Black ', 'Samsung Galaxy J110F Dual SIM Black ', 310, '', NULL, NULL, 2, '2016-04-12 04:04:03', 1, 0, '2016-07-23 06:20:03'),
