r (SD, SDHC, SDXC)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h3>DIMENSIONS</h3>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Width</th>\r\n			<td>346mm</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Height</th>\r\n			<td>25.4mm</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Depth</th>\r\n			<td>246mm</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>Design Features of Dell Inspiron 14 3443 Laptop</h2>\r\n\r\n<h2><strong>Perfect portability</strong></h2>\r\n', '', 'LAPTOP,COMPUTER,SALE OF LAPTOPS,', 1899, '10', NULL, NULL, 2, '2016-05-11 04:05:45', 1, 0, '2016-06-02 13:35:12'),
