(66, 0, 33, 1, 5, 'PRO-66', 'BURBERRY Body Tender EDT 85ml Lady', '124.jpg', '', '', '', 'BURBERRY Body Tender EDT 85ml Lady', 188, '25', NULL, NULL, 2, '2016-05-29 01:05:50', 1, 0, '2016-05-29 09:41:26'),
(67, 0, 75, 40, 5, 'PRO-67', 'Burberry Body Tender EDT 85ml  for Women', '125.jpg', 'Body Tender for Women is a youthful, lighter interpretation of the original BURBERRY Body. It is an instinctive fragrance with notes of refreshing lemon, dewy rose and musk.\r\nDelicate blend of dewy English roses, white jasmine and sandalwood .', '<p>Body Tender for Women is a&nbsp; youthful and instinctive fragrance for women. A sparkling twist on the iconic BURBERRY Body fragrance. The scent opens with a fresh surge of lemon, crisp apple and green absinthe. A delicate blend of dewy English roses, white jasmine and sandalwood gives a radiant, optimistic heart. Sensual notes of cashmeran, amber and musk warm the base.</p>\r\n\r\n<p>The adjectives that describe this new version of Body are tenderness, eternal youth, serenity, ease and charisma. The composition opens with fresh aromas of lemon, apple, peach and absinthe. The core of the composition includes essences of rose, tea leaves, jasmine and sandalwood, all placed at the base of cashmere accords, vanilla, musk and amber.he house of&nbsp;<strong>Burberry</strong>&nbsp;launched Body perfume in 2011. After that, there were numerous variations on the theme such as Body Eau de Parfum Intense (2011), Body Eau de Toilette (2012) and Body Rose Gold (2012). New&nbsp;<strong>Burberry</strong>&nbsp;<strong>Body Tender</strong>&nbsp;comes out in spring 2013.</p>\r\n', '', 'Burberry Body Tender EDT 85ml Lady', 188, '', NULL, NULL, 1, '2016-05-29 04:05:22', 1, 0, '2016-11-09 01:54:23'),
(68, 0, 75, 63, 5, 'PRO-68', 'Burberry Brit Sheer EDT 100ml for Women', '142.jpg', 'A refreshing, vibrant fragrance with top notes of sweet lychee, yuzu, pineapple leaves and mandarin.The body reveals a floral mix of peony, peach blossom, sweet pea with just a hint of nashi.', '<p>A refreshing, vibrant fragrance with top notes of sweet lychee, yuzu, pineapple leaves and mandarin.The body reveals a floral mix of peony, peach blossom, sweet pea with just a hint of nashi.</p>\r\n\r\n<p>Introducing Brit Sheer, a playful and energising fragrance inspired by sun-blushed peonies against a warm English sky. The scent embodies the youthful spirit of the original BURBERRY Brit fragrance.</p>\r\n\r\n<p>BURBERRY Brit Sheer is a refreshing, vibrant fragrance with top notes of sweet lychee, yuzu, pineapple leaves and mandarin. Heart notes of pink peony, peach blossom and nashi add a soft, floral accent. A sheer veil of white musk and blond wood gently balance this fresh and youthful scent.</p>\r\n\r\n<p>Burberry Brit Sheer Eau de Toilette is a lively and romantic fragrance. The scent features sparkling top notes of bright yuzu and mandarin, uplifted by pineapple leaves, luscious lychee, and grapes. The body reveals a floral mix of peony, peach blossom, sweet pea with just a hint of nashi. The fragrance dries to a luminous veil of white musk and creamy amyris wood. It is presented in a check glass bottle.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Top notes are litchi, yuzu, pineapple leaf and mandarin orange.</li>\r\n	<li>Middle notes are peony, peach blossom and pear.</li>\r\n	<li>Base notes are white musk and white woods.</li>\r\n</ul>\r\n', '', 'Burberry Brit Sheer EDT 100ml Lady', 188, '20', NULL, NULL, 1, '2016-05-29 04:05:37', 1, 0, '2016-11-09 01:54:23'),
(69, 0, 74, 57, 5, 'PRO-69', 'Burberry London EDT 100ml  for Men', '128.jpg', 'Burberry London for Men Eau de Toilette is a refined and sophisticated fragrance. The scent features notes of spicy black pepper and smoky guaiac complemented by sweet and resinous opoponax and elegant lavender for an added touch of distinction. ', '<p>Burberry London for Men Eau de Toilette is a refined and sophisticated fragrance. The scent features notes of spicy black pepper and smoky guaiac complemented by sweet and resinous opoponax and elegant lavender for an added touch of distinction.</p>\r\n\r\n<p>Notes of spicy black pepper and smoky guaiac complemented by opoponax and lavender add a touch of distinction.</p>\r\n\r\n<ul>\r\n	<li>A sophisticated scent with top notes of bergamot, lavender and warm cinnamon</li>\r\n	<li>Artfully balanced heart notes of mimosa flower and rich leather</li>\r\n	<li>Lower tones combine heady tobacco leaves and dense oak moss to complete this distinctive and refined fragrance</li>\r\n</ul>\r\n', '', '', 173, '', NULL, NULL, 1, '2016-05-29 04:05:54', 1, 0, '2016-11-09 01:54:23'),
(70, 0, 33, 4, 5, 'PRO-70', 'Burberry London EDP 100ml Lady', '129.jpg', '', '', '', '', 195, '25', NULL, NULL, 2, '2016-05-29 04:05:42', 1, 0, '2016-05-29 12:36:31'),
(71, 0, 75, 65, 5, 'PRO-71', 'Burberry London EDP 100ml for Women', '132.jpg', 'Burberry London Eau de Parfum is a stylish floral-fresh fragrance. The scent features tender top notes of elegant rose and a sweet heady blend of honeysuckle. Deep heart notes of tiare flower, jasmine and peony are uplifted with a whisper of fresh clement', '<p>Burberry London Eau de Parfum is a stylish floral-fresh fragrance. The scent features tender top notes of elegant rose and a sweet heady blend of honeysuckle. Deep heart notes of tiare flower, jasmine and peony are uplifted with a whisper of fresh clement.</p>\r\n\r\n<p>The London by Burberry eau de parfum for Women is a classic floral scent that is indispensable if one wants to feel the spirit of good old London. The perfume was introduced in the year 2006, and belongs to the Floral fragrance family. This perfume is the culmination of two great minds, Dominique Ropion and Jean Marc Chaillan, and is advertised by actress Rachel Weisz and actor Ioann Gruffud. The scent opens with honeysuckle and rose, harmonized with a tangerine note. Jasmine, peony, and tiare flower form the heart, adding a floral tinge of the scent. Finally, musk, patchouli, and sandalwood leave a light trail. The London by Burberry perfume is available in the EDP concentration in a bottle of 100ml.</p>\r\n\r\n<p>This fragrance is indispensible while visiting the city of&nbsp;London&nbsp;if one wants to feel the pulse of this old and contemporary city.</p>\r\n\r\n<p>This is a classic floral scent with jasmine in its heart. It opens up with rose and honeysuckle harmonized with a fruity tangerine note. White floral hear note includes jasmine, Tiare Flower and Soft Peony. It leaves a velvety trail of wood and musk.<strong>Burberry</strong>&nbsp;<strong>London</strong>&nbsp;was created in 2006 by&nbsp;Dominique Ropion. It&rsquo;s advertising campaign features actress Rachel Weisz and actor Ioann Gruffud.&nbsp;</p>\r\n', '', '', 195, '', NULL, NULL, 1, '2016-05-29 04:05:42', 1, 0, '2016-11-09 01:54:23'),
(72, 0, 74, 58, 5, 'PRO-72', 'Burberry Weekend EDT100ml  for Men', '1souq.jpg', 'Burberry Weekend for Men is a fragrance that evokes relaxation, informality, freedom, and well-being. ', '<p>Burberry Weekend for Men is a fragrance that evokes relaxation, informality, freedom, and well-being. A light and invigorating fragrance with citrus top notes of fresh lemon, grapefruit and sweet tangerine. Soft heart notes of oak moss, ivy leaves and sandalwood. A radiant warmth of honey, amber and musk composes the base notes in this elegant, luminous scent.&nbsp;A radiant warmth of honey, amber and musk composes the base notes.</p>\r\n', '', '', 150, '', NULL, NULL, 1, '2016-05-29 04:05:14', 1, 0, '2016-11-09 01:54:23'),
(73, 0, 75, 67, 5, 'PRO-73', 'Burberry Weekend  EDP 100ml for Women', '135.jpg', 'Weekend for Women is a feminine fragrance with a contemporary, refreshing, citrusy tone. A sheer fragrance with top notes of tangerine, tree sap and reseda plant. Delicate floral heart notes of wild rose, peach blossom, iris and hyacinth.', '<p>One of the most popular perfumes from the Burberry Fashion House, Fragrance Direct are thrilled to stock Burberry Weekend. Created in 1997 Burberry Weekend Eau de Parfum is a relaxing, powdery fragrance dedicated to the British weekend. A relaxing country style perfume, this perfume is perfect for either day or evening wear. Burberry Weekend opens with top notes include sweet, zesty mandarin orange and aromatic grassy notes. The classic fragrance then moves on to a heart containing notes of blue hyacinth, iris, nectarine, peach flower, red cyclamen and wild rose. Finally Burberry Weekend perfume comes to a close with base notes that create the perfect blend of sandalwood, cedar and musk.</p>\r\n\r\n<p>With its hand-written logo style, the Weekend range has a casual, relaxed personality found in the outdoor spirit of the Burberry brand. Burberry Weekend Women is a sparkling citrus floral fragrance enhanced by the unique combination of Tangerine, Sap and Reseda plant.</p>\r\n\r\n<p>This relaxing, powdery fragrance is dedicated to weekend. A relaxing country style perfume, named&nbsp;<strong>Weekend for Women</strong>. Top notes include sweet and zesty mandarine and aromatic grassy notes. Heart notes contain blue hyacinth, iris, nectarine, peach flower, red cyclamen and wild rose. The drydown is a perfect blend of sandalwood, cedar and musk. It was created by&nbsp;<a href="http://www.fragrantica.com/noses/Nathalie_Lorson.html"><strong>Nathalie Lorson</strong></a>&nbsp;in 1997.</p>\r\n\r\n<p><strong>Fragrance Family</strong>Citrus floral</p>\r\n\r\n<p><strong>Fragrance Notes</strong>:</p>\r\n\r\n<p><strong>Top Notes</strong>: Wild Rose, Red Cyclamen, Peach Flower</p>\r\n\r\n<p><strong>Heart Notes</strong>: Blue Hyacinth, Iris, Nectarine</p>\r\n\r\n<p><strong>Base Notes</strong>: Cedarwood, Sandalwood, Musk</p>\r\n', '', 'Burberry Weekend  Women EDP 100ml', 188, '', NULL, NULL, 1, '2016-05-29 05:05:54', 1, 0, '2016-11-09 01:54:23');
