(74, 0, 74, 25, 5, 'PRO-74', 'BVLGARI BLV EDT 100ml  For Men', '136.jpg', 'Attractive and seductive, this masculine Eau de Toilette was built on contrasts that blend together in a perfect harmony. BLV pout Homme is fresh, woody-spicy fragrance. ', '<p>Attractive and seductive, this masculine Eau de Toilette was built on contrasts that blend together in a perfect harmony. BLV pout Homme is fresh, woody-spicy fragrance. Ginger, as a main note in both BLV pour Femme and BLV pour Homme, is harmonized with the velvety and silkier note of &nbsp;Tobacco blossom.the fresh and spicy beginning gradually envolves into the lovely blend of tobacco blossom, juniper and gingko. The base is warm and woody due to grey teak, sandalwood, cedarwood and musk. It was created by alberto morillas in 2001.Tobacco blossom.the fresh and spicy beginning gradually envolves into the lovely blend of tobacco blossom, juniper and gingko. The base is warm and woody due to grey teak, sandalwood, cedarwood and musk. It was created by alberto morillas in 2001.</p>\r\n', '', '', 180, '', NULL, NULL, 1, '2016-05-29 05:05:15', 1, 0, '2016-11-09 01:54:23'),
(75, 0, 75, 69, 5, 'PRO-75', 'CK Beauty EDP 100 ml for Women', '137.jpg', 'Calvin Klein Beauty evokes the ultimate power of femininity and sophistication, while capturing the spirit of a woman who is beautiful from the inside out, with an aura that radiates. This is cleverly done with a new interpretation of a lily, a neo-lily. ', '<p>Calvin Klein Beauty evokes the ultimate power of femininity and sophistication, while capturing the spirit of a woman who is beautiful from the inside out, with an aura that radiates. This is cleverly done with a new interpretation of a lily, a neo-lily. The neo-lily is the heart and soul of Calvin Klein beauty. A sophisticated flower that is the essence of femininity, the lily is also radiant and powerful. In 1968, Klein founded Calvin Klein Limited, a coat shop in the York Hotel in New York City, with $10,000. The first Calvin Klein collection was a line of &quot;youthful, understated coats and dresses&quot; featured at the New York City store, Bonwit Teller. In 1969, Klein appeared on the cover of Vogue magazine. By 1971, sportswear, classic blazers and lingerie were added to his women&#39;s collection. In 1973, he received his first Coty American Fashion Critics&#39; Award for his 74-piece women&rsquo;s wear collection. By 1977, annual revenues had increased to $30 million. Klein and Schwartz were making $4 million each. After the company signed licenses for cosmetics, jeans, and menswear, Klein&#39;s annual retail volume was estimated at $100 million. The Calvin Klein fragrance collection includes Beauty, Eternity, Obsession, Euphoria, Man, CK free, Contradiction and CK One.</p>\r\n\r\n<p>Elegant, timeless, and sophisticated are the words that best describe Beauty by Calvin Klein for Women Eau de Parfum. The scent is created for the mature woman who is beautiful and graceful. The fragrance is inspired by the beauty of calla lily and the gracious curves of a woman. It enhances the magic of her inner goddess, her strength, and her spirit. Perfumer Sophie Labbe concocted the fragrance. Its top notes are composed of ambrette seeds that have a sweet, musk like aroma. The middle notes feature addictively sweet scents of jasmine. The EDT closes off with distinctively woody and spicy resinous scents of Virginia cedar. The voluptuous character of the fragrances is represented by its curvaceous container: a 100ml, pebble shaped flacon, topped with a uniquely designed metal stopper.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />TOP NOTES</p>\r\n\r\n<p>Beauty Calvin Klein for Women opens with a sweet smelling, musk like fragrance of ambrette seeds. The fragrance is sure to leave a lingering scent behind as you walk past people in a party or an office setting.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>Beauty by Calvin Klein for Women exudes exhilarating aromas of fragrant jasmine. The intense floral scent is addictively sweet. It leaves a lasting trail that is potent, yet subtle on your senses.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>Beauty by Calvin Klein for Women&rsquo;s base emanate somber and austere notes of cedar. The scent of the base is calming and pure and lasts for hours, making the EDT just what you need to stay smelling lovely all day long.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 173, '', NULL, NULL, 1, '2016-05-29 05:05:43', 1, 0, '2016-11-09 01:54:23'),
(76, 0, 74, 61, 5, 'PRO-76', 'CK BE 200 ml for Men', '139.jpg', 'Calvin Klein CK Be was the fragrance from Calvin Klien. Whilst CK One is based on the idea of bonding and sharing, the complementary and contrasting CK Be advocates the "be-yourself" concept.', '<p>Calvin Klein CK Be was the fragrance from Calvin Klien. Whilst CK One is based on the idea of bonding and sharing, the complementary and contrasting CK Be advocates the &quot;be-yourself&quot; concept. Calvin Klein CK Be is a distinctive fragrance enrobed in transparent white musk, toned by a spicy juniper note and tonic accords of mint and tangerine. To this unusual start, Calvin Klein added a hint of lavender that sustains the flowery magnolia scent, over a musky, woody end note with a warm skin-like fruity touch, which creates the perfume&#39;s unique character.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 135, '', NULL, NULL, 1, '2016-05-29 05:05:27', 1, 0, '2016-11-09 01:54:23'),
(77, 0, 74, 64, 5, 'PRO-77', 'CK Escape EDT 100ml for Men', '140.jpg', 'A fresh fragrance for the man who embraces his individuality and freedom. An adventurous blend of eucalyptus and melon with citrus, warmed by notes such as rosemary, fir and birch on bases of amber and sandalwood. Created by Calvin Klein in 1993, Escape i', '<p>A fresh fragrance for the man who embraces his individuality and freedom. An adventurous blend of eucalyptus and melon with citrus, warmed by notes such as rosemary, fir and birch on bases of amber and sandalwood. Created by Calvin Klein in 1993, Escape is a refreshing and masculine scent.</p>\r\n\r\n<p>Experience the woodsy scent of Calvin Klein&#39;s Escape eau de toilette spray for men. This scent offers a masculine fragrance that&#39;s versatile enough for both everyday wear and for a special night on the town. The 3.4-ounce spray is quick and convenient when you want just a touch of scent as you rush out the door.<br />\r\n<br />\r\nThis designer fragrance features an intriguing blend of wood, spice and citrus to create a unique men&#39;s scent. Escape&#39;s notes of birch leaf and cypress remind you of a walk in the woods, while the grapefruit note adds a subtle sharpness. Hints of clary sage, patchouli and veviter blend together to create a touch of warmth underlying the sharper topnotes.</p>\r\n', '', '', 135, '', NULL, NULL, 1, '2016-05-29 05:05:49', 1, 0, '2016-11-09 01:54:23'),
(78, 0, 75, 70, 5, 'PRO-78', 'CK Escape EDP 100ml for Women', '141.jpg', 'A romantic, feminine fragrance with with a hint of marine scent. Escape opens with camomile, apple, lychee, mandarine, rose, plum and peach, balanced by coriander and sandalwood.', '<p>A romantic, feminine fragrance with with a hint of marine scent.&nbsp;<strong>Escape</strong>&nbsp;opens with camomile, apple, lychee, mandarine, rose, plum and peach, balanced by coriander and sandalwood. It was created in 1991.</p>\r\n\r\n<p>Calvin Klein created the ESCAPE fragrance for the woman who aspires to realize her deepest passions and true desires, escaping the boundaries of everyday life. The ESCAPE fragrance suggests a philosophy of living life free from inhibitions in order to pursue her innermost pleasures.</p>\r\n\r\n<p>ESCAPE fragrance. Precious ingredients from all over the world have been blended into a fresh, fruity, floral bouquet with a heart of exotic spices and a woody, sensuous background.</p>\r\n\r\n<p><strong>Fragrance Notes</strong></p>\r\n\r\n<p><strong>Top notes:</strong>&nbsp;chamomile, apple, lychee, ylang-ylang, tagette, coriander, hyacinth, black currant, mandarin nuances.<strong>Middle notes:</strong>&nbsp;jasmine, rose, osthmanthus, plum, peach, muguet, clove, carnation.</p>\r\n\r\n<p><strong>Bottom notes:</strong>&nbsp;musk, sandalwood, tonka, vetiver.</p>\r\n\r\n<p>Calvin Klein Escape for women is a feminine perfume that possesses a fruity floral blend of romance.Top Notes: Apple, Mandarin Orange Heart Notes: Rose, Plum, Peach, Base Notes: Musk, Sandalwood&nbsp;</p>\r\n', '', '', 143, '', NULL, NULL, 1, '2016-05-29 06:05:44', 1, 0, '2016-11-09 01:54:23'),
(79, 0, 74, 53, 5, 'PRO-79', 'CK One 200ml  for Men', '143.jpg', 'Calvin Klein CK One for Men Women is an irresistible fragrance designed for both men and women. CK One’s hypnotic aroma perfectly fuses fresh, juicy fruits with exotic flowers, fragrant woods and aromatic spices. In spite of having so many ingredients, th', '<p>Calvin Klein CK One for Men Women is an irresistible fragrance designed for both men and women. CK One&rsquo;s hypnotic aroma perfectly fuses fresh, juicy fruits with exotic flowers, fragrant woods and aromatic spices. In spite of having so many ingredients, the scent is not overbearing. Such perfect concoction was created by legendary noses Alberto Morillas and Harry Fremont. It is packaged in a frosty 200ml glass bottle sealed with a unique twist off cap. It also comes with a spray nozzle that takes the place of the cap, once opened. The famous Clavin Klein logo is boldly embossed on the front. A highly stylized matching white carton holds the glass bottle.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The top notes of the fragrance produce refreshing notes of juicy pineapple, green notes, mandarin orange, papaya, bergamot, cardamom and lemon.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The core notes exude intense floral and spicy aromas of nutmeg, violet, orris root, jasmine, lily of the valley and rose.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The scent settles on a woody base of sandalwood, amber, musk, cedar and oakmoss.</p>\r\n', '', '', 135, '25', NULL, NULL, 1, '2016-05-29 06:05:56', 1, 0, '2016-11-09 01:54:23'),
(80, 0, 74, 39, 5, 'PRO-80', 'CK IN 2 U EDT 100ml for Men', '144.jpg', 'Size:100 ml\r\nThis fragrance has sour notes and bold citrus aromas. The two scents are designed to complement each other. With middle notes of Japanese basil and cocoa bean, with a strong base note of vetiver, this fragrance is bold and masculine.', '<h3><strong>Ingredients</strong></h3>\r\n\r\n<p>Alcohol Denat.,Aqua/Eau/Water,Parfum/Fragrance,Limonene,Ethylhexyl Methoxycinnamate,Linalool,Butylphenyl Methylpropional,Benzophenone-3,Ethylhexyl Salicylate,Citronellol,Butyl Methoxydibenzoylmethane,Propylene Glycol,Alpha-Isomethyl Ionone,Coumarin,Citral,Benzyl Benzoate,Geraniol,Eugenol,Bht,Acrylates/Octylacrylamide Copolymer,Hydrolyzed Jojoba Esters, Ext. D&amp;C Violet No 2 (Ci 60730),Fd&amp;C Red No 4 (Ci 14700)Fd&amp;C Yellow No 5 (Ci 19140),Fd&amp;C Green No 3 (Ci 42053)</p>\r\n', '', '', 105, '', NULL, NULL, 2, '2016-05-29 06:05:18', 1, 0, '2016-08-25 06:47:07'),
(81, 0, 75, 38, 5, 'PRO-81', 'CK IN 2 U EDT 100 ml  for Women', '9453.jpg', 'The Calvin Klein Ck In2U Perfume for Women is intended for young generation that is freed by technology. This ‘technosexual generation’ expresses freedom and eyes the possibilities of exploring the world. ', '<p>The Calvin Klein Ck In2U Perfume for Women is intended for young generation that is freed by technology. This &lsquo;technosexual generation&rsquo; expresses freedom and eyes the possibilities of exploring the world. This fresh floral fragrance with a woody oriental base is sure to garner attention with its combination of aromatic flora. The perfume was launched in 2007 by the house of Calvin Klein, and is the creation of perfumers Bruno Jovanovic, Jean Marc Chaillan, Loc Dong, and Carlos Benaim. The perfume can be described as a floral concoction with a woody oriental base, whose composition opens with pink grapefruit, bergamot with a hint of red currant leaves. Sweet notes of sugar orchid and white cactus form the heart of this fragrance. The base notes exude amber, red cedar, and vanilla fragrances. This 100ml perfume comes packed in an urban bottle with simple, attractive, and minimalist design.</p>\r\n\r\n<p><strong>Calvin Klein</strong>&nbsp;launched a new duo CK IN2U, his first duo instead of unisex fragrances. This trendy pair is intended for young generation, that&nbsp;<strong>Calvin Klein</strong>cristened as &quot;techno-sexual generation&quot;. CK IN2U expresses freedom and possibilities of young people to explore the wolrd. The young and sexy juice is in the urban bottle, simple and attractive in its minimalist design. With CK IN2U&nbsp;<strong>Calvin Klein</strong>&nbsp;demonstrates that he still knows what young people need.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Described as a fresh floral with a woody oriental base, the composition opens with fresh pink grejpfruit and bergamot with a note of red currant leaves. The interesting notes of sugar orchid and white cactus are in the heart. The base notes are: amber, red cedar and vanilla.<br />\r\nThe perfume was launched 2007.&nbsp;<strong>CK IN2U for Her</strong>&nbsp;was created by&nbsp;Bruno Jovanovic,&nbsp;Jean-Marc Chaillan,&nbsp;Loc Dong&nbsp;and&nbsp;Carlos Benaim.</p>\r\n', '', '', 105, '', NULL, NULL, 1, '2016-05-29 06:05:18', 1, 0, '2016-11-09 01:54:23'),
(82, 0, 75, 72, 5, 'PRO-82', 'Davidoff Coolwater EDT 100ml for Women', '146.jpg', 'The Cool Water Woman by Davidoff for Women provides a hauntingly romantic scent that is composed using calm aquatic notes. This Eau de Toilette is released ten years after the successful launch of Cool Water for men. This scent has been created to remind ', '<p>The Cool Water Woman by Davidoff for Women provides a hauntingly romantic scent that is composed using calm aquatic notes. This Eau de Toilette is released ten years after the successful launch of Cool Water for men. This scent has been created to remind us of ocean breeze and cool sea water. The top notes are composed of luscious pineapple notes that blend perfectly with quince, black currant, lily, melon, lemon, lotus, and calone, to provide a mesmerizing essence. The core of the scent consists of honey, hawthorn, jasmine, water lily, lily of the valley, lotus, and rose, that together provide a sweet floral aroma. The base is comprised of blackberry, violet root, sandalwood, musk, raspberry, vanilla, peach, and vetiver. This Eau de Toilette is contained in an elegant looking flacon and is available in a quantity of 100ml. Reputed perfumer Pierre Bourdon concocted it in 1996.</p>\r\n\r\n<p>Davidoff Cool Water Woman evokes the essence of luminous waters. Fruity notes of Quince and Blackcurrant, Pineapple and Honeydew Melon, combine with a fresh floral blend of Lotus Blossom and Waterlily. Together with invigorating top notes, a layered impression is created: one of energy and bliss, sensuality and serenity. Cool Water Woman is a scent as refreshing as water itself. It is presented in a translucent blue bottle, elegantly designed to reflect a droplet of water.</p>\r\n\r\n<p>ven years after the successful launch of&nbsp;<strong>Cool Water</strong>&nbsp;for men, women&rsquo;s version was finally released. The scent is very calm with aquatic notes that remind us of ocean breeze and cool sea-water, fruits and woods. Top notes are luscious, cool and aquatic with Citrus, Honeydew Melon, Quince, Pineapple, Lotus and Lily. Heart notes are gentle flowers; May Rose, Jasmine and Muguet. Base notes are Musk, Vanilla, Peach, Sandalwood, Orris and Vetiver.&nbsp;<strong>Cool Water</strong>&nbsp;was created by&nbsp;Pierre Bourdon&nbsp;in 1996.</p>\r\n', '', '', 105, '30', NULL, NULL, 1, '2016-05-29 07:05:38', 1, 0, '2016-11-09 01:54:23'),
(83, 0, 74, 66, 5, 'PRO-83', 'Davidoff Coolwater EDT 125ml for Men', '147.jpg', 'Cool Water by Davidoff is one of the best selling perfumes for men sold under the flagship of Swiss luxury tobacco goods brand.', '<p>Cool Water by Davidoff is one of the best selling perfumes for men sold under the flagship of Swiss luxury tobacco goods brand. It radiates a distinctly manly fragrance that is instantly recognizable. It was first launched in 1988 and has since been a staple in a connoisseur&rsquo;s collection. The perfume is known to evoke feelings of a flash of cool water on your skin. It offers a scintillating calming effect, while making a subtle yet bold impression. The fragrance is renowned for its extremely clean, aquatic, floral notes that will capture everyone&#39;s attention. Its fragrant notes create a one of a kind combination of refreshing spices and aromatic woods. Mint, lavender, coriander, and rosemary open the scent&rsquo;s composition. The intensive heart blends geranium, neroli, sandalwood and jasmine. Its base is composed of cedarwood, amber, musk, and tobacco. The perfume is the creation of master perfumer Pierre Bourdon. The Eau de Toilette is encased in 125ml light ocean blue flask with a black cap.</p>\r\n', '', '', 105, '30', NULL, NULL, 1, '2016-05-29 07:05:23', 1, 0, '2016-11-09 01:54:23'),
(84, 0, 75, 74, 5, 'PRO-84', 'Elizabeth Arden Green Tea Cherry Blossom 100ml for Women', '148.jpg', 'Elizabeth Arden celebrates cherry blossom with her new fragrance of the Green Tea collection. Sakura or cherry blossom inspired designers of the collection to launch a new edition of the Green Tea collection this spring.', '<p><strong>Elizabeth Arden</strong>&nbsp;celebrates cherry blossom with her new fragrance of the Green Tea collection. Sakura or cherry blossom inspired designers of the collection to launch a new edition of the Green Tea collection this spring. Name of the fragrance is&nbsp;<strong>Green Tea Cherry Blossom</strong>&nbsp;and brings a romantic composition created of luminous citruses, tea notes, cherry blossom and tree, enriched with woody warmth and sensuality.</p>\r\n\r\n<p>Top notes of the new&nbsp;<strong>Elizabeth Arden</strong>&nbsp;fragrance&nbsp;<strong>Elizabeth Arden</strong>&nbsp;<strong>Green Tea Cherry Blossom</strong>&nbsp;will win you over with sparkling and luminous accords of lemon and bergamot. Its refreshing drops are combined with green tea vapor to announce delicate cherry blossom mixed with fine notes of green tea leaves. A base incorporates woody notes of birch tree intertwining with angelica and moss.</p>\r\n\r\n<p>The fragrance was launched in 2012 and is available in a flacon characteristic of Green Tea edition. It is colored in pink and decorated with white cherry blossom.</p>\r\n\r\n<p>Fragrance Mood: Ethereal. Fresh. Feminine. Green Tea Cherry Blossom captures the mesmerizing and ethereal beauty of cherry blossoms at the peak of spring. It brings together the sparkling femininity of delicate pink petals and the lush freshness of green tea leaves to create a truly unique and beautiful fragrance experience.</p>\r\n\r\n<p><strong>Top Notes:</strong>Bergamot, Meyer Lemon, Tangerine, Orange Trees, Green Tea Vapor, Sweet Almond<br />\r\n<br />\r\n<strong>Middle Notes:&nbsp;</strong>Cherry Blossom Tree ScentTrekTM, Ume Plum, Apricot, Chinese Peony, Green Tea Leaves<br />\r\n<br />\r\n<strong>Base Notes:</strong>White Birch, Moss, Skin Musks, Heliotrope, White Lily</p>\r\n', '', '', 90, '', NULL, NULL, 1, '2016-05-29 07:05:49', 1, 0, '2016-11-09 01:54:23'),
(85, 0, 75, 76, 5, 'PRO-85', 'Escada Magnetism EDP 75ml for Women', '149.jpg', 'Magnetism perfume for Women by design house Escada was launched in 2003; the noses behind this fragrance are by perfumers Pierre Bourdon and Steve De Mercado. Escada Magnetism is classified as Oriental Vanilla fragrance. ', '<p>Magnetism perfume for Women by design house Escada was launched in 2003; the noses behind this fragrance are by perfumers Pierre Bourdon and Steve De Mercado. Escada Magnetism is classified as Oriental Vanilla fragrance.&nbsp;</p>\r\n\r\n<p>Escada magnetism for women its striking deep-magenta curved glass bottle, magnetism is a powerfully confident eau de perfume from escada. Sculptured like a precious gem, the fragrance evokes the power of attraction from a crystal. A modern feminine fragrance with an elegant floral fragrance with an elegant floral heart built on the sensual base of sandalwood and oriental vanilla. Escada magnetism delights and attracts, just like the woman who wears it.</p>\r\n\r\n<p>This captivating and magnetizing fragrance evokes the power of attraction. It delights and attracts just like the woman who wears it.Its sophisticated, sweet and intense scent built around rose and sensual vanilla makes it perfect to reveal your powerful and seductive side.</p>\r\n\r\n<ul>\r\n	<li>Top Note: Blackcurrant</li>\r\n	<li>Heart Note: Rose</li>\r\n	<li>Base Note: Coconut, Caramel</li>\r\n</ul>\r\n', '', '', 195, '13', NULL, NULL, 1, '2016-05-29 08:05:13', 1, 0, '2016-11-09 01:54:23'),
(86, 0, 75, 79, 5, 'PRO-86', 'Elizabeth Arden Green Tea Lavender 100ml for Women', '150.jpg', 'Elizabeth Arden launched green tea lavender in 2010 as a new flanker from the green tea scents. Green tea lavender has one of the highest quality certified . Purple wave so f blossom captivate the eye organic essential oils available .', '<p>Elizabeth Arden launched green tea lavender in 2010 as a new flanker from the green tea scents. Green tea lavender has one of the highest quality certified . Purple wave so f blossom captivate the eye organic essential oils available .</p>\r\n\r\n<p>Green Tea Lavender by Elizabeth Arden is a carefree aromatic fragrance which relaxes and refreshes. Top notes are amalfi lemon, mandarin orange, chamomile and mint; middle notes are lavender, tea and Carribbean magnolia; base notes are musk and ambrette.</p>\r\n\r\n<p>Green Tea Lavender Perfume by Elizabeth Arden, This romantic and aromatic fragrance was released in 2010&nbsp;. It has top notes of spearmint, chamomile, sicilian mandarin, and lemon. The heart is blended with chinese magnolia, green tea, lavender, and oolong tea. The bottom closes with ambrette seed, birch and musk.</p>\r\n', '', '', 105, '', NULL, NULL, 1, '2016-05-29 08:05:35', 1, 0, '2016-11-09 01:54:23'),
(87, 0, 75, 82, 5, 'PRO-87', 'GUCCI Guilty EDP Intense 75ml for Women', '151.jpg', 'A floral oriental fragrance for contemporary women. Warm, classy, spicy, strong & inebriating.The Scent opens with a natural rush that is mandarin. The middle notes reveal a blossoming of lilac, enriched with the sensual femininity of powdery violet and h', '<p>A floral oriental fragrance for contemporary women. Warm, classy, spicy, strong &amp; inebriating.The Scent opens with a natural rush that is mandarin. The middle notes reveal a blossoming of lilac, enriched with the sensual femininity of powdery violet and heliotropine.&nbsp;</p>\r\n\r\n<p>The effect is at once arresting and enthrallingly seductive. Frida Gianinni observes: &quot;In Gucci Guilty Intensewe have created a fragrance that truly captivates the senses.&quot; The scent seizes attention with a flamboyant opening born of the natural rush.</p>\r\n\r\n<p><strong>Fragrance Note</strong></p>\r\n\r\n<p>Top note: Mandarin, pink pepper</p>\r\n\r\n<p>Middle note: Lilac, violet, andheliotropine</p>\r\n\r\n<p>Base: Patchouli</p>\r\n', '', '', 300, '', NULL, NULL, 1, '2016-05-30 02:05:38', 1, 0, '2016-11-09 01:54:23'),
(88, 0, 75, 85, 5, 'PRO-88', 'GUCCI Guilty EDT 75ml for Women', 'GUICCI_GUILTY_EDT-1.jpg', 'Gucci Guilty Eau De Toilette Spray is a lively fragrance for alluring, bold, brave & sexy girls. Cheery, bodily and seductive for fun and enjoyment. The feature notes are mandarin, pink pepper, peach, and lilac. ', '<p>Gucci Guilty Eau De Toilette Spray is a lively fragrance for alluring, bold, brave &amp; sexy girls. Cheery, bodily and seductive for fun and enjoyment. The feature notes are mandarin, pink pepper, peach, and lilac. This beautiful perfume is blended together with notes of geranium, amber &amp; patchouli. A scent of defiance, the wearer of Gucci Guilty is the architect of her own destiny. Gucci Guilty is a warm yet arresting oriental flowery scent that carries pleasure, and seeks for the heart, it then seizes the awareness with a colourful opening of mandarin, sparkling alongside a daring scattering of pink pepper. The result is at once arresting and compellingly seductive to a woman. With top notes of mandarin and pink pepper followed by middle notes of lilac, geranium and peach this then overflows to give us the bottom notes of patchouli and amber. Guilty is Presented in muted golden metal flacon with interlocked Gs as a design. Awards Marie Claire International Fragrance Awards 2011- British Jury Award. A sensual and distinctive perfume for a woman that likes to state how unique and sexy she is. Gucci Guilty is recommended to be worn during the evening and is aimed at the middle aged woman.</p>\r\n\r\n<p>The generation that inspires Alessandro Michele is characterised by a celebrative anarchy. They don&rsquo;t believe in conformity, submitting to labels or to gender rules, breaking free from common social boundaries. This modern declaration of self expression and sexuality ignites the campaign&rsquo;s powerful statement: #GuiltyNotGuilty</p>\r\n\r\n<p>Under the #GuiltyNotGuilty light, the original Gucci Guilty fragrances embody the new edge of the brand. They signify freedom, by breaking with traditional male and female fragrance ingredients.</p>\r\n\r\n<p>Gucci Guilty for Her is defined by a signature Foug&egrave;re accord of geranium, commonly used in men&rsquo;s scents. Intimate and magical Lilac flower laced with Amber in Gucci Guilty for Her radiates warmth and grace with a powerful lasting impression.</p>\r\n\r\n<p><strong>Top Note:&nbsp;</strong>Geranium, Pink Pepper</p>\r\n\r\n<p><strong>Heart Note:&nbsp;</strong>Lilac, Peach</p>\r\n\r\n<p><strong>Base Note:&nbsp;</strong>Amber, Patchouli</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 278, '', NULL, NULL, 1, '2016-05-30 03:05:29', 1, 0, '2016-11-09 01:54:23'),
(89, 0, 75, 88, 5, 'PRO-89', 'HUGO XX EDT 100ml for Women', '153.jpg', 'The subtly feminine and sensuous Hugo XX by Hugo Boss eau de toilette for Women is a blend of the delicate scent of basmati rice with just a touch of jasmine. This scent is very feminine, adds some sensuality, and stands out due to its other fruity floral', '<p>The subtly feminine and sensuous Hugo XX by Hugo Boss eau de toilette for Women is a blend of the delicate scent of basmati rice with just a touch of jasmine. This scent is very feminine, adds some sensuality, and stands out due to its other fruity floral.</p>\r\n\r\n<p><strong>Hugo XX</strong>&nbsp;is casual, gourmand and seductive fragrance dedicated to a mature and glamorous woman. The opening delights with the fresh notes of mandarin, blueberry and litchi which unite with intensive jasmine and luscious rose in the heart of the composition. The warm base is created of sensual musk and amber. It comes in 40ml and 100ml bottles.</p>\r\n\r\n<p><strong><strong>Hugo XX</strong></strong>&nbsp;was launched in 2007.</p>\r\n\r\n<p><strong>PERFUM NOTES</strong></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The scent from Hugo Boss opens with delightful fresh notes of mandarin orange, blueberry, and litchi. They together offer a very sweet and juicy side, with a sweet tropical note that is highly inviting.</p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>Uniting with the Top notes are the luscious heart notes of rose and basmati rice. They pose to be a blend of creamy, grassy, and earthy tones that are refreshing with every whiff.</p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>The warm foundation of this Hugo XX by Hugo Boss perfume comprises of sandalwood, amber, and musk. Sandalwood lends a milky, soft, delicious touch, with amber offering a sweet, resinous, cozy and warm, often rather a powdery note. Musk balances the composition and adds a subtle touch of sensuality and warmth.</p>\r\n', '', '', 180, '', NULL, NULL, 1, '2016-05-30 03:05:25', 1, 0, '2016-11-09 01:54:23'),
(90, 0, 74, 68, 5, 'PRO-90', 'HUGO XY EDT 100ml for Men', '154.jpg', 'Top Notes are pear leaf, cedar and bergamotMiddle Notes are basil and mintBase Notes are patchouli, musk and cedar', '<p>Top Notes are pear leaf, cedar and bergamotMiddle Notes are basil and mintBase Notes are patchouli, musk and cedar.&nbsp;<strong><strong>Hugo XY</strong></strong>&nbsp;by&nbsp;<strong><strong>Hugo Boss</strong></strong>&nbsp;is a Woody Aromatic fragrance for men.&nbsp;<strong><strong>Hugo XY</strong></strong>&nbsp;was launched in 2007. Top notes are pear leaf, cedar and bergamot; middle notes are basil and mint; base notes are patchouli, musk and cedar.HUGO XY is a distinctive and unusual composition of tangy, icy-fresh notes and green herbs. The exclusive Time Release Technology means that the fragrance lingers on your skin for an extraordinarily long time. The herby, green fragrance goes superbly with HUGO XX, the fragrance that your partner is wearing.&nbsp;</p>\r\n', '', '', 180, '21', NULL, NULL, 1, '2016-05-30 03:05:10', 1, 0, '2016-11-09 01:54:23'),
(91, 0, 75, 91, 5, 'PRO-91', 'GIVENCHY PAI NEO EDT 100ml for Women', '155.jpg', 'An energizing fragrance for adventurous men Divers hints of freedom, carefree & individuality Crisp, clean & subtle Gives woody notes of toscanol, myrtle & patchouli Ideal for daytime wear', '<p>An energizing fragrance for adventurous men Divers hints of freedom, carefree &amp; individuality Crisp, clean &amp; subtle Gives woody notes of toscanol, myrtle &amp; patchouli Ideal for daytime wear</p>\r\n\r\n<p>Pi is a mathematic constant often used in mathematics and physics. An irrational number. &pi; can be defined in Euclid&#39;s pyramid as a relation between volume and diameter of a circle. &pi; is also known as Archimedes&#39; constant and Ludolf&#39;s number. The name Pi denotes perimetros, which means &#39;to measure around&#39; when translated from Greek.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Givenchy</strong>&nbsp;combined Pi with futuristic Neo from Matrix and reached&nbsp;<strong>Givenchy</strong>&#39;s constant: &#39;to smell well everywhere&#39;!</p>\r\n\r\n<p><strong>Pi Neo</strong>&nbsp;arrives in a glass bottle and by its design it reminds of the original Pi, with a difference that it is not shaped like a pyramid, but like a square, with sharp cut sides and the same top as its predecessor, but this time made of metal and coloured in silver.</p>\r\n\r\n<p>As for the composition, the olfactive director Francoise Dounche was in charge of this new futuristic composition. He designed this neo-explosive fragrance and combined natural ingredients for the first time: bergamot, mandarin, cedar, patchouli and vanilla with synthesis of three molecules (Toscanol, Safraleine and Cosmone), which makes a completely different base of the fragrance and contributes to a sensational composition. The result is quite special and can be compared with a new dimension created between time and space.</p>\r\n\r\n<ul>\r\n	<li>Top Notes of Bergamot, Mandarin Orange</li>\r\n	<li>Middle Notes of Cedar, Myrtle</li>\r\n	<li>Base Notes of Patchouli</li>\r\n</ul>\r\n', '', '', 218, '', NULL, NULL, 1, '2016-05-30 06:05:25', 1, 0, '2016-11-09 01:54:23'),
(92, 0, 74, 30, 5, 'PRO-92', 'GIVENCHY Pour Homme Blue Label  EDT 100ml for Men', '156.jpg', 'This is a relaxing and carefree version of Givenchy pour Homme. It is a fresh and dynamic fragrance for an active man which appreciates freedom. ', '<p>This is a relaxing and carefree version of Givenchy pour Homme. It is a fresh and dynamic fragrance for an active man which appreciates freedom. The fragrance has preserved the elegance, but has gained a new rebellious note. The combination of woodsy notes has got a new intensity and accord due to fresh cocktail of grapefruit and bergamot and presence of hedione.&nbsp;When&nbsp;applying&nbsp;any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.&nbsp; For instance, your mood, stress level, age, body chemistry,&nbsp;diet, and current medications may all alter the scents you wear.&nbsp;&nbsp;Similarly, factor such as dry or oily&nbsp;skin can even affect the amount of time a fragrance will last after being applied.</p>\r\n\r\n<p>Blue Label embodies the energy, style, and attitude of today&#39;s man. From chilling out to thrilling adventure this invigorating cocktail of fresh citrus mingled with aquatic notes, vibrant spices, and masculine woods makes the perfect accessory for the man who wants it all.<br />\r\n<br />\r\n<strong>Notes:</strong><br />\r\nBergamot, Hedione, Grapefruit, Tangerine, Pepper, Davana, Cardamom, Oliban Wood, Cedarwood, Vetiver.</p>\r\n', '', '', 210, '37', NULL, NULL, 1, '2016-05-30 06:05:07', 1, 0, '2016-11-09 01:54:23'),
(93, 0, 74, 71, 5, 'PRO-93', 'Lacoste Essential EDT 125mlfor Men', '157.jpg', 'This Lacoste Essential EDT is a fresh and fruity fragrance that combines top notes of aquatic circus, bergamot, tomato leaves', '<p>This Lacoste Essential EDT is a fresh and fruity fragrance that combines top notes of aquatic circus, bergamot, tomato leaves and cassis with a heart of spicy floral and a base of patchouli and woody accords. What perks you up at the very start is the introductory note of this Lacoste men&rsquo;s fragrance of bergamot, tangerine, tomato leaf, and black currant. The heart of this Lacoste EDT surprises you with spicy and floral essences of black pepper and rose. The base of this Lacoste men&rsquo;s fragrance includes hints of sandalwood and patchouli. Enclosed in a classy looking bottle, the Lacoste Essential is something you will preserve even after it&rsquo;s over.</p>\r\n\r\n<p>Eau De Toilette Spray 4.2 Oz / 125 Ml. Enjoy Unique Fresh And Spicy Notes On An Elegant Woody Base And Experience The Spirit Of Freedom. 2005. Enjoy Unique Fresh And Spicy Notes On An Elegant Woody Base And Experience The Spirit Of Freedom.</p>\r\n', '', '', 210, '18', NULL, NULL, 1, '2016-05-30 06:05:35', 1, 0, '2016-11-09 01:54:23'),
(94, 0, 74, 73, 5, 'PRO-94', 'Lacoste Essential Sport EDT 125ml for Men', '158.jpg', 'Lacoste -Essential Sport 125ml For Him Lacoste introduce Essential Sport fronted by professional kiteboarder Antoine Auriol. ', '<p>Lacoste -Essential Sport 125ml For Him Lacoste introduce Essential Sport fronted by professional kiteboarder Antoine Auriol. Experience the invigorating freshness of Essential Sport, driven by ice cold citrus and spices, powered by smooth masculine notes.Top Notes: Pink Grapefruit, Bergamot, Frosted Ginger,Tangerine.Heart Notes: Nutmeg, Juniper, Geranium, Green Splash accord.Base Notes: White Musk, Vetyver, Amber, Patchouli.</p>\r\n', '', '', 218, '19', NULL, NULL, 1, '2016-05-30 07:05:54', 1, 0, '2016-11-09 01:54:23'),
(95, 0, 75, 94, 5, 'PRO-95', 'Versace Bright Crystal Absolu EDP 90ml for Women', '159.jpg', 'Versace Bright Crystal Absolu for Women is a stunning fragrance that boasts of enhanced intensity and longevity as promised by the creative director of the Versace brand, the famous Donatella Versace. \r\n', '<p>Versace Bright Crystal Absolu for Women is a stunning fragrance that boasts of enhanced intensity and longevity as promised by the creative director of the Versace brand, the famous Donatella Versace. Alberto Morillas, the nose behind other magnificent scents such as Versace Yellow Diamond and Versace Pour Homme, is the creator of this amazing fragrance. This perfume becomes a woman who is lovely, sophisticated, stylish and graceful. It is perfect for those elegant evening dinners or a business luncheon. The fragrance is contained in a splendid glass flacon that is a dazzling pink color. It is transparent and would make for a great collector&#39;s item. The star of the show however is the brilliant pink stopper that resembles an enormous pink jewel. It is available in quantities of 90ml in the eau de parfum concentration.</p>\r\n\r\n<p>Creative director of the&nbsp;<strong>Versace</strong>&nbsp;brand - Donatella&nbsp;<strong>Versace</strong>&nbsp;accentuates that this is a fragrance with enhanced intensity and longevity, the composition of which provides a vibrant perfume full of love.</p>\r\n\r\n<p>Composition of the fragrance&nbsp;<strong>Versace</strong>&nbsp;<strong>Bright Crystal Absolu</strong>&nbsp;is signed by&nbsp;Alberto Morillas&nbsp;(creator of fragrances Bright Crystal edt,&nbsp;<strong>Versace</strong>&nbsp;Yellow Diamond and<strong>Versace</strong>&nbsp;Pour Homme), who enriched top notes with a blend of yuzu, pomegranate and accords of ice, refreshing the heart of raspberry, lotus, peony and magnolia. The base incorporates Acajou wood, amber and musk.</p>\r\n\r\n<p>The flacon has maintained the same form in somewhat darker pink than the original perfume, while outer carton is embellished with white-grey ornaments.&nbsp;</p>\r\n', '', '', 248, '', NULL, NULL, 1, '2016-05-30 08:05:49', 1, 0, '2016-11-09 01:54:23'),
(96, 0, 75, 96, 5, 'PRO-96', 'Tommy Girl  100ml for Women', '226.jpg', 'Filled with fiery spicy notes. Soft moss, sweet vanilla and milk compose the base notes of this soothing fragrance\r\n', '<p>Introduced in 1996. Fragrance notes: a refreshing and energetic floral, with low notes of sandalwood and heather. Recommended use: daytime.&nbsp;<strong><strong>Tommy Girl</strong></strong>&nbsp;by&nbsp;<strong><strong>Tommy Hilfiger</strong></strong>&nbsp;is a Floral Fruity fragrance for women.&nbsp;<strong><strong>Tommy Girl</strong></strong>&nbsp;was launched in 1996. The nose behind this fragrance is&nbsp;Calice Becker. Top notes are black currant, camelia, mandarin orange and apple tree blossom; middle notes are honeysuckle, lily, violet, mint, grapefruit, lemon and rose; base notes are magnolia, leather, sandalwood, jasmine and cedar.</p>\r\n\r\n<p>Tommy Girl by Tommy Hilfiger is a luxurious floral fruity fragrance that captures the essence of sipping tea on a gorgeous summer day in a blooming garden. The alluring scent is spirited, energetic and independent. The effervescent perfume is perfect for women of all ages. It smells heavenly and is sure to last long. The scent comes in a 100ml clear glass bottle, whose look is completed by a sleek silver cap. Master perfumer Calice Becker is the nose behind this mesmerizing fragrance.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />TOP NOTES</p>\r\n\r\n<p>Tommy Girl by Tommy Hilfiger opens with enchanting aromas of camelia, black currant, Mandarin orange, and apple tree blossom.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The heart exudes pleasing whiffs of lily violet, honeysuckle, mint, lemon, grapefruit and rose.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The base notes are composed of leather, magnolia, sandalwood, cedar and jasmine.</p>\r\n', '', '', 143, '', NULL, NULL, 1, '2016-05-31 01:05:31', 1, 0, '2016-11-09 01:54:23'),
(97, 0, 75, 98, 5, 'PRO-97', 'Versace Yellow Diamond EDT 90ml for Women', '228.jpg', 'The bottle is a unique creation featuring the luxury of clean geometry. It’s a design of timeless elegance, an exquisite modern piece of unrivalled beauty. "The color yellow recalls the brightness, sensuality, and great energy of this fragrance', '<p>The bottle is a unique creation featuring the luxury of clean geometry. It&rsquo;s a design of timeless elegance, an exquisite modern piece of unrivalled beauty. &quot;The color yellow recalls the brightness, sensuality, and great energy of this fragrance .&nbsp;<strong>Yellow Diamond</strong>&nbsp;is crafted as a pure, transparent and airy floral fragrance, sparkling and intense as the yellow color, while being luxurious and feminine like a diamond. Its composition opens with luminous freshness of lemon, bergamot, neroli and pear sorbet. The heart features airy orange blossom, freesia, mimosa and water lily. The base is made of amber, precious musk and guaiac wood.</p>\r\n\r\n<p>The bottle is shaped like the previous editions of the collection, colored in yellow, while its box is decorated with baroque ornaments. The face of the campaign is an Australian model Abbey Lee Kershaw, shot by Mario Testino in Paris.</p>\r\n\r\n<p>Infinite beauty reflects itself in the transparency of a diamond and radiates all around in beams of crystalline light. Pure as sunlight, a bright, extraordinary yellow light radiates with a fiery intensity and sparkles the way that only a diamond can. An authentic jewel of rare beauty is unveiled in Yellow Diamond, a fresh and vivid floral perfume by Versace.<br />\r\n<br />\r\nLike a burst of light, the fragrance gleams and glistens as it opens with notes of bright citron, a fresh pear sorbet, sparkling bergamot, and an accent of neroli. As its heart emerges, the rare elegance of orange blossom shines through the light of freesia and mimosa with the natural transparency of nymphea. The lingering base notes add a fascinating sense of sensuality with ambery woods, the sunny and vibrant character of palo santo wood, and the refined presence of musk.&nbsp;<br />\r\n<br />\r\nThe bottle is a unique creation featuring the luxury of clean geometry. It&rsquo;s a design of timeless elegance, an exquisite modern piece of unrivalled beauty. &quot;The color yellow recalls the brightness, sensuality, and great energy of this fragrance, able to depict and emphasize the charm and femininity of a woman&quot; &mdash;Donatella Versace&nbsp;<br />\r\n<br />\r\n<strong>Notes:</strong><br />\r\nCitron from Diamante, Pear Sorbet, Neroli, Bergamot, Nymphea, Freesia, Orange Blossom, Mimosa, Amber Wood, Palo Santo, Musk&nbsp;<br />\r\n<strong>Style:</strong><br />\r\nSurprising. Radiant. Fascinating.</p>\r\n', '', '', 210, '', NULL, NULL, 1, '2016-05-31 01:05:49', 1, 0, '2016-11-09 01:54:23'),
(98, 0, 74, 75, 5, 'PRO-98', 'Versace EROS EDT 100ml for Men', '162.jpg', 'Versace brings you a fragrance deeply inspired and having the essence of Greek mythology. This fragrance unleashes the raw and wild feelings of passion and accentuates untamed desire. ', '<p>Versace brings you a fragrance deeply inspired and having the essence of Greek mythology. This fragrance unleashes the raw and wild feelings of passion and accentuates untamed desire. The fragrance is named Eros for Men after the Greek god of love and son</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The top notes produce a luminous aura of freshness that is a combination of mouth watering notes of green apple, cool mint leaves and Italian lemon zest.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The heart of the fragrance produces an addictive sensuality with oriental and bewitching notes of tonka, Venezuelan ambroxan and geranium flowers.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The base of the fragrance is has a racy quality that is intense and powerful and includes soft and warm notes from vanilla, smoky vetiver, oak moss, Virginia cedar and Atlas cedar.</p>\r\n', '', '', 248, '20', NULL, NULL, 1, '2016-05-31 02:05:26', 1, 0, '2016-11-09 01:54:23'),
(99, 0, 74, 39, 5, 'PRO-99', 'Versace EAU Fraiche EDT 100ml for Men', '163.jpg', 'Versace Man Eau Fraiche was launched in 2006; it is a light and refreshing fragrance for sophisticated, confident man whose strength is in his soul, who feels free and knows how to enjoy life. \r\n', '<p>Versace Man Eau Fraiche was launched in 2006; it is a light and refreshing fragrance for sophisticated, confident man whose strength is in his soul, who feels free and knows how to enjoy life. Versace Man Eau Fraiche the scent starts with carambola, a bubbly unconventional personality which immediately makes a contract with the tradition of white lemon and with rosewood. The unique character of cedarwood rises through the heart note to highlight the tarragon and clary sage. To finish the base notes leave an alluring trail of sycamore wood, soothing amber and sparkling musk. The fragrance is perfect for day or evening wear.</p>\r\n\r\n<p>This new Versace Man version is fresher and more aquatic. While the original Versace Man had a certain Latino vibe to it due to tobacco note in its oriental surroundings, Eau Fraiche has a Mediterranean quality with some woody notes. Top notes include lemon, bergamot, rosewood, and rose. Heart notes feature cedar, tarragon, sage and pepper. Base notes are amber, musk, saffron and woody notes. Versace Eau Fraiche was created in 2006. The nose behind this fragrance is&nbsp;<a href="http://www.fragrantica.com/noses/Olivier_Cresp.html"><strong>Olivier Cresp</strong></a>.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 195, '15', NULL, NULL, 1, '2016-05-31 02:05:18', 1, 0, '2016-11-09 01:54:23'),
(100, 0, 74, 77, 5, 'PRO-100', 'Tommy 100ml for Men', '164.jpg', 'Tommy by Tommy Hilfiger is masculine and modern bursting with crisp energetic citruses.', '<p>Tommy by Tommy Hilfiger is masculine and modern bursting with crisp energetic citruses.Top Notes: Mint , Lavender, Bergamot, Lemon Heart Notes: Cranberry, Rose, Apple Base Notes: Amber, Cactus, Cotton&nbsp;</p>\r\n\r\n<p>Tommy is a spirited fragrance that embodies energy, enthusiasm and the American dream. Tommy fragrance takes an original approach to freshness with a blend of tangy citrus accords and cool herbal notes, evoking the invigorating purity of rain and fresh air.</p>\r\n', '', '', 143, '21', NULL, NULL, 1, '2016-05-31 02:05:48', 1, 0, '2016-11-09 01:54:23'),
(101, 0, 75, 99, 5, 'PRO-101', 'Versace Crystal Noir EDP 90ml for Women', '166.jpg', 'Versace Crystal Noir for Women is a bold attempt at recreating the classics in a very futuristic and chic way. Donatella Versace, the creative director of Versace, describes this fragrance as being a rare essence that is sensual and delicate.', '<p>Versace Crystal Noir for Women is a bold attempt at recreating the classics in a very futuristic and chic way. Donatella Versace, the creative director of Versace, describes this fragrance as being a rare essence that is sensual and delicate. It was created by the talented and renowned perfumer Antoine Lie and has a vintage aura that is beautiful and timeless. It was created in the year 2004 and continues to stun. Made for the woman who&rsquo;s beauty never grows old, a woman who dazzles and gleams like a diamond. It makes a great scent to wear at formal occasions like an elegant dinner or maybe even a night at the opera. The fragrance is contained in a rich maroon tinted glass flacon that is beautifully designed. The beauty of the flacon, however, lies in the stopper that is shaped like a large crystal. The fragrance is available in a quantity of 90ml in the eau de toilette concentration.</p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The scent opens out with beautiful notes of piquant ginger, cardamom, and pepper.</p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>In the heart of the fragrance is a pleasant bush of sweet gardenia, fresh smelling African Orange Flower, peony and creamy coconut.</p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>The base of the fragrance is a warm combination of elegant musk, oriental sandalwood, and rich amber.</p>\r\n\r\n<p>According to Donatella&nbsp;<strong>Versace</strong>,&nbsp;<strong>Crystal Noir</strong>&nbsp;is a rare essence, sensual and delicate. The central note of the composition is mysterious gardenia, fresh, sensual, luminous and creamy, reproduced by &#39;headspace&#39; technology,. Amber and musk in the base make the scent dark and mysterious, very sensual and distinct. The fragrance was created by&nbsp;<a href="http://www.fragrantica.com/noses/Antoine_Lie.html"><strong>Antoine Lie</strong></a>&nbsp;in 2004.</p>\r\n', '', '', 248, '', NULL, NULL, 1, '2016-05-31 02:05:42', 1, 0, '2016-11-09 01:54:23');
INSERT INTO `product` (`id`, `manufacture`, `category`, `order_no`, `reorder_qty`, `code`, `title`, `image`, `short`, `description`, `meta_des`, `meta_key`, `price`, `discount`, `clearance`, `clearance_discount`, `status`, `create_date`, `create_by`, `company_id`, `last_update`) VALUES
(102, 0, 75, 31, 5, 'PRO-102', 'Versace Crystal Noir EDT 90ml for Women', '167.jpg', 'At the heart of Crystal Noir is gardenia, a glowing, rich, yet subtle flower. Blended with warm, strong amber, it creates a contradiction: sweet and sensual, earthy and stylish. Just like the superb contradictions of a woman''s personality. ', '<p>At the heart of Crystal Noir is gardenia, a glowing, rich, yet subtle flower. Blended with warm, strong amber, it creates a contradiction: sweet and sensual, earthy and stylish. Just like the superb contradictions of a woman&#39;s personality. Versace Crystal Noir for Women is a rare and prized aroma that is sensual, delicate and memorable. Versace Crystal Noir for Women is an extremely sensual and overtly sexy amber fragrance that Donatella Versace created for her and it contains all of her much-loved flowers and essences.</p>\r\n\r\n<p>According to Donatella&nbsp;<strong>Versace</strong>,&nbsp;<strong>Crystal Noir</strong>&nbsp;is a rare essence, sensual and delicate. The central note of the composition is mysterious gardenia, fresh, sensual, luminous and creamy, reproduced by &#39;headspace&#39; technology,. Amber and musk in the base make the scent dark and mysterious, very sensual and distinct. The fragrance was created by&nbsp;Antoine Lie&nbsp;in 2004.</p>\r\n\r\n<p>Crystal Noir is coined as a sensuous and delicate perfume by legendary Donatella Versace. Launched in 2004, the perfume stays true to its name and brand.<br />\r\n<br />\r\nThe perfume opens with an incredible composition of aromas leading to a rare essence. It is said to embody an unusual and exotic combination. It blends the creamy and soft aroma of ginger in an incredible way while pepper gives a spicy touch and woody by sandalwood.<br />\r\n<br />\r\nThe central note of the composition appears mysteriously soothing with gardenia to attain a fresh feel in between before settling down to base of amber and musk. Pepper and sandal strikes a perfect balance and imparts a woody and spicy touch. With such original scents, this fragrance is very seductive and acts as second skin.</p>\r\n\r\n<ul>\r\n	<li>Top Notes: Ginger, Cardamom and Pepper</li>\r\n	<li>Middle Notes: Orange Blossom, Peony, Gardenia and Coconut</li>\r\n	<li>Base Notes: Sandalwood, Musk and Amber</li>\r\n</ul>\r\n', '', '', 210, '', NULL, NULL, 2, '2016-05-31 03:05:43', 1, 0, '2016-09-23 14:27:22'),
(103, 0, 74, 80, 5, 'PRO-103', 'Mont Blanc Legend Intense EDT 100ml for Men', '168.jpg', 'Legend intense is a modern and timeless interpretation of the legend scent with spicier, warmer notes in a unique metallic and carbon-colored bottle. ', '<p>Legend intense is a modern and timeless interpretation of the legend scent with spicier, warmer notes in a unique metallic and carbon-colored bottle. An enhanced version of the original Legend for men. Fresh, spicy, sweet, earthy and captivating.&nbsp;</p>\r\n\r\n<p>Montblanc Legend Intense is a modern and timeless interpretation of the original Legend scent. New notes of cardamom, pepperwood, and red apple provide a spicy, warm signature while maintaining the contemporary style and discreet refinement of Montblanc.</p>\r\n', '', '', 210, '27', NULL, NULL, 1, '2016-05-31 03:05:33', 1, 0, '2016-11-09 01:54:23'),
(104, 0, 75, 102, 5, 'PRO-104', 'Lanvin Marry Me EDP 75ml for Women', '169.jpg', 'Fragrance of dating and love, romantic and sensual, elixir of good mood! The perfume aims at all those who enjoy infatuation, love, unity, fulfillment. This intuitive and shamelessly direct fragrance says without fear: ""Marry me!""', '<p>Fragrance of dating and love, romantic and sensual, elixir of good mood! The perfume aims at all those who enjoy infatuation, love, unity, fulfillment. This intuitive and shamelessly direct fragrance says without fear: &quot;&quot;<strong>Marry me</strong>!&quot;&quot;</p>\r\n\r\n<p>The new fragrance by&nbsp;<strong>Lanvin</strong>&nbsp;was created with an intention to suggest a strong bond that each woman has with the perfume she chooses. You need a lot of love and emotions for a right date and chemistry which happens between her and the fragrance which is like her second skin, which follows her like a shadow and says a lot about her emotional state.</p>\r\n\r\n<p><strong>Marry Me</strong>&nbsp;is presented with a floral composition as optimistic as a cheerful smile. Combination of good humour and femininity intertwines with lovable, gentle dreams about love, similar to an embrace by a person you love. Perfumer who managed to pour dreams of love into a fragrant collage is&nbsp;Antoine Maisondieu. He lines floral notes like a romantic wreath of flowers.</p>\r\n\r\n<p>The composition is based on luminous tonic mixed of bitter Tunisian orange and sensual essences of Sambac jasmine. This surprising combination is wrapped in sweet zest of peach and sophisticated jasmine tea aromas. A sensual heart is painted with jasmine enhanced with magnolia blossom and romantic, non-chalant rose petals. Union of white flowers and fruit zest melts in juiciness and warmth of powerful hot amber and musky trail.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', 158, '', NULL, NULL, 1, '2016-05-31 03:05:13', 1, 0, '2016-11-09 01:54:23'),
(105, 0, 74, 83, 5, 'PRO-105', 'Lanvin L''Homme EDT 100ml for Men', '170.jpg', 'L''Homme by Lanvin. This is a fresh and aromatic fragrance for men. It contains of pomegranate blossom, lavender, mandarin, neroli, bergamot, pepper, mint, sage, cardamom, sandalwood, amber, musk and vanilla.', '<p>L&#39;Homme by Lanvin. This is a fresh and aromatic fragrance for men. It contains of pomegranate blossom, lavender, mandarin, neroli, bergamot, pepper, mint, sage, cardamom, sandalwood, amber, musk and vanilla.</p>\r\n\r\n<p><strong><strong>Lanvin L`Homme</strong></strong>&nbsp;by&nbsp;<strong>Lanvin</strong>&nbsp;is a Floral Woody Musk fragrance for men.&nbsp;<strong><strong>Lanvin L`Homme</strong></strong>&nbsp;was launched in 1997. The nose behind this fragrance is&nbsp; Alberto Morillas. Top notes are lavender, mandarin orange, neroli and bergamot; middle notes are pepper, mint, sage and cardamom; base notes are sandalwood, amber, musk and vanilla.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 128, '25', NULL, NULL, 1, '2016-05-31 03:05:14', 1, 0, '2016-11-09 01:54:23'),
(106, 0, 74, 86, 5, 'PRO-106', 'Lacoste Red 125ml for Men', '171.jpg', 'A fiery aromatic Masculine scent possessing a ''fresh and green'' tone that is both appealing and stylish. ', '<p>A fiery aromatic Masculine scent possessing a &#39;fresh and green&#39; tone that is both appealing and stylish. Top notes include cederwood and green apple, as well as longer lasting blends of jasmine, cedar leaves and white musk. Top notes are of green apple Middle notes are of pine tree Base notes are patchouli and vetiver Recommended for all occassions Eau de Toilette Size 125 ML.</p>\r\n\r\n<p>he Lacoste Red Men Eau De Toilette fragrance is one of the most popular fragrances from Lacoste. It was first launched in 1999 and has been a favorite of many since then.<br />\r\n<br />\r\nThe fragrance is fresh and sensual. It will intoxicate you with its enchanting notes of green apple, Siberian pine, and patchouli vetiver. This lively fragrance is perfect for an active man for the day as well as for evening wear.<br />\r\n<br />\r\nThe opening notes are from fresh green apples and have subtle floral accents that make the fragrance more and more desirable. Middle notes comprise of light, delicate jasmine blended with cedar wood. The dry down is amazingly sensuous with base notes of precious woods and white musk. The Lacoste Red is sure to enchant you and others alike! The Lacoste Red comes in a visually appealing sleek bottle with a red base.</p>\r\n', '', '', 203, '', NULL, NULL, 1, '2016-05-31 03:05:33', 1, 0, '2016-11-09 01:54:23'),
(107, 0, 75, 103, 5, 'PRO-107', 'Lanvin Eclat De Fleurs EDP 100ml for Women', '172.jpg', 'Lanvin celebrates a blooming, free and spontaneous femininity with Éclat de Fleurs. This delicate, fruity, floral scent reveals a joyful and natural sensuality surrounded by warmth, lightness and flowers.', '<p>Lanvin celebrates a blooming, free and spontaneous femininity with &Eacute;clat de Fleurs. This delicate, fruity, floral scent reveals a joyful and natural sensuality surrounded by warmth, lightness and flowers.</p>\r\n\r\n<p><strong><strong>Eclat de Fleurs</strong></strong>&nbsp;by&nbsp;<strong><strong>Lanvin</strong></strong>&nbsp;is a fragrance for women. This is a new fragrance.&nbsp;<strong><strong>Eclat de Fleurs</strong></strong>&nbsp;was launched in 2015.&nbsp;<strong>Eclat de Fleurs</strong>&nbsp;was created by&nbsp;<a href="http://www.fragrantica.com/noses/Anne_Flipo.html"><strong>Anne Flipo</strong></a>&nbsp;and<a href="http://www.fragrantica.com/noses/Nicolas_Beaulieu.html"><strong>Nicolas Beaulieu</strong></a>. Top note is pear; middle notes are jasmine, rose and freesia; base notes are white musk and sandalwood.</p>\r\n\r\n<p>Notes:</p>\r\n\r\n<p>- Top: pear accord.</p>\r\n\r\n<p>- Middle: floral bouquet.</p>\r\n\r\n<p>- Base: woody, musky accord.</p>\r\n', '', '', 218, '', NULL, NULL, 1, '2016-05-31 04:05:02', 1, 0, '2016-11-09 01:54:23'),
(108, 0, 74, 47, 5, 'PRO-108', 'Mont Blanc Legend EDT 100ml for Men', '173.jpg', 'Launched in April 2011, the Mont Blanc Perfumes & Fragrances Legend For Men eau de toilette is created by Olivier Pescheux, who has tried to create striking and stunning contrasts of strength and tenderness. Subtle yet very masculine, the fragrance is an ', '<p>Launched in April 2011, the Mont Blanc Perfumes &amp; Fragrances Legend For Men eau de toilette is created by Olivier Pescheux, who has tried to create striking and stunning contrasts of strength and tenderness. Subtle yet very masculine, the fragrance is an ode to inspiring and virtuous men. Fresh tones of bergamot, lavender, pineapple leaf and exotic verbena (Litsea Cubeba) open up a world of beauty and tenderness. Following these are the notes of oakmoss (evernyl molecule) merged with geranium, coumarin, apple, rose, and Pomarosa molecule (notes of dried fruit). Embrace masculinity with the base notes of sandalwood, tonka, and evernyl. The bottle of this perfume is inspired by the famous Meisterst&uuml;ck pen design, made of glass and metal. Reflecting the legendary feel that is very much the core of this fragrance, the 100ml bottle is slightly curved and flaunts heavy metallic colors.</p>\r\n\r\n<h3><strong>PERFUME NOTES</strong></h3>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" /><strong>TOP NOTES</strong></p>\r\n\r\n<p>The top notes of this EDT are bergamot, lavender, pineapple leaf and exotic verbena (Litsea Cubeba) inspiring freshness into your soul.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" /><strong>MIDDLE NOTES</strong></p>\r\n\r\n<p>The middle notes are made of oakmoss (evernyl molecule) merged with geranium, coumarin, apple, rose, and Pomarosa molecule (notes of dried fruit).</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" /><strong>BASE NOTES</strong></p>\r\n\r\n<p>Balance the tenderness with the intense appeal of sandalwood, tonka and evernyl, which forms the base of the fragrance.</p>\r\n', '', '', 195, '', NULL, NULL, 1, '2016-05-31 04:05:16', 1, 0, '2016-11-09 01:54:23'),
(109, 0, 74, 89, 5, 'PRO-109', 'Burberry Red EDT 100ml for Men', '174.jpg', 'Burberry for Men Eau de Toilette is a fresh and aromatic fragrance. The scent features bright top notes of bergamot, combined with the summer scents of lavender and mint. ', '<p>Burberry for Men Eau de Toilette is a fresh and aromatic fragrance. The scent features bright top notes of bergamot, combined with the summer scents of lavender and mint. Heart notes of moss, geranium and sandalwood add depth and vitality.&nbsp;Give your style-savvy look a perfect finish by wrapping yourself in this luxurious and charming fragrance exuded by the&nbsp; Red Eau de Toilette from Burberry.</p>\r\n\r\n<p><strong>A fresh and Energetic Fragrance</strong></p>\r\n\r\n<p>The top note with fresh accords of bergamot, lavender, mint and thyme enlivens your senses with energetic fragrance.</p>\r\n\r\n<p><strong>Moss, Geranium and Sandalwood give Depth and Vitality</strong></p>\r\n\r\n<p>The heart notes of moss, geranium and sandalwood give depth and vitality to this fragrance.</p>\r\n\r\n<p><strong>Amber and Cedarwood Add a Warm and Woody Aroma</strong></p>\r\n\r\n<p>A hint of amber and cedarwood lends a warm and woody aroma to this fragrance.</p>\r\n\r\n<p><strong>Clear Glass Bottle</strong></p>\r\n\r\n<p>Encapsulated in a clear glass bottle, this fragrance communicates about luxe style and class.</p>\r\n\r\n<p><strong>Burberry Men</strong>&nbsp;by Burberry is a woody aromatic fragrance for men.&nbsp;<strong>Burberry Men&nbsp;</strong>was launched in 1995. The nose behind this fragrance is&nbsp;Creations Aromatiques. Middle notes are sandalwood, jasmine and cedar; base notes are musk and vanilla</p>\r\n', '', '', 150, '', NULL, NULL, 1, '2016-05-31 05:05:28', 1, 0, '2016-11-09 01:54:23'),
(110, 0, 74, 92, 5, 'PRO-110', 'CK Encounter EDT 100ml for Men', '175.jpg', 'Calvin Klein launches a new fragrance in September 2012 - mysterious, seductive and masculine Encounter. The composition is developed by Firmenich perfumers Honorine Blanc and Pierre Negrin. ', '<p>Calvin Klein launches a new fragrance in September 2012 - mysterious, seductive and masculine Encounter. The composition is developed by Firmenich perfumers Honorine Blanc and Pierre Negrin. It opens with aromas of mandarin, cardamom and rum. Addictive top notes crisp spice, warm cognac and sensual woods with mandarin, cardamom and rum, leading to a heart of pepper, jasmine, patchouli and cognac and into a base of agarwood, Cedarwood and musk.&nbsp;<br />\r\nA contrast of freshness and warmth makes the fragrance a new, distinctive expression of unapologetic masculinity.&nbsp;Calvin Klein Encounter is Masculine, Intriguing and Seductive.</p>\r\n\r\n<p>Addictive top notes crisp spice, warm cognac and sensual woods with mandarin, cardamom and rum, leading to a heart of pepper, jasmine, patchouli and cognac and into a base of agarwood, Cedarwood and musk.&nbsp;<br />\r\nA contrast of freshness and warmth makes the fragrance a new, distinctive expression of unapologetic masculinity.</p>\r\n', '', '', 135, '', NULL, NULL, 1, '2016-05-31 05:05:20', 1, 0, '2016-11-09 01:54:23'),
(111, 0, 74, 95, 5, 'PRO-111', 'Carolina Herrera 212 Sexy EDT 100ml for Men', '176.jpg', 'The scent of the cosmopolitan, sophisticated and mysterious male. Enigmatic, seductive and very very sexy man embodies the urban sensuality of the New York cityscape\r\n', '<p>Carolina Herrera&rsquo;s 212 Sexy for Men is a striking, classy, mysterious, but above all sexy aftershave. It&rsquo;s both youthful and sophisticated aroma for men.Carolina Herreras reputation for creating strong, masculine fragrances continues with 212 Sexy Men Eau de Toilette, a sexy, bold aftershave which is appealing and leaves a lasting impression. A blend of Bergamot, Mandarin Orange and green top notes, heart notes of Pepper, Flowers and Cardamom and base notes of Amber, Musk, Guaiac Wood, Sandalwood and Vanilla, Carolina Herrera 212 Sexy Men is a balanced and distinctive scent.<br />\r\n<br />\r\nCarolina Herrera 212 Sexy Men Eau de Toilette comes in a stylish metal bottle with the 212 branding. A smooth and stylish fragrance for any modern man.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', 263, '27', NULL, NULL, 1, '2016-05-31 05:05:37', 1, 0, '2016-11-09 01:54:23'),
(112, 0, 74, 97, 5, 'PRO-112', 'Carolina Herrera 212 VIP EDT 100ml for Men', '177.jpg', '212 VIP MEN is the new masculine fragrance that completes the 212 VIP universe and represents the style and attitude of VIP men in New York. ', '<p>212 VIP MEN is the new masculine fragrance that completes the 212 VIP universe and represents the style and attitude of VIP men in New York. The 212 VIP man is charismatic, fun, elegant, sophisticated, desired and envied.</p>\r\n\r\n<p>Carolina Herrera 212 Vip Men was launched in 1998. Carolina was born in Venezuela and was a late starter in the fashion industry. She was known as the best dressed woman during the 1980s and also styled first lady Jackie Kennedy during her last days.<br />\r\n<br />\r\nThis perfume is a cocktail of different ingredients which includes the chilled Vodka Zubrowska, Caviar lime and the juicy hot ginger. The middle or the heart notes are gin tonic, spicy ginger and black pepper, the tasty passion fruit. The base notes which adds an aromatic smell are the royal King wood, the strong leather and the extreme amber.<br />\r\n<br />\r\nIt can surely evoke the man in you. The strong smell of these elements would allow you to feel fresh for a long time after spraying it. Its fragrance clings to your body to attract the feminine beauty around you.</p>\r\n', '', '', 278, '26', NULL, NULL, 1, '2016-05-31 06:05:24', 1, 0, '2016-11-09 01:54:23'),
(113, 0, 74, 29, 5, 'PRO-113', 'CK Eternity Aqua EDT 100ml for Men', '178.jpg', 'Eternity Aqua EDT for men by Calvin Klein is a fresh and distinctive daytime scent for men. Top Notes are Citruses, Cucumbers, Green Nodes and LotusMiddle Notes are Lavender, Virginia Cedar, Sichuan Pepper and PulmBase Notes are Patchouli, Guaiac Wood', '<p>Eternity Aqua EDT for men by Calvin Klein is a fresh and distinctive daytime scent for men.&nbsp;The new fragrance was created with an intention to presents a new face of Eternity edition for men, highlighted with a modern, casual, aquatic-woody composition.<strong>Eternity Aqua for Men</strong>&nbsp;opens with accords of cold cucumbers, citruses, lotus and green leaves. A heart blooms with a union of Sichuan pepper, Mirabelle plum, lavender and cedar, while a base finishes with sandalwood, Guaiac wood, patchouli and musk.</p>\r\n\r\n<p>Top: Cold cucumbers, citruses, lotus and green leaves, middle: sichuan pepper, mirabelle plum, lavender and cedar, bottom : sandalwood, guaiac wood, patchouli.</p>\r\n\r\n<p><strong>Product Features</strong></p>\r\n\r\n<p>It comes in a volume of 100ml. It is meant exclusively for men. It combines the fresh scents of cucumber and green leaves with the warmth of sandalwood and lavender. The scent was released in 2010.</p>\r\n', '', '', 150, '16', NULL, NULL, 2, '2016-05-31 06:05:32', 1, 0, '2016-10-05 04:02:59'),
(114, 0, 75, 105, 5, 'PRO-114', 'CK Eternity EDP 100ml for Women', 'ck_eternity-1.jpg', 'A romantic and floral scent from Calvin Klein. With notes of citrus, floral notes and pink sandalwood, this fragrance is an infusion of contemporary and classic aromas.\r\n\r\nThe worldwide fashion house of Calvin Klein produced his first fragrance in 1981. I', '<h3>Ingredients</h3>\r\n\r\n<p>Alcohol Denat, Parfum, Aqua, Benzyl Salicylate, Butylphenyl Methylpropional, Citronellol, Eugenol, Linalool, Ethylhexyl Methoxycinnamate, Hydroxycitronellal, Benzophenone-3, Ethylhexyl salicylate, Butylmethoxydibenzoylmethane, Hydroxyisohexyl 3 - Cyclohexene Carboxaldehyde, Geraniol, Isoeugenol, Cinnamyl, Alcohol, Limonene, BHT, Propylene Glycol, Benzyl Alcohol, Benzyl Benzoate, Acrylates/Octylacrylamide, Copolymer, Hydrolyzed Jojoba Esters CI 19140, CI14700.</p>\r\n', '', '', 143, '20', NULL, NULL, 1, '2016-05-31 06:05:02', 1, 0, '2016-11-09 01:54:23'),
(115, 0, 74, 100, 5, 'PRO-115', 'CK Eternity EDT 100ml for Men', '180.jpg', 'Eternity features a spicy and exciting blend of mandarin, lavender and green botanic top notes, geranium, jasmine, sage, basil and sandalwood middle notes and base notes of rosewood, vetiver and amber. ', '<p>ETERNITY for men fragrance symbolizes the spirit of today&#39;s man: sensitive yet masculine, refined yet strong. &ldquo;He&#39;s a romantic dedicated to basic values -- family, work, health and happiness. A man at ease with himself, in his relationships and with his world,&rdquo; says Klein. ETERNITY for men is the singular expression of the vitality and confidence that characterizes today&#39;s masculine sensibility.</p>\r\n\r\n<p>ETERNITY for men fragrance. A classic, refreshing scent that&#39;s exhilarating and distinctly masculine with a cool, crisp edge and a warm, woodsy trail.</p>\r\n\r\n<p>Add a refreshing and memorable scent to your collection of fragrances with the Calvin Klein 100ml eau de toilette spray. First launched in 1989, the Eternity EDT has become a top favourite with men all over the world, especially those who like to exude a sophisticated and confident scent. Ideal for daytime use, this exceptional eau de toilette perfume spray for men will take you from a day at the workplace to a leisurely day with friends. It&#39;s equally perfect for formal and informal occasions, especially if you team it with stylish outfits to reflect the essence of this cool fragrance.</p>\r\n', '', '', 128, '', NULL, NULL, 1, '2016-05-31 06:05:11', 1, 0, '2016-11-09 01:54:23'),
(116, 0, 75, 107, 5, 'PRO-116', 'CK Eternity Moment EDP 100ml for Women', '181.jpg', 'Inspired by the rush and excitement of falling in love, Eternity Moment by Calvin Klein is a feminine scent. With notes of pomegranate, Chinese pink peony blossom, warm rose wood and raspberry cashmere, this is a smooth, luscious scent he won''t be able to', '<h3>Ingredients</h3>\r\n\r\n<p>Aqua, Alcohol Denat, Parfum</p>\r\n', '', '', 128, '', NULL, NULL, 1, '2016-05-31 06:05:46', 1, 0, '2016-11-09 01:54:23'),
(117, 0, 74, 101, 5, 'PRO-117', 'CK Free EDT 100ml for Men', '182.jpg', 'CK Free incorporates absinth, jackfruit, star anise, juniper berries, suede, coffee and oak. The dynamic scent of freedom, it is a fragrance for men with ambition, scope, hopes and dreams.', '<p>CK Free incorporates absinth, jackfruit, star anise, juniper berries, suede, coffee and oak. The dynamic scent of freedom, it is a fragrance for men with ambition, scope, hopes and dreams.&nbsp;The new fragrance experience from ck Calvin Klein. A scent of uplifting freshness and warm masculinity to bring confidence and a &quot;take on the day&quot; attitude to every guy.&nbsp;<br />\r\n<br />\r\nThe woody aromatic scent, concocted by Givaudan, has top notes of Thailand star anise, jackfruit, absinthe and juniper berry; a heart of suede, tobacco leaves, coffee absolute and South African buchu, and a drydown of patchouli absolute, oakwood, Texan cedarwood and Costa Rican ironwood</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', 143, '', NULL, NULL, 1, '2016-05-31 07:05:21', 1, 0, '2016-11-09 01:54:23'),
(118, 0, 74, 32, 5, 'PRO-118', 'Davidoff The Game  EDT 100ml for Men', 'Davidoff-The-Game-EDT-1.jpg', 'The Davidoff Game edt is a strong and sublime woody fragrance for men. A new fragrance that was launched in 2012, the Game edt fragrance was done by Bernard Ellena from the Davidoff design house. ', '<p>The Game by Davidoff is a Woody Aromatic fragrance for men. This is a new fragrance. The Game was launched in 2012. The nose behind this fragrance is Bernard Ellena. Top notes are gin and juniper berries; middle notes are iris and precious woods; base note is ebony wood.</p>\r\n\r\n<p>Designed to suit the name, the Davidoff 100ml eau de toilette spray is contained in a brilliant bottle that resembles a stack of poker chips. This black and grey shaded bottle embodies the spirit of the fragrance and its name well perfectly. A premium men&#39;s fragrance, it defines intriguing masculine qualities like assertiveness and a winning streak in everything that&#39;s done. Refined to leave a remarkable impression, this eau de toilette perfume spray for men makes the smart man stand out from the rest of the crowd. Distinctive in looks and scent, this perfume is for those who like to get things done their way.</p>\r\n\r\n<p>The Game by Davidoff Eau de Toilette for Men provides you with a subtle yet strong scent that will complement your finest attires. Made for the strong and confident man, this Davidoff perfume speaks of a bold, irresistible fragrance that will linger all through the day. Since 2012, the Game from Davidoff has been providing men with a scent that is ideal for pleasure and business. A light spritz will go a long way to adding a sense of cool to your already suave demeanor. With its notes of ebony wood, precious woods, iris, juniper berries, and gin, this masculine fragrance provides a refreshing and energetic feeling. The 100ml EDT bottle features multiple black and gray casino chips that make it unique and distinct.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />TOP NOTES</p>\r\n\r\n<p>This fantastic aromatic creation of perfumers Bernard Ellena and Lucas Sieuzac opens with top notes of fresh gin fizz and juniper berries. Together they embrace an exhilarating, mind clearing fougere, with a slightly bitter and foresty taste that leaves behind a lingering freshness.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The hearts blends fusing notes of iris and precious woods. It gives the fragrance a mystical, elegant, and natural aroma that is associated with faith, hope, and love.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The fragrance unravels into a sensual dry down of dark ebony woods. This prized ornamental wood gives the composition that much needed volume. It lends a dark element to the upper layers of the pyramid, for a hypnotic aroma that follows you.</p>\r\n', '', '', 135, '', NULL, NULL, 2, '2016-05-31 08:05:58', 1, 0, '2016-10-05 04:04:46'),
(119, 0, 74, 104, 5, 'PRO-119', 'Davidoff Silver Shadow Altitude EDT 100ml for Men', '185.jpg', 'Silver Shadow Altitude for Men by Davidoff 3.4oz 100ml EDT SprayWhen applying any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.', '<p>Silver Shadow Altitude for Men by Davidoff 3.4oz 100ml EDT Spray When applying any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.&nbsp;Davidoff brings you a classy fragrance for men called the Silver Shadow Altitude for Men. This fragrance is a Woody Aromatic fragrance for the more mature men of the world. This fragrance is for the man who has been there and done that. He knows everything there is to know about everything and is always well informed. This fragrance was created by the famous perfumer Jean Jacques and hit the shelves in the year 2007. The fragrance is available in a transparent glass flacon that is designed to look elegant and refined accompanied by a silver colored stopper. The liquid is a light sky blue color and is available in a quantity of 100ml in the eau de toilette concentration.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The fragrance begins with a heady combination of juniper berries, hot and bracing green pepper and clearing elegant aroma from grapefruit.</p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>The heart of the fragrance is a combination of spicy notes from spicy sweet caraway, intensely sweet and aromatic cardamom, and peppery spicy celery combined with warm notes of cedar.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The base of the fragrance carries it into a lingering and slightly intoxicating level with incense, elegant musk, and cashmere wood.</p>\r\n', '', '', 113, '', NULL, NULL, 1, '2016-06-01 12:06:35', 1, 0, '2016-11-09 01:54:23'),
(120, 0, 74, 106, 5, 'PRO-120', 'Davidoff Silver Shadow EDT 100ml for Men', '186.jpg', 'Created for the modern man, the Davidoff Silver Shadow for Men is an intense, luxurious perfume from the Swiss maker of fine tobacco products and accessories.', '<p>Created for the modern man, the Davidoff Silver Shadow for Men is an intense, luxurious perfume from the Swiss maker of fine tobacco products and accessories. The mesmerizing Eau de Toilette bursts with refreshing, invigorating aromas of fresh fruits, warm spices, and fragrant woods. The nose behind this charismatic scent is master perfumer Francis Kurkdjian. Its top notes are a blend of fresh orange and spicy coriander. The perfume has warm middle notes of hot saffron and patchouli leaves. Base note radiate pleasing aromas of sensual amber, benzoin, and oak moss. The fragrance is packaged in a 100ml bottle made of solid glass that exudes authoritative elegance. The bottle is designed by Thierry de Baschmakoff.</p>\r\n\r\n<p><strong>Silver Shadow</strong>&nbsp;is an oriental woody fragrance which was presented in 2005. Fresh orange and spicy coriander open the composition, they lead to the mysterious heart combined of hot saffron and patchouli leaves. Warm, pleasant base notes feature sensual amber, benzoin and oakmoss.</p>\r\n', '', '', 113, '', NULL, NULL, 1, '2016-06-01 12:06:06', 1, 0, '2016-11-09 01:54:23'),
(121, 0, 75, 60, 5, 'PRO-121', 'Elizabeth Arden Arden Beauty EDP 100ml for Women', '187.jpg', '', '', '', '', 0, '', NULL, NULL, 2, '2016-06-01 12:06:05', 1, 0, '2016-07-24 07:22:32'),
(122, 0, 75, 108, 5, 'PRO-122', 'Elizabeth Arden Green Tea 100ml for Women', '188.jpg', 'Elizabeth Arden Green Tea for Women, from the stables of cosmetic giant Elizabeth Arden Inc, offers you a stylish way to feel rejuvenated and fresh throughout the day. The perfume has a refreshing citrus aromatic fragrance that is like a splash of cool wa', '<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />TOP NOTES</p>\r\n\r\n<p>The fragrance starts off with a splash of fresh and reviving notes of bergamot, mint and lemon and combines it with rhubarb and orange peel.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The heart of the fragrance is relaxing and peaceful with accords of gentle musk, sweet jasmine, soothing white amber, combined with bitter notes from oakmoss, spicy floral accords of carnation and fennel.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The base of the fragrance is like a cool soft breeze on a summer&#39;s day and is provided by sweet and spicy caraway, cloves, amber, musk, energizing green tea, jasmine, oakmoss and celery seeds.</p>\r\n', '', '', 90, '', NULL, NULL, 1, '2016-06-01 12:06:54', 1, 0, '2016-11-09 01:54:23'),
(123, 0, 75, 109, 5, 'PRO-123', 'Elizabeth Arden Green Tea Exotic 100ml for Women', '189.jpg', 'Green Tea Exotic, a fragrance which arrives on the market in 2009, introduces bergamot, black tea from Ceylon and lime in top notes. A heart includes purple vine blossom, orchid, lily, jasmine and green tea, while a base which focuses on woody accords, am', '<p>Top notes : Bergamot, black tea from Ceylon and lime&nbsp;<br />\r\nHeart notes : Purple vine blossom, orchid, lily, jasmine and green tea&nbsp;<br />\r\nBase notes : Woody accords, amber and white daffodil</p>\r\n', '', '', 90, '', NULL, NULL, 1, '2016-06-01 12:06:49', 1, 0, '2016-11-09 01:54:23'),
(124, 0, 75, 110, 5, 'PRO-124', 'Elizabeth Arden Green Tea Summer 100ml for Women', '190.jpg', 'Green Tea Summer by Elizabeth Arden is a Floral Fruity fragrance for women. Green Tea Summer was launched in 2005. Green Tea Summer was shaped by Rodrigo Flores-Roux and Claude Dir. The top notes of this fragrance are black currant, bergamot, tangerine an', '<p>Elizabeth Arden fragrances were made in association with perfumers Ann Gottlieb, Olivier Gillotin, Marypierre Julien, Yann Vasnier, Antoine Lie, George Fuchs, Francis Kurkdjian, Rodrigo Flores-Roux, Claude Dir, Carlos Benaim, Loc Dong, Jean-Marc Chaillan, Claire Cain, Laurent Bruyere, Clement Gavarry, Sophie Labbe, James Krivda, David Apel and Sophia Grojsman. Elizabeth Arden is an American fragrance, skincare and cosmetics establishment that was started by Canadian entrepreneur Florence Nightingale Graham in 1910. Graham used Elizabeth Arden as her specialised name as well as the name of her company. The company&#39;s initial focus was on skincare and cosmetics, and they opened the first Red Door spa in Manhattan, soon expanding to major cities around the world as their empire grew.</p>\r\n\r\n<h3>Ingredients</h3>\r\n\r\n<p>Alcohol Denat, Aqua / Water / EAU, Parfum / Fragrance, Limonene, Ethylhexyl Methoxycinnamate, Linalool, Benzophenone-3, Ethylhexyl Salicylate, Hydroxyisohexyl 3-Cyclohexene Carboxaldehyde, Butyl Methoxydibenzoylmethane, Benzyl Salicylate</p>\r\n', '', '', 90, '', NULL, NULL, 1, '2016-06-01 01:06:14', 1, 0, '2016-11-09 01:54:23'),
(125, 0, 74, 83, 5, 'PRO-125', 'Givenchy Blue Lable EDT 100ml for Men', '193.jpg', 'Givenchy Pour Homme Blue Label was designed to retain the elegance of the original version of this fragrance but add a few rebellious and carefree notes to give it a more relaxed and casual twist. ', '<p>Givenchy Pour Homme Blue Label was designed to retain the elegance of the original version of this fragrance but add a few rebellious and carefree notes to give it a more relaxed and casual twist.&nbsp;This is a relaxing and carefree version of Givenchy pour Homme. It is a fresh and dynamic fragrance for an active man which appreciates freedom. The fragrance has preserved the elegance, but has gained a new rebellious note. The combination of woodsy notes has got a new intensity and accord due to fresh cocktail of grapefruit and bergamot and presence of hedione.</p>\r\n\r\n<p>This is a relaxing and carefree version of Givenchy pour Homme. It is a fresh and dynamic fragrance for an active man which appreciates freedom. The fragrance has preserved the elegance, but has gained a new rebellious note. The combination of woodsy notes has got a new intensity and accord due to fresh cocktail of grapefruit and bergamot and presence of hedione. This perfume, as well as Givenchy pour Homme, was created by&nbsp;Alberto Morillas&nbsp;and&nbsp;Ilias Ermenidis&nbsp;in 2004.</p>\r\n', '', '', 210, '', NULL, NULL, 2, '2016-06-01 01:06:11', 1, 0, '2016-09-10 15:23:21'),
(126, 0, 75, 111, 5, 'PRO-126', 'Givenchy Eau De Moiselle EDT 50ml for Women', '194.jpg', 'Eaudemoiselle de Givenchy by design house Givenchy was launched in 2010 it is described as a floral scent for women. It is placed between the traditional and the modern, and it is ideal for young, contemporary women. The minimalistic flacon with discrete ', '<p>Eaudemoiselle de Givenchy by design house Givenchy was launched in 2010 it is described as a floral scent for women. It is placed between the traditional and the modern, and it is ideal for young, contemporary women. The minimalistic flacon with discrete curves is crowned with a cylindrical golden metal stopper. Eaudemoiselle De Givenchy by Givenchy note consists of top notes of Lemon, Tangerine, Basil, middle notes of Rose, Ylang Ylang and base notes of Musk, Ambrette (Musk Mallow), Tonka Bean. The fragrance was created by Francois Demachy, who described it as &#39;an imaginary rose in dewy morning&#39;</p>\r\n', '', '', 225, '', NULL, NULL, 1, '2016-06-01 01:06:06', 1, 0, '2016-11-09 01:54:23'),
