(163, 0, 56, 3, 5, 'PRO-163', 'DELL LATITUDE 5450-Ci5-5300U', 'LATITUDE-5300U.jpg', 'CORE i5-5300U/ 8GB/ 500GB/ 2GB GRA/ 14F/ DOS', '<p>14.0-inch NT HD+ (1600x900) AG LCD Display</p>\r\n\r\n<p>Intel Core i5-5300U Processor (Dual-Core, 2.3GHz, 3MB Cache)</p>\r\n\r\n<p>8GB DDR3 System Memory</p>\r\n\r\n<p>500GB (5400RPM) SATA Hard Drive</p>\r\n\r\n<p>Integrated Intel HD Graphics 5500</p>\r\n', '', '', NULL, '15', NULL, NULL, 1, '2016-06-06 04:06:21', 1, 0, '2016-11-01 08:26:42');
INSERT INTO `product` (`id`, `manufacture`, `category`, `order_no`, `reorder_qty`, `code`, `title`, `image`, `short`, `description`, `meta_des`, `meta_key`, `price`, `discount`, `clearance`, `clearance_discount`, `status`, `create_date`, `create_by`, `company_id`, `last_update`) VALUES
(164, 0, 62, 5, 5, 'PRO-164', 'Mosbeau Placenta White All in One Body Soap', 'body_soap-11.jpg', '<strong>MOSBEAU PLACENTA WHITE  ALL-IN-ONE  BODY SOAP  120g </strong>\r\n100% MADE IN JAPAN\r\n', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Work into rich lather and massage lightly on skin to remove deep-seated dirt from your pores.</p>\r\n\r\n<p>Use as a regular body soap. For best results, use daily.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Show off some skin and flaunt your radiant, younger-looking self with this hardworking body soap. It has <strong>Helston</strong>, a famous beauty ingredient from Japan that works well in cleansing, whitening and nourishing the skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Effectively absorbs dirt, cleanses, whitens and helps reduce the signs of aging on your skin with Helston (famous Japan beauty ingredient)</p>\r\n	</li>\r\n	<li>\r\n	<p>Easily lightens your complexion with the fusing performance of Horse Placental Protein, Japan Patented Marine Placental Protein, Cucumber Juice and Ryoku-cha Ekisu</p>\r\n	</li>\r\n	<li>\r\n	<p>Gently exfoliates your skin with Lactic, Malic and Citric Acid to prevent premature aging and improve skin conditions like spots, freckles, fine lines and excessive dryness</p>\r\n	</li>\r\n	<li>\r\n	<p>Normalizes your skin&#39;s moisture and provides suppleness with Algae Extract, and Hydrolyzed Collagen</p>\r\n	</li>\r\n	<li>\r\n	<p>Protects your skin from aging causing and harmful UV rays with Sericin &nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>It is clinically proven more effective skin-whitening and skin-nourishing ingredient with exemplary cell renewing and anti-aging properties than Pig Placenta Protein.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Algae Extract</strong></p>\r\n\r\n<p>Normalizes the skin&#39;s moisture content and provides suppleness to the epidermis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sericin</strong></p>\r\n\r\n<p>Creates a protective film on the skin to block pollution and harmful UV rays.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Citric Acid</strong></p>\r\n\r\n<p>Good for mild peeling to treat such skin conditions as fine lines and wrinkles, hyper-and depigmentation, spots and excessively dry skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Squalane</strong></p>\r\n\r\n<p>An effective moisturizer that will make your skin feel supple, look plumper and wrinkles will be less apparent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hydrolyzed Collagen</strong></p>\r\n\r\n<p>It forms a film on the surface of the skin making it smoother and softer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dipotassium Glycyrrhizate</strong></p>\r\n\r\n<p>Is an anti-irritant and anti-inflammatory component with skin-soothing properties.Clinical tests point to this ingredient as an effective treatment for atopic dermatitisbecause of its ability to reduce redness and irritation.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '11', NULL, NULL, 1, '2016-06-07 03:06:04', 1, 0, '2017-01-13 12:59:28'),
(165, 0, 62, 9, 5, 'PRO-165', 'Placenta White Underarm & Inner Thigh Cream', 'underArmInnerThighcream-1.jpg', '<strong>MOSBEAU \r\nPLACENTA WHITE\r\nUNDERARM & INNER THIGH CREAM     50g </strong>\r\n100% MADE IN JAPAN', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Get an ample amount of cream and apply on desired area. Do not apply on broken and irritated skin.</p>\r\n\r\n<p>For underarm use, refrain from applying the cream together with a deodorant..</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Say goodbye to unsightly dark spots. This award-winning dark spot remover targets problem areas like underarms, elbows, inner thighs, knees and other dark spots of the body.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Intensively and effectively whitens dark spotsin as little as 14 days with the combined superior whitening power of Bellis Perennis (Daisy) Flower Extract and Horse Placental Protein</p>\r\n	</li>\r\n	<li>\r\n	<p>Restores skin nourishment and moisturize your skin from damaging effects of UV rays with Sodium Hyaluronate</p>\r\n	</li>\r\n	<li>\r\n	<p>Maintain your youthful skin with the Anti-aging effects of Succinoyl Atelocollagen and ChlorellaVulgaris Extract</p>\r\n	</li>\r\n	<li>\r\n	<p>Wtih Ethylhexylglycerin, Chloramine-T and Persimmon Tannin aids at controlling underarm odor</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>Placental Protein is a popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, reverses aging and speeds up skin cell renewal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bellis Perennis Extract</strong></p>\r\n\r\n<p>Latest skin-whitening ingredient in Japan that actively influences all stages of melanin production to provide long-lasting whitening effect on skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Alpha-Arbutin</strong></p>\r\n\r\n<p>Recognized skin-whitening agent in Asia that naturally and visibly whitens skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fulvic Acid</strong></p>\r\n\r\n<p>Is the finest electrolyte known to man. Its electrolytes are able to restore vitality and have superior anti-aging components.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Artemia Extract</strong></p>\r\n\r\n<p>Protects the skin from UV damage.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:57', 1, 0, '2016-11-03 01:40:12'),
(166, 0, 62, 10, 5, 'PRO-166', 'New Placenta White Body Scrub', 'bodyscrub-1.jpg', '<strong>MOSBEAU PLACENTA WHITE ALL-IN-ONE  BODY SCRUB  300g</strong><br>\r\n100% MADE IN JAPAN', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Wet skin. Get an ample amount of scrub and lightly massage all over your body to remove dirt and impurities on the skin.</p>\r\n\r\n<p>Leave for a few minutes before rinsing well with water.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Bring out healthier, younger and fairer skin - scrub after scrub. This lavender-scented scrub gently exfoliates to reveal beautiful skin that&#39;s worth flaunting. Whitening, anti-aging, exfoliating, moisturizing. Do all these in just one scrub.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Reinforces skin anti-aging, visibly removes fine lines, tightens and improves your skin texture with Collagen and Royal Jelly.</p>\r\n	</li>\r\n	<li>\r\n	<p>Helps remove dead skin cell build-up and reduces cellulites without stripping your skin&#39;s natural moisture</p>\r\n	</li>\r\n	<li>\r\n	<p>Moisturizes, maintains skin elasticity and improves skin roughness with Honey and Acetyl Tyronise to keep your skin younger-looking and healty</p>\r\n	</li>\r\n	<li>\r\n	<p>Deeply cleanses and leaves your skin hydrated and makes it silky smooth instantly after every use</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Horse &amp; Marine Placental Protein</strong></p>\r\n\r\n<p>Placental Protein is popular skin-whitening agent in Japan. This ingredient is recognized for its exemplary capability to visibly whiten skin, remove wrinkles and fine lines, speed up skin cell renewal and detoxifies the body. Horse and Marine Placental Protein is the most effective and safe kind of Placental Protein for cosmetics or skin care use. These ingredients are patented in Japan for their clinically-proven safe and effective skin-whitening, anti-aging and skin renewal properties.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Collagen</strong></p>\r\n\r\n<p>Reverses skin aging and visibly removes wrinkles, fine lines and other unsightly signs of skin aging.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Paeonia Suffructicosa Root Extract</strong></p>\r\n\r\n<p>All natural skin whitening ingredient that also helps condition skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pueraria Lobota Root Extract</strong></p>\r\n\r\n<p>An herb extract that helps whitens skin while nourishing it.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Honey</strong></p>\r\n\r\n<p>Moisturizing ingredient that promotes skin rejuvenation to make it silky and supple.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Royal jelly</strong></p>\r\n\r\n<p>An all-natural hydrating agent that improve skin&#39;s texture and overall texture by tightening fine lines and making wrinkles less noticeable.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Acetyl Tyrosine</strong></p>\r\n\r\n<p>Helps improve skin&#39;s tone by making it fairer and radiant.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:06', 1, 0, '2016-11-03 01:40:58'),
(167, 0, 62, 12, 5, 'PRO-167', 'Placenta White All In One Body Lotion', 'bodyLotion-1.jpg', 'MOSBEAU PLACENTA WHITE ALL-IN-ONE  BODY LOTION   200ml\r\n 100% MADE IN JAPAN', '<p><strong>HOW TO USE:</strong></p>\r\n\r\n<p>Shake well before use. Get an ample amount and apply on skin. For best results use after bath, lightly towel dry skin and apply the lotion while the skin is still damp to lock-in moisture.</p>\r\n\r\n<p><strong>WHAT MAKES IT BETTER</strong></p>\r\n\r\n<p>This non-greasy, non-sticky body lotion is a real must-have for those who want to keep their skin smooth and moisturized without the oily feel. With 20 moisturizing herb extracts to keep your skin&#39;s fairness and radiance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Fully moisturizes and nourishes your body with infusion of 20 moisturizing herb extracts (such as the Aloe Barbadensis Leaf Extract, Peppermint Leaf Extract, Balm Mint, to name a few)</p>\r\n	</li>\r\n	<li>\r\n	<p>Whitens, eliminates aging signs and stimulates cell renewal on your skin through a powerful combination of Placental Protein, Bellis Perennis (Daisy) Flower Extract, Alpha-Arbutin and Collagen</p>\r\n	</li>\r\n	<li>\r\n	<p>Further renews, nourishes and protects your skin from damaging free radicals with Fulvic Acid, Glutathione and Vitamin C</p>\r\n	</li>\r\n	<li>\r\n	<p>Shields your skin from the damaging and aging effects of the sun</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>INGREDIANTS</strong></p>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>Placental Protein is a popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, reverses aging and speeds up skin cell renewal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bellis Perennis Extract</strong></p>\r\n\r\n<p>Latest skin-whitening ingredient in Japan that actively influences all stages of melanin production to provide long-lasting whitening effect on skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Alpha-Arbutin</strong></p>\r\n\r\n<p>Recognized skin-whitening agent in Asia that naturally and visibly whitens skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Collagen</strong></p>\r\n\r\n<p>Reverses skin aging and visibly removes wrinkles, fine lines and other unsightly signs of skin aging.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Glutathione</strong></p>\r\n\r\n<p>Master antioxidant that helps fight free radicals that causes skin damage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Vitamin C</strong></p>\r\n\r\n<p>Aids in skin-whitening, anti- aging and protecting the skin from free radicals that causes skin damage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>20 Herb Extract</strong></p>\r\n\r\n<p>Enriched with 20 Herb extract that moisturizes and nourishes the skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:03', 1, 0, '2016-11-03 01:41:45'),
(168, 0, 62, 6, 5, 'PRO-168', 'Mosbeau Placenta White All  In One Premium Cream', 'premiumcream-11.jpg', '<strong>MOSBEAU PLACENTA WHITE ALL-IN-ONE  PREMIUM CREAM  55g</strong>\r\n\r\n100% MADE IN JAPAN', '<p><strong>HOW TO USE:</strong></p>\r\n\r\n<p>After washing face, lightly pat dry face leaving the skin still a bit damp. Get an ample amount of cream and massage all over your face and neck using an upward, circular motion.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>The skincare regimen for women on-the-go in gel-type form with the benefits of a <strong>whitening cream, anti-aging essence, moisturizer, lotion, exfoliant, UV protection, and make-up base. </strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Gives the combined beauty performance of whitening, anti-aging, moisturizing, UV Protection and oil-free makeup base in one cream</p>\r\n	</li>\r\n	<li>\r\n	<p>Activates whitening and helps control premature signs of aging with Horse Placental Protein, CoQ10, Rosa Canina and fruit oil-bringing out your healthy, youthful glow</p>\r\n	</li>\r\n	<li>\r\n	<p>Gel-type cream innovation: It easily absorbs into your skin&rsquo;s natural moisture</p>\r\n	</li>\r\n	<li>\r\n	<p>Boosts moisture in your skin with squalene and other moisturizing herb extracts to increase your skin&rsquo;s rate of reparation and decelerate it&rsquo;s aging process</p>\r\n	</li>\r\n	<li>\r\n	<p>Further promotes gloss, nourishment, vitality, softness, elasticity and UV-shield in your face with Sericin</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>&nbsp;<strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Horse &amp; Marine Placental Protein</strong></p>\r\n\r\n<p>Placental Protein is a popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, removes wrinkles and fine lines, detoxifies the body and speeds up skin cell renewal. Horse Placental Protein is a more effective skin-whitening and skin-nourishing ingredient than Pig Placental protein. While, Marine Placental Protein is patented by Japan government as an effective ingredient in skin-whitening, anti-aging and skin cell renewal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CO-Q10</strong></p>\r\n\r\n<p>A component that cells use to produce energy your body needs for cell growth and maintenance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hydrolyzed Collagen</strong></p>\r\n\r\n<p>It forms a film on the surface of the skin making it smoother and softer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sericin</strong></p>\r\n\r\n<p>Creates a protective film on the skin to block pollution and harmful UV rays.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:12', 1, 0, '2017-06-12 08:06:44'),
(169, 0, 62, 13, 5, 'PRO-169', 'Mosbeau Skin Repair 100 Wrinkle & Eyebag Remover', 'wrinkleeyebagRemover-1.jpg', '<strong>SKIN REPAIR 100 WRINKLE & EYEBAG REMOVER  20 mL</strong>\r\n <br>\r\n100% MADE IN JAPAN', '<p><strong>HOW TO USE:</strong></p>\r\n\r\n<p>Get a drop of the solution and apply on desired area. Avoid contact to eyes and lips.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Be 100% Wrinkle and Eyebag &ndash; Free.Keeping your youthful radiance is easy with the infusion of international patent ingredient for anti-wrinkle Rosemary Extract and Dipeptide Diaminobutyroyl Benzylamide Diacetate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Reduces and eventually removes eye bags and wrinkles with Rosemary Extract and Dipeptide Diaminobutyroyl Benzylamide Diacetate, internationally patented ingredient that has the similar effects of Botox</p>\r\n	</li>\r\n	<li>\r\n	<p>Further prevents wrinkles with another anti-aging formulation by relaxing your muscles</p>\r\n	</li>\r\n	<li>\r\n	<p>Hasten anti-aging benefits with it&rsquo;s 100% concentrated solution</p>\r\n	</li>\r\n	<li>\r\n	<p>Deeply penetrates your skin&rsquo;s surface to enhance skin&rsquo;s elasticity and moisture and control the aging process</p>\r\n	</li>\r\n	<li>\r\n	<p>Helps whiten your skin and stimulate cell renewal with Placental Protein</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Rosmarinus Officinalis (Rosemary) Leaf Extract</strong></p>\r\n\r\n<p>Used to prevent puffiness in the eye area.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dipeptide Diaminobutyroxyl Benzylamide Diacetate</strong></p>\r\n\r\n<p>Synthetic peptide capable of relaxing facial expression wrinkles by inhibiting muscle contraction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hydrolized Elastin</strong></p>\r\n\r\n<p>Provides a natural protein layer of protection against environmental factors. It provides excellent smoothing properties and substantivity to skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>A popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, reverses aging and speeds up skin cell renewal.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:30', 1, 0, '2016-10-15 14:27:06'),
(170, 0, 62, 8, 5, 'PRO-170', 'Mosbeau Spotless White Green Tea Facial Soap', 'greenTeaSoap-1.jpg', '<strong>MOSBEAU ALL-IN-ONE SPOTLESS WHITE GREEN TEA\r\nFACIAL SOAP   100g</strong>\r\n100% MADE IN JAPAN', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Create a rich lather by rubbing the soap onto a foaming net. Squeeze off the foam and massage on your face, neck and body.</p>\r\n\r\n<p>Leave for one minute before rinsing well with water.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>It is enriched with green tea extract and seven different anti-inflammation ingredients&nbsp;<strong>formulated for those who have problematic skin conditions</strong>&nbsp;like pimples and acne.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Resolves and prevents pimple breakouts, blemishes, allergy and skin roughness with green tea extract and 7 different anti-inflammation ingredients.</p>\r\n	</li>\r\n	<li>\r\n	<p>Helps you achieve a fairer, youthful - looking face with Horse Placental Protein and Japan Patented Marine Placental Protein.</p>\r\n	</li>\r\n	<li>\r\n	<p>Effectively rids dirt from your pores with Charcoal Powder and tea components.</p>\r\n	</li>\r\n	<li>\r\n	<p>Helps minimize facial pores with Enantia Chlorantha Bark Extract.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Horse &amp; Marine Placental Protein</strong></p>\r\n\r\n<p>Placental Protein is a popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, removes wrinkles and fine lines, detoxifies the body and speeds up skin cell renewal. Horse Placental Protein is a more effective skin-whitening and skin-nourishing ingredient than Pig Placental protein. While, Marine Placental Protein is patented by Japan government as an effective ingredient in skin-whitening, anti-aging and skin cell renewal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Charcoal Powder</strong></p>\r\n\r\n<p>Odorless and tasteless fine black granules have an amazing ability to extract and neutralize many more times their own weight in gases, heavy metals, toxins, poisons and other chemicals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Enantia Chlorantha Bark Extract</strong></p>\r\n\r\n<p>An effective ingredient that helps reduced large pores.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dipotassium Glycyrrhizate</strong></p>\r\n\r\n<p>Is an anti-irritant and anti-inflammatory component with skin-soothing properties. Clinical tests point to this ingredient as an effective treatment for atopic dermatitis because of its ability to reduce redness and irritation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Algae Extract</strong></p>\r\n\r\n<p>Normalizes the skin&rsquo;s moisture content and provides suppleness to the epidermis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Citric Acid</strong></p>\r\n\r\n<p>Good for mild peeling to treat such skin conditions as fine lines and wrinkles, hyper-and depigmentation, spots and excessively dry skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Camellia Sinensis Leaf Extract</strong></p>\r\n\r\n<p>Helps to whiten, moisturize, smooth and soften the skin. Also it has an anti oxidant effect.</p>\r\n', '', '', NULL, '13', NULL, NULL, 1, '2016-06-07 03:06:06', 1, 0, '2017-01-13 13:01:01'),
(171, 0, 62, 2, 5, 'PRO-171', 'Mosbeau Skin Repair 100 Dark Spot Remover', 'darkSpotRemover-1.jpg', '<strong>MOSBEAU SKIN REPAIR 100\r\nDARK SPOT REMOVER  20 mL </strong>\r\n100% MADE IN JAPAN\r\n', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Work into rich lather and massage lightly on skin to remove deep-seated dirt from your pores.</p>\r\n\r\n<p>Use as a regular body soap. For best results, use daily.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Be 100% Dark Spots-Free. Get your whitening facial fix with its patented whitening ingredient Royal Jelly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Removes uneven skin patches, dark spots, dark facial blotches acne scars, reduces premature signs of aging, and repairs and nourishes your skin with Royal Jelly</p>\r\n	</li>\r\n	<li>\r\n	<p>Achieve fairer, healthier complexion with it&rsquo;s 100% concentrated solution</p>\r\n	</li>\r\n	<li>\r\n	<p>Further activates skin whitening and anti-aging with Citrus unshiu peel extract and Glycyrrhiza Glabra (Licorice) Root Extract</p>\r\n	</li>\r\n	<li>\r\n	<p>Effectively inhibits tyrosinase, the enzyme responsible for the production of skin darkening agents (melanin)</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Alpha-Arbutin</strong></p>\r\n\r\n<p>Recognized skin-whitening agent in Asia that naturally and visibly whitens skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Citrus Unshiu Peel Extract</strong></p>\r\n\r\n<p>Revives a dull appearance by lightening dark spots and hyperpigmentation. The extract effectively inhibited the activity of tyrosinase (enzyme responsible for skin hyperpigmentation), thus prevents against skin hyperpigmentation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Royal Jelly Extract</strong></p>\r\n\r\n<p>Helps to reverse the effects of aging in the skin by eliminating brown spots, also known as &quot;age spots,&quot; as well as wrinkles.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>A popular skin-whitening agent in Japan. Recognized as an exemplary ingredient that visibly whitens skin, reverses aging and speeds up skin cell renewal</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:30', 1, 0, '2016-10-15 14:26:54'),
(172, 0, 62, 4, 5, 'PRO-172', 'Mosbeau Age Defy Serum', 'ageDefy-11.jpg', '<strong>MOSBEAU AGE DEFY\r\nINTENSIVE DAILY FACE & NECK ANTI-AGING SERUM   50 mL </strong>\r\n100% MADE IN JAPAN\r\n', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Best applied on a clean, slightly damp face from cleansing and/or toning. Push the pump down once or twice to dispense a pea-sized amount onto your fingers. Thoroughly massage in a circular motion onto the face, corners of the eyes and mouth, neck and d&eacute;collet&eacute;. A moisturizer can be applied several minutes after applying the serum. For best results, apply in the morning and at night (a time your skin is in its cell renewing, repairing and moisture-restoring mode).</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>The most intensive anti-aging serum using&nbsp;<strong>Astaxanthin</strong>, one of Japan&#39;s best discoveries for anti-aging. It&#39;s the most powerful anti-aging ingredient that boosts the skin&#39;s regenerative process and aids in collagen regeneration needed to keep the skin firm and elastic. Uses nanotechnology to make sure the product is intensely and deeply absorbed.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Powerfully targets forehead lines, crow&#39;s feet, eye wrinkles, droopy cheecks, nasolabial folds, vertical lip lines, chin crease, jowls, neck wrinkles and cleavage crinkles with Astaxanthin</p>\r\n	</li>\r\n	<li>\r\n	<p>Developed through nanotechnology, it is easily and more deeply absorbed by the skin for a more intensive effect</p>\r\n	</li>\r\n	<li>\r\n	<p>Has increased efficacy to protect your skin against intrinsic and extrinsic aging with the infusion of another powerful anti-aging agent, the CoQ10</p>\r\n	</li>\r\n	<li>\r\n	<p>Intensively lifts, firms, tightens and smoothens your skin through the fusing power of its combined potent anti-aging, moisturizing and elasticity ingredients</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Astaxanthin</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>The most powerful anti-aging and antioxidant agent (according to scientists, health and skin care experts)</p>\r\n	</li>\r\n	<li>\r\n	<p>Highly effective at combating premature skin aging, skin dryness and the appearance of freckles and age spots</p>\r\n	</li>\r\n	<li>\r\n	<p>54 times stronger than beta-carotene</p>\r\n	</li>\r\n	<li>\r\n	<p>550 times more powerful than vitamin E</p>\r\n	</li>\r\n	<li>\r\n	<p>550 times more powerful than green tea catechins</p>\r\n	</li>\r\n	<li>\r\n	<p>800 times stronger than coenzyme Q10</p>\r\n	</li>\r\n	<li>\r\n	<p>6000 times greater than vitamin C</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Ubiquinone (Coenzyme Q10)</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Plays an active role in repairing and preventing premature signs of aging</p>\r\n	</li>\r\n	<li>\r\n	<p>Helps diminish fine wrinkles on the skin and protects it against both intrinsic and extrinsic aging</p>\r\n	</li>\r\n	<li>\r\n	<p>Has the ability to prevent many of the detrimental effects of photoaging</p>\r\n	</li>\r\n	<li>\r\n	<p>Supplementation helps reduce the breakdown of collagen and elastin</p>\r\n	</li>\r\n	<li>\r\n	<p>A powerful antioxidant that helps neutralize free radicals, which cause cell damage and increased risk to disease</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Tetradecyl aminobutyroylylamino</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>A tripeptide (active chain of proteins) that is specifically aimed at lifting sagging skin</p>\r\n	</li>\r\n	<li>\r\n	<p>Stimulates hyaluronan (HA) synthesis (skin tissue repair) and expression of the proteoglycans, decorin and lumican (cartilage lubricants)</p>\r\n	</li>\r\n	<li>\r\n	<p>Shows positive results on loose skin on face, arms and double chins</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>3-aminopropanesulfonic acid</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Composed of properties intended to prevent and/or treat the signs of the cutaneous aging such as the sagging of the tissues, loss of elasticity and texture of the skin, loss of firmness and tonicity, dermal atrophy and loss of density, wrinkles, little wrinkles and/or cracks</p>\r\n	</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:26', 1, 0, '2017-06-13 12:27:36'),
(173, 0, 62, 11, 5, 'PRO-173', 'Mosbeau Placenta Collagen Jelly', 'collagenJelly-1.jpg', '<strong>MOSBEAU  PLACENTA COLLAGEN JELLY FOOD SUPPLEMENT\r\n15000mg / 30 Sachet </strong>\r\n100% MADE IN JAPAN', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Take 1 sachet per day, on empty stomach. Best when chilled.&nbsp;<br />\r\n<br />\r\n<strong>PRECAUTION</strong><br />\r\nConsume contents after opening. Product may melt once sachet is opened. Keep in a cool, dry place Avoid exposure to heat and direct sunlight Not recommended for children and infants</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Whiten as much as you want with the powerful synergy of Japan&#39;s latest ingredients for ultimate skin whitening. Contains&nbsp;<strong>L-Cystine</strong>&nbsp;that has powerful whitening and anti-aging properties,&nbsp;<strong>Horse Placental Protein</strong>&nbsp;with 300 more amino acids that effectively whitens and revitalizes the skin, Japan-patented&nbsp;<strong>Marine Placental Protein</strong>from fresh Japanese salmon eggs that controls melanin, and fast-absorbing low molecular&nbsp;<strong>Fish Collagen</strong>&nbsp;that keeps the skin young, firm and glowing.</p>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Horse Placenta</p>\r\n	</li>\r\n	<li>\r\n	<p>L-cystine</p>\r\n	</li>\r\n	<li>\r\n	<p>Soy Isoflavones</p>\r\n	</li>\r\n	<li>\r\n	<p>Hesperidin</p>\r\n	</li>\r\n	<li>\r\n	<p>CoenzymeQ10</p>\r\n	</li>\r\n	<li>\r\n	<p>Vitamin C</p>\r\n	</li>\r\n	<li>\r\n	<p>Acerola</p>\r\n	</li>\r\n	<li>\r\n	<p>Marine Placenta Salmon Egg</p>\r\n	</li>\r\n	<li>\r\n	<p>Collagen(Fish)</p>\r\n	</li>\r\n	<li>\r\n	<p>Hyaluronic acid</p>\r\n	</li>\r\n	<li>\r\n	<p>a-Tocopherol (Vitamin E)&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Glutathione</p>\r\n	</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-06-07 03:06:23', 1, 0, '2017-01-22 21:54:22'),
(174, 0, 62, 7, 5, 'PRO-174', 'Mosbeau Placenta White Clarifying Toner', 'clarifyingToner-1.jpg', '<strong>MOSBEAU PLACENTA WHITE\r\nCLARIFYING TONER  150 mL </strong>\r\n100% MADE IN JAPAN', '<h3><strong>HOW TO USE:</strong></h3>\r\n\r\n<p>Use a cotton swab to apply toner across a cleansed face and neck.</p>\r\n\r\n<h2><strong>WHAT MAKES IT BETTER</strong></h2>\r\n\r\n<p>Placenta White Clarifying Toner as it strip problematic skin such as acne, blackheads, whiteheads and more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Get whiter skin and control acne inflammation with the help of specially formulated ingredients like Aloe Barbadensis Leaf Extract and Vitamin C.</p>\r\n	</li>\r\n	<li>\r\n	<p>Achieve whiter, younger and softer skin with a unique combination of Japan&#39;s breakthrough ingredients like Placental Protein, Bellis Perennis (Daisy) Flower Extract, Alpha-Arbutin, Fulvic Acid and Artemia Extract.</p>\r\n	</li>\r\n	<li>\r\n	<p>No harsh peeling. Get rejuvenated skin with Artemia Extract that is a potent antioxidant ingredient and Menthol for a fresher facial feeling that relaxes the skin.</p>\r\n	</li>\r\n	<li>\r\n	<p>Formulated for daily use on oily to acne-prone skin to gently sweep away dead skin cells. Effective for all skin types.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2><strong>INGREDIANTS</strong></h2>\r\n\r\n<p><strong>Placental Protein</strong></p>\r\n\r\n<p>Clinically proven effective skin-whitening agent in Japan with exemplary cell renewing and anti-aging properties.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bellis Perennis Extract</strong></p>\r\n\r\n<p>Latest skin-whitening ingredient in Japan that actively influences all stages of melanin production to provide long-lasting whitening effect on skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Alpha-Arbutin</strong></p>\r\n\r\n<p>Recognized skin-whitening agent in Asia that naturally and visibly whitens skin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fulvic Acid</strong></p>\r\n\r\n<p>Is the finest electrolyte known to man. Its electrolytes are able to restore vitality and have superior anti-aging components.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Artemia Extract</strong></p>\r\n\r\n<p>Protects the skin from UV damage.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-07 03:06:22', 1, 0, '2016-10-15 14:27:06'),
