(178, 0, 64, 1, 1, 'PRO-178', 'FIFA 16 by EA Sports - PlayStation 4', 'fifa16.jpg', 'FIFA 16 innovates across the entire pitch to deliver a balanced, \r\nauthentic, and exciting football experience that lets you play your way, \r\nand compete at a higher level. And with all new ways to play! With \r\ninnovative game play features', '<p>FIFA 16 innovates across the entire pitch to deliver a balanced,&nbsp;<br />\r\nauthentic, and exciting football experience that lets you play your way,&nbsp;<br />\r\nand compete at a higher level.</p>\r\n\r\n<p>And with all new ways to play! With&nbsp;<br />\r\ninnovative game play features, FIFA 16 brings Confidence in Defending,&nbsp;<br />\r\nControl in Midfield, and gives you the tools to create more Moments of&nbsp;<br />\r\nMagic than ever before. Fans new to the franchise, or skilled players&nbsp;<br />\r\nlooking to improve their game will have a chance to Compete at a Higher&nbsp;<br />\r\nLevel using the all new FIFA Trainer.</p>\r\n\r\n<p>Innovation across the Entire&nbsp;Pitch. New Ways to Play. Compete at a Higher Level. Play Beautiful in&nbsp;<br />\r\nFIFA 16.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-06-11 03:06:02', 1, 0, '2016-08-11 09:52:55'),
(179, 0, 67, 2, 5, 'PRO-179', 'PRO4-100  Wireless Stereo Gaming Headset', 'wireless_stereo_hdst.jpg', 'Fully adjustable padded headband and earcups\r\nA retractable microphone with mute function\r\nBuilt-in battery for up to 6 hours of playtime\r\nOfficially licensed PlayStation product', '<h3>The PRO4-100 Wireless Stereo Gaming Headset provides perfect gaming experience without wires!&nbsp;Designed for maximum comfort and easy listening.&nbsp;The officially licensed wireless headset with 40 mm speakers, deep bass and crystal clear sound, equipped.&nbsp;The built-in battery allows up to 6 hours of continuous gameplay.&nbsp;10 meter range allow maximum flexibility while playing.&nbsp;The retractable microphone with mute function and volume control allows simultaneous sound setting of chat and play.&nbsp;The PRO4-100 offers an adjustable padded headband and ear cups made ​​of artificial leather to ensure maximum comfort.&nbsp;<strong>Features:</strong>&nbsp;&middot; 40 mm speaker&nbsp;&middot; 10 m * Range and 3D sound mode&nbsp;&middot; A retractable microphone with mute function&nbsp;&middot; Connection to the Playstation 4 USB Transmitter&nbsp;&middot; Built-in battery for up to 6 hours ** time&nbsp;&middot; volume control for simultaneous chat and game sound adjustment&nbsp;&middot; Fully adjustable and padded headband and earcups&nbsp;&middot; Portable earcups&nbsp;* The range varies in use, settings and environmental&nbsp;** actual battery life will vary depending on temperature and volume&nbsp;</h3>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-06-11 03:06:11', 1, 0, '2016-08-04 09:10:53'),
