(349, 0, 29, 127, 5, 'PRO-349', 'Apple iPhone 6S 16GB', '6S-ROSEGOLD-21.jpg', 'Available in gold, silver, space gray, and rose gold, iPhone 6s features an A9 chip, 3D Touch, ultrafast LTE Advanced wireless, Touch ID, a 12MP iSight camera, and iOS 9.', '<ul>\r\n	<li>Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system</li>\r\n	<li>Keep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.</li>\r\n	<li>With just a single press, 3D Touch lets you do more than ever before.</li>\r\n	<li>The 12-megapixel iSight camera captures sharp, detailed photos. It takes 4K video, up to four times the resolution of 1080p HD video.</li>\r\n	<li>iPhone 6s is powered by the custom-designed 64-bit A9 chip.- delivers 70% more CPU performance</li>\r\n</ul>\r\n', '', '', NULL, '8', NULL, NULL, 1, '2016-06-30 02:06:38', 1, 0, '2016-08-16 09:34:12'),
(350, 0, 29, 129, 5, 'PRO-350', 'Apple iPhone 6S Plus 16GB', '6s-plus-gold-1.jpg', 'Available in silver and space gray, iPhone 6 Plus features an A8 chip, Touch ID, ultrafast LTE wireless, an 8MP iSight camera, and iOS 9.', '<ul>\r\n	<li>Apple</li>\r\n	<li>Imported</li>\r\n	<li>5.5-inch (diagonal) LED-backlit widescreen Multi-Touch display with IPS technology</li>\r\n	<li>8-megapixel iSight&reg; camera with Optical Image Stabilization</li>\r\n	<li>A8 chip with 64-bit architecture. M8 motion coprocessor</li>\r\n	<li>1080p HD video recording (30 fps or 60 fps)</li>\r\n	<li>Unlocked cell phones are compatible with GSM carriers like AT&amp;T and T-Mobile as well as with GSM SIM cards (e.g. H20 and select prepaid carriers). Unlocked cell phones will not work with CDMA Carriers like Sprint, Verizon, Boost or Virgin.</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-06-30 02:06:01', 1, 0, '2016-11-07 14:23:47'),
(351, 0, 29, 131, 5, 'PRO-351', 'Apple iPhone SE 16GB', 'SE-gray-11.jpg', 'Available in gold, silver, space gray, and rose gold, iPhone SE features an A9 chip, Touch ID, ultrafast LTE wireless, a 12MP iSight camera, and iOS 9.', '<ul>\r\n	<li>Retina display; 4inch (diagonal) LEDbacklit widescreen MultiTouch display</li>\r\n	<li>12megapixel iSight camera with 1.22&micro; pixels; f/2.2 aperture; Hybrid IR filter; Panorama (up to 63 megapixels)</li>\r\n	<li>4K video recording (3840 by 2160) at 30 fps; Slomo video support for 1080p at 120 fps and 720p at 240 fps; Take 8-megapixel still photos while recording 4K video</li>\r\n	<li>FaceTime HD Camera: 1.2megapixel photos; f/2.4 aperture; Improved local tone mapping; Retina Flash; Talk time: Up to 14 hours on 3G</li>\r\n	<li>Fingerprint sensor built into the Home button; A9 chip with 64bit architecture; Embedded M9 motion coprocessor</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-06-30 02:06:49', 1, 0, '2016-11-07 14:49:43'),
