(384, 0, 29, 2, 5, 'PRO-384', 'Apple iPhone 6S Plus  128GB', '128-2.jpg', 'Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system\r\nKeep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.\r\nWith just a', '<ul>\r\n	<li>Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system</li>\r\n	<li>Keep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.</li>\r\n	<li>With just a single press, 3D Touch lets you do more than ever before.</li>\r\n	<li>The 12-megapixel iSight camera captures sharp, detailed photos. It takes 4K video, up to four times the resolution of 1080p HD video.</li>\r\n	<li>iPhone 6s is powered by the custom-designed 64-bit A9 chip.- delivers 70% more CPU performance</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-07-04 02:07:16', 1, 0, '2016-11-07 14:30:52'),
(385, 0, 29, 23, 5, 'PRO-385', 'Apple iPhone 6S Plus  64GB', '6s-plus-silver-11.jpg', 'Available in silver and space gray, iPhone 6 Plus features an A8 chip, Touch ID, ultrafast LTE wireless, an 8MP iSight camera, and iOS 9.', '<ul>\r\n	<li>Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system</li>\r\n	<li>Keep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.</li>\r\n	<li>With just a single press, 3D Touch lets you do more than ever before.</li>\r\n	<li>The 12-megapixel iSight camera captures sharp, detailed photos. It takes 4K video, up to four times the resolution of 1080p HD video.</li>\r\n	<li>iPhone 6s is powered by the custom-designed 64-bit A9 chip.- delivers 70% more CPU performance</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-07-04 02:07:27', 1, 0, '2016-11-07 14:31:59'),
(386, 0, 29, 24, 5, 'PRO-386', 'Apple iPhone 6S  128GB', '128-14.jpg', 'Available in gold, silver, space gray, and rose gold, iPhone 6s features an A9 chip, 3D Touch, ultrafast LTE Advanced wireless, Touch ID, a 12MP iSight camera, and iOS 9.', '<ul>\r\n	<li>Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system</li>\r\n	<li>Keep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.</li>\r\n	<li>With just a single press, 3D Touch lets you do more than ever before.</li>\r\n	<li>The 12-megapixel iSight camera captures sharp, detailed photos. It takes 4K video, up to four times the resolution of 1080p HD video.</li>\r\n	<li>iPhone 6s is powered by the custom-designed 64-bit A9 chip.- delivers 70% more CPU performance</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-07-04 03:07:15', 1, 0, '2016-11-07 14:31:59'),
(387, 0, 29, 25, 5, 'PRO-387', 'Apple iPhone 6S  64GB', '6S-SILVER-12.jpg', 'Available in gold, silver, space gray, and rose gold, iPhone 6s features an A9 chip, 3D Touch, ultrafast LTE Advanced wireless, Touch ID, a 12MP iSight camera, and iOS 9.', '<p>Comes with Easy to use iOS 9 with refinements at every level from the apps you see on your Home screen down to the foundation of the system<br />\r\nKeep everything you love about iPhone up to date, secure, and accessible from any device with iCloud.<br />\r\nWith just a single press, 3D Touch lets you do more than ever before.<br />\r\nThe 12-megapixel iSight camera captures sharp, detailed photos. It takes 4K video, up to four times the resolution of 1080p HD video.<br />\r\niPhone 6s is powered by the custom-designed 64-bit A9 chip.- delivers 70% more CPU performance</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-07-04 03:07:54', 1, 0, '2016-11-07 14:31:59'),
(388, 0, 64, 0, 5, 'PRO-388', 'FarCry Primal by Ubisoft - PlayStation 4', 'Facry.jpg', 'Set during the savage Stone Age, Far Cry Primal is a full-fledged single player experience that will take gamers to 10,000 BC in history to a time when massive beasts like the woolly mammoth and sabretooth tiger ruled the Earth. ', '<p><strong>PRODUCT FEATURES :</strong></p>\r\n\r\n<ul>\r\n	<li>Brand : Ubisoft</li>\r\n	<li>Platform : PlayStation 4</li>\r\n	<li>Release Year : 2016</li>\r\n	<li>Genre : Action</li>\r\n	<li>Details : Rise above extinction - You will play as Takkar, a seasoned hunter and the last surviving member of your group. You have one goal : survival in a world where you are the prey Grow your tribe and hone your skills to lead your people. Encounter a cast of memorable characters who can help push back the dangers of the wild. Face enemy tribes who will do anything to eradicate you and your allies. Defeat predators and humans, and rise to become the apex predator</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-05 02:07:54', 1, 0, '2016-08-11 13:09:59'),
(389, 0, 64, 0, 5, 'PRO-389', 'Tom Clancy''S The Division By Ubisoft - Playstation 4', 'division2.jpg', 'Product Features : Brand : Ubisoft Platform : PlayStation 4 Details : Seamless Multiplayer : The Dark Zone - Collaborate with other players, or attack and steal their loot A Living, Breathing World - Use the environment for strategic advantages to dominat', '', '', '', NULL, '', NULL, NULL, 2, '2016-07-05 02:07:28', 1, 0, '2016-07-25 08:36:19'),
(390, 0, 75, 49, 5, 'PRO-390', 'CK Euphoria EDP 100ml for Lady', 'Ck--euphoria-edp100ml-lady.jpg', 'Calvin Klein Euphoria is an exotic floral-fruity fragrance that was launched in 2005. The fragrance is luminous and juicy like fruits notes of which are captured within it. ', '<p>Calvin Klein Euphoria is an exotic floral-fruity fragrance that was launched in 2005. The fragrance is luminous and juicy like fruits notes of which are captured within it.&nbsp;Euphoria by Calvin Klein for Women is all about sexiness, fantasy, and always being captivating. This sexy and sensual Eau de Parfum speaks to the woman who desires to break free from life daily routine, to be part of an exciting world that is brimming with pleasure, surprise, and temptation. This fragrance eloquently contrasts between essences of rare fruits and seductive flowers, producing a rich, creamy, seductive, signature. Presented to the world in 2005, master perfumers Dominique Ropion, Carlos Benaim, and Loc Dong are the noses behind this alluring fragrance. Its main notes radiate delectable scents of rose hip, green leaves, lotus, black orchids, Japanese apple, black violet, redwoods, and amber. This Eau de Parfum comes in a contemporary 100ml bottle with a sleek silver cap.</p>\r\n\r\n<p>Euphoria is a sleek and sexy, modern interpretation of sensuality. It opens with an initial burst of Pomegranate, succulent Persimmon and lush green notes that captivate the senses. The heart of Euphoria imparts a mysterious and intoxicating feeling through notes of rich Black Orchid, dewy Lotus Blossom and sensual Champaca flower. The base of the fragrance provides a lasting signature of sexy liquid Amber and Mahogany wood paired with an intriguing potion of black Violet, sensual Musks and an addictive Cream accord.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-14 02:07:53', 1, 0, '2016-11-09 01:54:23'),
(391, 0, 75, 51, 5, 'PRO-391', 'Lacoste Love of Pink EDT 90ml for Lady', 'Lacosite-love-of-pink-EDT-90ml-lady.jpg', 'Love of Pink by Lacoste is a chypre and fruity perfume for women, a new fragrance by the house of Lacoste, was announced for February 2009. Love of Pink’s composition which embraces aromas of red orange, passion fruit, lemon, pink magnolia, quince blossom', '<p>Love of Pink is the complete expression of femininity and romantic vitality. &nbsp;With a delightful sent which builds on the emotion and character of Touch of Pink, Love of Pink is a girl&rsquo;s perfect companion towards experiencing the feeling of love.&nbsp;Combining a touch of blood orange and the fresh sparkle of Lemon Peel, followed by a sensuous,</p>\r\n\r\n<p>Feminine touch of Pink Magnolia, Quince Flower and Stephanotis, the feminine energy it exudes is prolonged by a refined dry-down of Cedarwood.&nbsp;It is finally completed by a dreamy, lingering kiss of vanilla, making it a captivating elixir of love</p>\r\n\r\n<p><strong>Love of Pink</strong>&nbsp;by&nbsp;<strong>Lacoste</strong>&nbsp;is a chypre fruity perfume for women, a new fragrance by the house of&nbsp;<strong>Lacoste</strong>, announced for February 2009.</p>\r\n\r\n<p><strong>Top Notes:</strong>&nbsp;Orange, Coriander leaves, Cardamom seeds</p>\r\n\r\n<p><strong>Heart Notes:</strong>&nbsp;Jasmine, Violet leaves, Carrot-seed oil</p>\r\n\r\n<p><strong>Base Notes:</strong>&nbsp;Sandalwood, Musk, Vanilla</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-14 02:07:20', 1, 0, '2016-11-09 01:54:23'),
(392, 0, 75, 54, 5, 'PRO-392', 'Mont Blanc  Lady  Emblem 75ml EDP ', 'Mont-Blanc-Lady-75ml-EDP.jpg', 'Montblanc presents Lady Emblem in mid-2015, as a feminine version of the Emblem fragrance launched in spring 2014. Lady Emblem is announced as a sophisticated and feminine scent of floral - fruity - woody character.', '<p><strong>Montblanc</strong>&nbsp;presents&nbsp;<strong>Lady Emblem</strong>&nbsp;in mid-2015, as a feminine version of the Emblem fragrance launched in spring 2014.&nbsp;<strong>Lady Emblem</strong>&nbsp;is announced as a sophisticated and feminine scent of floral - fruity - woody character.</p>\r\n\r\n<p>The composition begins with red currant jam, pink rose and peach. The heart is intense and woody, including accords of sandalwood, patchouli and rosewood. In the end, the composition exudes intense tones of musk and raspberry.</p>\r\n\r\n<p>Montblanc (sometimes referred to as Mont Blanc on older products) is a German company is known for its fine writing instruments and luxury goods.</p>\r\n\r\n<p>Founded in 1908 by stationer Claus-Johannes Voss, banker Alfred Nehemias and engineer August Eberstein, the company started out as the Simplo Filler Pen company. Making upscale pens in Hamburg, a pen produced in 1910 would later give the company its new name: the Montblanc. The company&#39;s signature &quot; White Star&quot; a shape which adorns its products first appeared in 1913 and was inspired by the peak of Mont Blanc, the highest peak in the Alps. The company&#39;s first fountain pen gained notoriety for the company was a fountain pen) known as the Meisterst&uuml;ck (&quot;Masterpiece&quot;), first produced in 1924 and still manufactured today. The success of the Meisterst&uuml;ck allowed for international expansion and export of the company&#39;s goods. The figure &quot;4810&quot; (the height of Mont Blanc) was engraved on the nibs of all Meisterst&uuml;ck pens starting in 1929. In 1934 the company changed its name to Montblanc-Simplo GmbH, and introduced its first piston pen filler.</p>\r\n\r\n<p>By 1935, the company had expanded its offering to include leather goods such as pen pouches, notebooks and writing cases to accompany its pens. The company&#39;s manufacturing facilities were destroyed during World War II but were re-built, with production continuing in Denmark while construction took place.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-14 02:07:51', 1, 0, '2016-11-09 01:54:23'),
(393, 0, 75, 56, 5, 'PRO-393', 'Moschino I Love Love EDT 100ml for Lady', 'Moschino-i-love-EDT-100ml-lady.jpg', 'I Love Love is a very optimistic scent, bursting with love, sun and bright colors. Fresh and sparkly, yet balmy bouquet opens with notes of citruses and red fruits. ', '<p>I Love Love is a very optimistic scent, bursting with love, sun and bright colors. Fresh and sparkly, yet balmy bouquet opens with notes of citruses and red fruits. The heart introduces fresh flowers: lily of the valley, bulrush, tea rose and cinnamon leaves. The drydown is woody and musky: Tanaka wood, musk and cedar. The perfume was created by&nbsp;Olivier Cresp&nbsp;in 2004.</p>\r\n\r\n<p>Top Notes are Orange, Grapefruit, Red Currant, LemonMiddle Notes are Tea Rose, Bulrush, Lily-of-the-Valley, Sugar Cane, Cinnamon. Base Notes are Musk, Cedar, Woody .Enticing and fun, I love love by the design house of moschino is for the women that love life. Spontaneous blend of bright citrus, followed by sexy yet feminine florals, smoothing off to cinnamon leaves, woods and musk. Sensational, sparkling and dazzling way to top off your day</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-14 02:07:40', 1, 0, '2016-11-09 01:54:23'),
(394, 0, 75, 26, 5, 'PRO-394', 'Versace Yellow Diamond Intense EDP 90ml for Lady', 'Versace-Yellow-diamond-Intense-EDP-90-ml-Lady.jpg', 'Intense Yellow Diamond 90ml Versace is a floral fragrance for women. Launched in 2014, it captures the luxury and elegance of the sumptuous halls of Versailles mimicked a brightly yellow bottle with a cap of diamond shape.', '<p>The new composition opens with fresh Mediterranean accords of bergamot, neroli, diamond cedrat and pear sorbet. Its heart includes feminine flowers of orange blossom, freesia, jasmine and osmanthus. The base is made of amber wood, musk, benzoin and guaiac wood.</p>\r\n\r\n<p>A perfume wich enchants with its Mediterranean refinement of sparkling Bergamot, Citron of Diamante and noble Neroli, with the captivating combination if irresistible and attractive accents of Pear Sorbet. The heartcelebrates an intense and glamourous femininity which expresses itself with creamy and velvety facets of Jasmine petals and Osmanthus, together with precious notes of Orange Blossom and Freesia. The sensual and enveloping dry down is based on deep and vibrant tones of Amber Wood and Palo Santo, enriched by teh voluptuous notes of Benzoin and sparkling and seductive Musk.</p>\r\n\r\n<p>A concentration of energy, brightness and transparency, Versace Yellow Diamond Intense is the deep interpretation of Yellow Diamond Eau de Toilette.<br />\r\n<br />\r\n- Top notes: Bergamot, neroli and pear sorbet<br />\r\n- Mid notes: Orange blossom, jasmine and osmanthus<br />\r\n- Base notes: Amber wood, musk, benzoin and guaiac<br />\r\n- Style: Energetic. Bright. Pure. Transparent.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-14 02:07:53', 1, 0, '2016-11-09 01:54:23'),
