(538, 0, 74, 45, 0, 'PRO-538', 'CK EUPHORIA EDT 100ML  FOR MEN', 'CK_-1.jpg', 'The Calvin Klein Euphoria for Men is an intense woody aromatic fragrance with a classic scent. This sexy fragrance radiates a manly aura and is sure to make many heads turn. ', '<p>The Calvin Klein Euphoria for Men is an intense woody aromatic fragrance with a classic scent. This sexy fragrance radiates a manly aura and is sure to make many heads turn. This alluring fragrance is a creation of legendary master perfumer Carlos Benaim, Loc Dong, and Jean Marc Chaillan. This perfume has a crisp edge that ends on a warm, woody trail. The top notes of this mesmerizing EDT are ginger and pepper. Its middle notes are marked by black basil, sage, and cedar, while the base notes radiate an aroma of amber, patchouli, Brazilian redwood, and suede. The scent lasts for hours and is sure to get you noticed while you are at a party or on any special occasion. The perfume comes in highly stylized clear flacon with a smooth, lustrous silver cap. Simply splash Calvin Klein Euphoria for Men to impress everyone with its long lasting, intense, spicy scent.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:09', 1, 0, '2016-11-09 01:54:23'),
(539, 0, 74, 50, 0, 'PRO-539', 'CK EUPHORIA INTENSE EDT 100ML FOR MEN', 'CK_EUPHORIA_INTENSE_EDT_MEN-1.jpg', 'Rich. Bold. Addictive. An oriental amber fragrance that blends deep woodsy and richer spices.', '<p>Rich. Bold. Addictive. An oriental amber fragrance that blends deep woodsy and richer spices - the sexier, more mysterious side of the euphoria men. Topnotes &ndash; Ginger Pepper Cocktail, Raindrop Accord, Chilled Sudachi Midnotes &ndash; Black Basil, Cedar Leaf, Hydroponic Sage Basenotes &ndash; Labdanum, Vetiver, Oud, Solid Amber</p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The top notes of the fragrance are sharp and fleeting and very energizing with notes of ginger and hot pepper.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />MIDDLE NOTES</p>\r\n\r\n<p>The heart is composed of warm cedar, smoky vetiver, savory sage and spicy black basil and heightens the senses, making you feel pumped up and rejuvenated.</p>\r\n\r\n<p><img alt="" src="http://cf2.souqcdn.com/static/ltr/en/images/lazy.png" />BASE NOTES</p>\r\n\r\n<p>The warm tones from myrrh, powerful labdanum, amber, somber earthy patchouli, and musty agar wood give this scent a smooth and pleasant feel. These notes together compose a very warm and sensual scent that is quite magnetic.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:44', 1, 0, '2016-11-09 01:54:23'),
(540, 0, 75, 42, 0, 'PRO-540', 'GIVENCHY PAI EDT 100ML FOR WOMEN', 'GIVENCHY_PAI_EDT-1.jpg', 'Givenchy Pi Cologne for Men 3.4 oz Eau De Toilette Spray An alternative to the citrus scents of the 90''s, Pi is a celebration of what makes a man seductive - his intelligence, courage, and contributions. Pi is more than a name, it''s a symbol. ', '<p>Givenchy Pi Cologne for Men 3.4 oz Eau De Toilette Spray An alternative to the citrus scents of the 90&#39;s, Pi is a celebration of what makes a man seductive - his intelligence, courage, and contributions. Pi is more than a name, it&#39;s a symbol.</p>\r\n\r\n<p>Pi is a celebration of what makes a man seductive - his intelligence, courage, and contributions. Pi is more than a name, it&#39;s a symbol. The masculine bottle, designed by Serge Manseau, has a hi-tech closure system and plays on the contrast between pure lines and perfect proportion.&nbsp;Pi is a woody and magnetic fragrance synonymous of escape and discovery into new sensations. This fresh and masculine scent combines mandarin, iron wood and benzoin crystals bringing a touch of sensuality to the fragrance.<br />\r\n<br />\r\n<strong>Notes:</strong><br />\r\nMandarin, Pine Needles, Rosemary, Guaiac Wood, Benzoin.<br />\r\n<strong>Style:</strong><br />\r\nAdventurous. Sensational. Masculine fragrance.</p>\r\n\r\n<p>Top notes:&nbsp;Mandarin, Galbanum</p>\r\n\r\n<p>Heart notes:&nbsp;Iron wood, Benzoin crystals</p>\r\n\r\n<p>Base notes:&nbsp;Infinium</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:27', 1, 0, '2016-11-09 01:54:23'),
(541, 0, 75, 59, 0, 'PRO-541', 'LANVIN ECLAT D ARPEGE EDP 100ML FOR WOMEN', 'LANVIN_ECLAT_D-2.jpg', 'Eclat d’Arpege is classified as fruity-floral. Lanvin revives the musical theme of his legendary Arpege perfume. The composition is delicate, fragile and angelic. Eclat d’Arpege’s first accords are green lilac and Sicilian lemon leaves which transports us', '<p><strong>Eclat d`Arpege</strong>&nbsp;by&nbsp;<strong>Lanvin</strong>&nbsp;is a floral green fragrance for women, a limited edition launched in summer 2010. Top notes are green lilac and petit grain; middle notes are peach blossom, wisteria, red peony, green tea and Chinese osmanthus; base notes are amber, musk and cedar.</p>\r\n\r\n<p>In 1927, Jeanne Lanvin created Arp&egrave;ge, by love for her daughter Marguerite. Arp&egrave;ge a floral aldehyde who succeeded in crossing the century without losing its identity, remains today a legendary perfume. Inspiring itself with this tradition, Lanvin, in association with Karine Dubreuil, who created Mane, elaborated an original fragrance, with this composition, Lanvin carries on the myth of Arp&egrave;ge and propels it towards eternity, adding a touch of modernism. The famous round Art-D&eacute;co bottle created in 1927 has once again been used as the symbol of the House&#39;s mythical perfume. However, it also takes on a new modernity through its pure and almost industrial beauty, its transparency revealing the grace of the liquid&#39;s lilac tint. Designed in collaboration with Alber Elbaz, the bottle is a gem : topped with a white diamond, its stopper sparkles while the two wedding bands that decorate it symbolise the renewal of the house, the connection between couture and perfume, the union between art and industry, but also the link between two loved ones. Emotion is immediate: grace, jewels, refinement, love.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:18', 1, 0, '2016-11-09 01:54:23'),
(542, 0, 75, 46, 0, 'PRO-542', 'VERSACE BRIGHT CRYSTAL EDT 90ML  FOR WOMEN', 'Versace_Bright_Crystal_Eau_De_Toilette_Spray_90ml_1373969844.png', 'Inspired by a mixture of Donatella Versace''s favorite floral fragrances, Bright Crystal is a fresh, sensual blend of refreshing chilled yuzu and pomegranate mingled with soothing blossoms of peony, magnolia, and lotus flower, warmed with notes of musk ', '<p>Launched by the design house of Gianni Versace.When&nbsp;applying&nbsp;any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.&nbsp; For instance, your mood, stress level, age, body chemistry,&nbsp;diet, and current medications may all alter the scents you wear.&nbsp;&nbsp;Similarly, factor such as dry or oily&nbsp;skin can even affect the amount of time a fragrance will last after being applied.</p>\r\n\r\n<p>Versace Bright Crystal Women is a sparkling pink and vibrant fragrance from Versace for a woman who is feminine, elegant and beautiful. It was designed by Alberto Morillas and was first released in 2006. The bright, fresh and fruity opening of this fragrance is due to a blend of citrus, icy cool and pomegranate notes which are extremely refreshing and appeasing to the senses. The heart is a melting harmony of delicate flowers that gives the fragrance its lady-like charm. The base is sensual and seductive with notes of Acajou and wood. The fragrance has a great longevity and can be worn during the day through warm seasons. It comes in a crystal like flacon, sparkling and elegant, just like the fragrance. The top notes are pomegranate, iced accords and shining Yuzu. The middle notes consist of magnolia, peony and lotus flowers. The base notes are from plant amber, acajou and musk. The fragrance is truly a gem in itself!</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:55', 1, 0, '2016-11-09 01:54:23'),
(543, 0, 74, 23, 0, 'PRO-543', 'VERSACE OUD NOIR EDP 100ML FOR MEN', 'VERSACE_OUD_NOIR-1.jpg', 'The Versace Pour Homme Oud Noir Eau de Parfum for Men is an intensely masculine oriental perfume that has warm and sensual undercurrents. The overall fragrance is reminiscent of a balmy breeze at sunset.', '<p>The Versace Pour Homme Oud Noir Eau de Parfum for Men is an intensely masculine oriental perfume that has warm and sensual undercurrents. The overall fragrance is reminiscent of a balmy breeze at sunset. This heady concoction comes in a classic black 100ml bottle. The flacon is neatly symmetric and has a rich, sophisticated look, with the Versace branding on its golden neck. The center of the Versace Oud Noir bottle is indented with the iconic and prestigious Versace seal, also in gold, that adds to the elegance. This Versace perfume for men is best suited to a man with a strong personality.</p>\r\n\r\n<p>Versace Pour Homme was launched in the year 2013. This Versace perfume is made up of an intense and regal blend of leather, oud, oriental woodsy notes, and spices. The redolence of leather, spicy and deep, gives this scent its mesmeric quality. It is the oud that makes the perfume richly oriental and gives it a musty, nutty scent that is very placid. These notes have been blended with strong woody notes that bring to the perfume a very earthy feel. But the real punch is packed in with the perfect combination of spices. The overall aroma is seductive and has the semblance of an aphrodisiac.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-07-30 06:07:48', 1, 0, '2016-11-09 01:54:23'),
