(600, 0, 74, 24, 0, 'PRO-600', 'ARMANI CODE 75 ML FOR MEN', 'ARMANI_CODE-1.png', 'Armani Code by Giorgio Armani was launched in 2004. This is an oriental spicy fragrance. The bottle is inspired by satin lapels of an Armani black tuxedo. Armani Code was the winner of the Fifi Fragrance Award of the year in Men''s Luxury 2006. ', '<p>Armani Code by Giorgio Armani was launched in 2004. This is an oriental spicy fragrance. The bottle is inspired by satin lapels of an Armani black tuxedo. Armani Code was the winner of the Fifi Fragrance Award of the year in Men&#39;s Luxury 2006.&nbsp;Giorgio Armani was an Italian fashion designer particularly noted for his menswear. In 1975 he presented his first collection of menswear followed later that year presented a range for women. The Armani brand expanded through the early 80s offering a variety of collections and ranges from clothing through to accessories. Giorgio Armani Beauty launched their first fragrance in 1982 and this is part of a long succession of fragrances. The Armani Fragrance collection has over 70 perfumes.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '20', NULL, NULL, 1, '2016-08-08 01:08:03', 1, 0, '2016-11-09 01:54:23'),
(601, 0, 75, 48, 0, 'PRO-601', 'ROBERTO CAVALLI 75ML FOR LADY', 'ROBERTO_CAVALLI-1.jpg', 'The solid glass base envokes the strength and the power of its character. Crowned by a tiara shaped cap formed by Roberto Cavalli’s golden seal.It is an Exuberant and sunny fragrance.\r\n', '<p>The Roberto Cavalli perfume belongs to the ambery floral family. An exuberant fragrance which exudes a genuine strength of character, it exhilarates and mesmerises from the very first contact... essentially addictive.</p>\r\n\r\n<p>Roberto Cavalli launched a new fragrance in 2012, simply named Roberto Cavalli Eau de Parfum. It is created for women who want to be noticed and who prefer to wear Cavalli animal print dresses.<br />\r\n<br />\r\nThe fragrance is an intense oriental - floral and is based on notes of orange blossom, symbolizing Italian femininity, sensuality and extravagance. There are also ambery - oriental nuances of benzoin, pink pepper, tonka and vanilla. The composition is developed by Louise Turner of Givaudan.<br />\r\n<br />\r\nModel and actress Elisa Sednaoui is the muse of this fragrance. The bottle is round topped with a tiara &ndash; shaped stopper containing the designer&#39;s initials. Golden shades and leopard print decorate the bottle design and packaging.</p>\r\n\r\n<p><strong>Fragrance Family</strong></p>\r\n\r\n<p>Ambery-floral</p>\r\n\r\n<p><strong>Fragrance Notes:</strong></p>\r\n\r\n<ul>\r\n	<li>Top Notes: Pink Pepper</li>\r\n	<li>Middle Notes: African Orange flower</li>\r\n	<li>Base Notes: Benzoin Tonka Bean Vanille</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-08 01:08:19', 1, 0, '2016-11-09 01:54:23'),
(602, 0, 75, 60, 0, 'PRO-602', 'LANCOME LA VIE EST 75ML FOR LADY', 'LANCOME-1.jpg', 'Embrace a sense of individualism and enjoy your own sense of happiness with the Lancome La Vie Est Balle by Lancome 75ml EDP for Women.', '<p>Embrace a sense of individualism and enjoy your own sense of happiness with the Lancome La Vie Est Balle by Lancome 75ml EDP for Women. Developed by renowned perfumers Olivier Polge, Dominique Ropion and Anne Flipo, this eau de parfum is an elegant composition. Investing three years and developing 5000 versions before arriving at this gourmand fragrance, the perfumers have infused a variety of simple, yet pleasurable notes of Iris, orange blossoms, jasmine, black currant, pear, tonka bean and more. The design of the perfume flacon is inspired by the classic Lancome bottle of 1949.A floral fruity gourmand fragrance introduced in 2012, begins with top notes of black currant and pear, heart notes of iris, jasmine, and orange blossom, and a base of patchouli, vanilla, tonka bean, and praline.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>A burst of freshness is delivered by the head notes that define this fragrance&rsquo;s character. This concoction opens with the fruity notes of black currant and pear that are refreshing.</p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>Keeping the freshness alive, the middle notes create a simple, yet profound sense of sweetness. A strong floral hit is delivered by the heart notes composed of iris, orange blossoms, and jasmine.</p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>Providing enhanced sillage and longevity, the base notes emanate a powdery, gourmand scent reminiscent of almond like accords derived from tonka bean, praline, patchouli and vanilla.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-08 01:08:48', 1, 0, '2016-11-09 01:54:23'),
(603, 0, 89, 78, 0, 'PRO-603', 'VERSACE YELLOW DIAMOND 90ML FOR LADY(GIFT SET)', 'Versace-Yellow-Diamond-1.jpg', 'VERSACE STARTED ITS GLAMOROUS FRAGRANCE LINE INSPIRED BY CRYSTALS IN 2004 WITH CRYSTAL NOIR PERFUME, AND THEN LAUNCHED THE LIGHTER AND FRUITIER BRIGHT CRYSTAL IN 2006. IN 2011, A NEW FRAGRANCE OF THE COLLECTION EMERGES, "A CRYSTAL THAT TURNS INTO A DIAMON', '<p><strong>SET INCLUDES:</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Eau de Toilette 90ml</li>\r\n	<li>Body Lotion 100ml</li>\r\n	<li>Shiny Clutch Bag</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-08 01:08:25', 1, 0, '2016-11-09 01:54:23'),
(604, 0, 89, 81, 0, 'PRO-604', 'PACO RABANNE 1 MILLION EDT 100 ML FOR MEN (GIFT SET)', 'PACO_ROBANNE-1.jpg', 'Luxuriously spicy, 1 million by Paco Rabanne features fruity notes of orange and grapefruit blended with peppermint and rose absolute. Essences of cinnamon, leather and patchouli combine with leather, warming amber and white wood notes to complete the mas', '<ul>\r\n	<li>Men&#39;s Fragrance</li>\r\n	<li>100ml EDT</li>\r\n	<li>150ml Deo Spray</li>\r\n	<li>Woody fragrance for men</li>\r\n	<li>Fragrance released in 2008</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-08 01:08:48', 1, 0, '2016-11-09 01:54:23'),
(605, 0, 89, 84, 0, 'PRO-605', 'DAVIDOFF COOL WATER SENSUAL ESSENCE 100 ML FOR LADY(GIFT SET)', 'DAVIDOFF-1.jpg', 'Davidoff presents a new edition of the women''s fragrance Cool Water (1996), the warm and shimmering Cool Water Sensual Essence. The fragrance is described as glamorous, alluring and sensual, inspired by golden sunset reflected on ocean surface. The fragra', '<p>Davidoff presents a new edition of the women&#39;s fragrance CoolWater (1996), the warm and shimmering Cool Water Sensual Essence. The fragranceis described as glamorous, alluring and sensual, inspired by golden sunsetreflected on ocean surface.</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-08-08 01:08:53', 1, 0, '2017-01-03 19:21:11'),
