(612, 0, 64, 0, 0, 'PRO-612', 'PS4  Mad Max', 'madmax-1.jpg', 'Become Mad Max, the lone warrior in a savage post-apocalyptic world where cars are the key to survival. In this action-packed, open world, third-person action game, you must fight to stay alive in The Wasteland, using brutal on-ground and vehicular combat', '<p>Become Mad Max, the lone warrior in a savage post-apocalyptic world where cars are the key to survival. In this action-packed, open world, third-person action game, you must fight to stay alive in The Wasteland, using brutal on-ground and vehicular combat against vicious gangs of bandits. A reluctant hero with an instinct for survival, Max wants nothing more than to leave the madness behind and find solace in the storied &quot;Plains of Silence.&quot; Players are challenged with treacherous missions as they scavenge the dangerous landscape for supplies to build the ultimate combat vehicle.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-09 06:08:58', 1, 0, '2016-08-11 08:49:26'),
(613, 0, 64, 0, 0, 'PRO-613', 'Tom Clancy''s Rainbow 6', 'RAINBOW6-2.jpg', 'Change the landscape of your assault with an unprecedented level of environmental destruction.\r\nBreach enemy strongholds with new tactical measures or fortify your own with defensive resources in both sides of sieges, a brand-new mode of assault combat', '<ul>\r\n	<li>Change the landscape of your assault with an unprecedented level of environmental destruction.</li>\r\n	<li>Breach enemy strongholds with new tactical measures or fortify your own with defensive resources in both sides of sieges, a brand-new mode of assault combat for the Rainbow Six series.</li>\r\n	<li>Walls can be shattered, and floors and ceilings can be breached. Mastering the element of destruction is the key to victory</li>\r\n</ul>\r\n\r\n<p>Tom Clancy&#39;s Rainbow Six Siege will transport players in the center of dangerous close-quarters conflicts, set between a team of hostage takers and team committed in freeing that hostage. Created by the famous Ubisoft Montreal studio, Rainbow Six Siege is the latest tactical first-person-shooter in the series that will be release on next generation consoles, the Xbox One and PlayStation 4, as well as on Microsoft Windows.</p>\r\n\r\n<p><strong>Multi-Player:-</strong></p>\r\n\r\n<p>Experience the full multiplayer focus and destructible environments of the game that will unleash the aggression, unpredictability and tactical thinking of the players. Tom Clancy&#39;s Rainbow Six Siege features a technological innovation that will give an exciting way of interacting in a game environment. The environment of the game corresponds authentically, distinctively and dynamically in any action made by the player.</p>\r\n\r\n<p><strong>Strategies</strong>:-</p>\r\n\r\n<p>The terrorist will hide the hostage and strategically plan the transformation of their environments into a fortress by fortifying the walls, barricading the windows, deploying shields and mines, and more!</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-09 06:08:07', 1, 0, '2016-08-11 13:10:53'),
(614, 0, 64, 0, 0, 'PRO-614', 'Just Cause 3', 'JUST_CAUSE-11.jpg', 'Use your Grapple and Parachute to scale buildings, hijack vehicles, move quickly or tether objects together for creative new ways to cause Chaos\r\nCause massive chains of destruction in military bases, harbors, prisons, police stations and communications', '<ul>\r\n	<li>Use your Grapple and Parachute to scale buildings, hijack vehicles, move quickly or tether objects together for creative new ways to cause Chaos</li>\r\n	<li>Cause massive chains of destruction in military bases, harbors, prisons, police stations and communications facilities to bring down a dictator</li>\r\n	<li>Arm yourself with a wide range of explosive weaponry from shotguns and missile launchers to tank-busters and air-strikes</li>\r\n	<li>Choose from a huge variety of different vehicles to drive including speedboats, jets, helicopters, turbo-fuelled sports cars and super bikes</li>\r\n	<li>Just Cause 3&nbsp;assures the best explosive action sequences, as it&rsquo;s truly up to the gamer</li>\r\n</ul>\r\n\r\n<p>Destroy military bases, harbours, prisons, police stations, and communication facilities with a massive collection of explosive weaponries ranging from shotguns and missile launchers to tank-busters and air-strikes. Bring down a dictatorial dominion by making the island a sea of fire and send General Di Ravello and his forces into the chaos of your making!</p>\r\n\r\n<p>Take down the brutal regime of Dictator General Di Ravello in the most creative and destructive way possible in JUST CAUSE 3, the latest instalment in one of the best selling franchises: JUST CAUSE! Buckle-up for a highly explosive return of the grappling ace Rico Rodriguez that will bring a brand new chaos and fun in the fictional Mediterranean island of Medici, the hero&rsquo;s homeland.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-09 06:08:37', 1, 0, '2016-08-11 13:11:29'),
