(620, 0, 75, 62, 0, 'PRO-620', 'CK One Shock 200 ML for women', 'thumb3_AA2rjo_2221.jpg', 'The CK One Shock by Calvin Klein for Women is an intensely opulent oriental fragrance created for the contemporary woman. This fruity floral perfume is juicy and flavorful that warms into sexy skin musk. Concocted in 2011 by the famed perfumer Ann Gottlie', '<p>The CK One Shock by Calvin Klein for Women is an intensely opulent oriental fragrance created for the contemporary woman. This fruity floral perfume is juicy and flavorful that warms into sexy skin musk. Concocted in 2011 by the famed perfumer Ann Gottlieb and IFF, the lovely perfume is a must have in a woman&rsquo;s collection. The Eau de Toilette fuses aromatic oriental scents and woody accords with a hint of spices to create a tantalizing perfume. CK One Shock by Calvin Klein for Women has top notes of pink peony, passion flower, and poppy. Its middle notes are enveloped by feminine jasmine, narcissus, blackberry, and dark cocoa. The base notes exude amber, vanilla, musk, and patchouli. The Eau de Toilette comes in 200ml flacon that is shaped like a mickey bottle with a white twist off cap</p>\r\n\r\n<p>One of the most successful fragrances from&nbsp;<strong>Calvin Klein</strong>&nbsp;is CK One, the citrus unisex fragrance from 1994. CK One Shock is a surprise for all the fans of CK One line. It is not an unisex edition, but two separate oriental compositions:&nbsp;<strong>CK One Shock For Her</strong>&nbsp;and CK One Shock For Him.</p>\r\n\r\n<p><strong>CK One Shock For Her</strong>&nbsp;is an opulent oriental - floral fragrance with top notes of passion flower, pink peony and poppy. Its heart is made of feminine jasmine, narcissus, blackberry and dark cocoa. The base consists of amber, vanilla, musk and patchouli.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-14 12:08:45', 1, 0, '2017-03-07 10:00:03'),
(621, 0, 63, 71, 0, 'PRO-621', 'TP-Link 4G LTE Advanced Portable Router Mobile WiFi', 'tp_link_4g-11.jpg', '4G LTE SUPPORTED WITH UP TO 150MBPS DOWNLOAD AND 50MBPS UPLOAD SPEEDS\r\nSUPPORTS UP TO 15 DEVICES SIMULTANEOUSLY\r\nALL USEFUL INFORMATION AT A GLANCE WITH SCREEN DISPLAY\r\n2550MAH BATTERY FOR UP TO 10 HOURS OF WORKING\r\nSELECTABLE 2.4GHZ OR 5GHZ DUAL BAND WIF', '<p><strong>HARDWARE FEATURES</strong><br />\r\nNETWORK TYPE :FDD-LTE CAT4 (800/900/1800/2100/2600MHZ)DC-HSPA /HSPA/UMTS (900/2100MHZ)EDGE/GPRS/GSM (850/900/1800/1900MHZ)<br />\r\nINTERFACE :1 MICRO USB PORT FOR POWER SUPPLYSIM CARD SLOTMICRO SD CARD SLOT<br />\r\nBUTTON :POWER ON/OFF BUTTONMENU BUTTON<br />\r\nANTENNA :INTERNAL ANTENNA<br />\r\nDATA RATES :DL: 150MBPS, UL: 50MBPS<br />\r\nDIMENSIONS ( W X D X H ) :4.2 &times; 2.6 &times; 0.6 IN. (106 &times; 66 &times; 16MM)<br />\r\nPOWER SUPPLY :INTERNAL 2550MAH RECHARGEABLE BATTERY<br />\r\nMICRO SD CARD READER :UP TO 32GB<br />\r\nSCREEN DISPLAY :TRAFFIC STATISTICS, WI-FI STATUS, USER NUMBERS, NETWORK TYPE (2G/3G/4G), SIGNAL STRENGTH, INTERNET CONNECTION STATUS, MESSAGES, BATTERY METER.<br />\r\n<br />\r\n<strong>WIRELESS FEATURES</strong><br />\r\nWIRELESS STANDARDS :IEEE 802.11A, IEEE 802.11B, IEEE 802.11G, IEEE 802.11N<br />\r\nFREQUENCY :2.4GHZ &amp; 5GHZ<br />\r\nTRANSMIT POWER :&lt;20DBM<br />\r\nWIRELESS SECURITY :SUPPORT WPA-PSK/WPA2-PSK,WIRELESS MAC FILTERING, ENABLE/DISABLE SSID BROADCAST<br />\r\nDHCP :DHCP SERVER, DHCP CLIENT LIST<br />\r\n<br />\r\n<strong>OTHERS</strong><br />\r\nCERTIFICATION :CE, ROHS<br />\r\nPACKAGE CONTENTS :LTE-ADVANCED MOBILE WIFI M7350MICRO USB CABLEMICRO TO STANDARD SIM CARD ADAPTERNANO TO STANDARD SIM CARD ADAPTERPOWER ADAPTERQUICK INSTALLATION GUIDE<br />\r\nSYSTEM REQUIREMENTS :WINDOWS 8/7/VISTA/XP, MAC OS, ANDROID, IOS, WINDOWS PHONE</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-08-14 12:08:19', 1, 0, '2016-10-27 06:40:09'),
(622, 0, 74, 0, 0, 'PRO-622', 'Dove Men + Care Body and Face Wash', 'Nivea_New.jpg', 'Dove Men+Care Clean Comfort Body and Face Wash provides hydration for healthier, stronger skin\r\n#1 Dermatologist Recommended Dove Men+Care Body and Face Wash leaves fresh, clean feeling\r\nMICROMOISTURE technology activates when lathering\r\nExtra Fresh Body ', '<p>Dove Men+Care Clean Comfort Body and Face Wash provides hydration for healthier, stronger skin</p>\r\n\r\n<p>#1 Dermatologist Recommended Dove Men+Care Body and Face Wash leaves fresh, clean feeling</p>\r\n\r\n<p>MICROMOISTURE technology activates when lathering</p>\r\n\r\n<p>Extra Fresh Body Wash cleansing gel rinses off easily and features a fresh, clean scent</p>\r\n\r\n<p>Dove Men+Care Body and Face Wash is developed specifically for men&#39;s skin</p>\r\n', '', '', NULL, '10', NULL, NULL, 2, '2016-08-14 07:08:01', 1, 0, '2016-08-14 14:21:55'),
(623, 0, 54, 0, 0, 'PRO-623', 'Police Pen', 'download.jpg', '', '<p>Want it tomorrow, Aug. 19?&nbsp;Order within&nbsp;8 hrs 46 mins&nbsp;and choose this date at checkout.</p>\r\n\r\n<p>Ships from and sold by Amazon.com in&nbsp;<a href="https://www.amazon.com/b/?&amp;ref=dp_ffp&amp;node=5521637011" target="_blank">easy-to-open packaging</a>. Gift-wrap available.</p>\r\n\r\n<ul>\r\n	<li>6.1 inches overall, weighs 1.4 ounces</li>\r\n	<li>Made of T6061 aircraft aluminum</li>\r\n	<li>Features a click on-off cap</li>\r\n	<li>Utilizes a Parker and Hauser ink cartridge (included)</li>\r\n	<li>Has a black finish</li>\r\n	<li>The pointed end of the pen body is NOT the writing end. The writing tip is housed under the cap on the blunt/flat end-cap.</li>\r\n</ul>\r\n\r\n<p>&rsaquo;&nbsp;<a href="https://www.amazon.com/Smith-Wesson-SWPENMPBK-Military-Tactical/dp/B003D7K07K#productDetails">See more product details</a></p>\r\n', '', '', NULL, '15', NULL, NULL, 2, '2016-08-18 04:08:17', 1, 0, '2016-08-18 11:30:08'),
(624, 0, 90, 43, 0, 'PRO-624', 'Lomani Panda Little Lovers 100 ml for Kids', 'little-lovers.gif', 'With the dominant fragrance of mango, LITTLE LOVERS of the Lomani Kid’s Collection perpetuates the exotic appeal of a scintillating cocktail.\r\n\r\nMade in France', '<p>Overview and Scent description<br />\r\nWith the dominant fragrance of mango, LITTLE LOVERS of the Lomani Kid&rsquo;s Collection perpetuates the exotic appeal of a scintillating cocktail. Brimming with tropical playful, it combines coconut chords with juicy mandarin, complimented by the crunchy notes of green apples. The heart of the note basks in the sun-kissed warmth of red fruits through the mischievous appeal of raspberries coupled with the creamy, sunny scent of jasmine. The lotus flower adds a touch of&nbsp;lightness to this charming bouquet. The bottom notes are characterised by the sweetness chords of sandalwood and powdered musk.</p>\r\n\r\n<p>Scent pyramid<br />\r\nTop notes : Mango, Tangerine, Apple.<br />\r\nMiddle notes : Lotus flower, Jasmine, Raspberry</p>\r\n', '', '', NULL, '50', NULL, NULL, 1, '2016-08-20 12:08:12', 1, 0, '2016-11-09 01:54:23'),
(625, 0, 90, 52, 0, 'PRO-625', 'Lomani Panda Little Captian 100 ml for Kids', 'little-captain.gif', 'LITTLE Captain of the Lomani Kid’s Collection is a sparkling and luminous fragrance, for little mischievous boys.\r\n\r\nMade In France', '<p>Overview and Scent description<br />\r\nLITTLE Captain of the Lomani Kid&rsquo;s Collection is a sparkling and luminous fragrance, for little mischievous boys ! The freshness of zesty Citrus opens with a playful note and continues to radiate with the clear and vegetal note of Verbena. The brightness of ginger and the gentleness of Nutmeg reveal a stimulating and spicy heart, to which Jasmine adds a touch of innocence and spring happinness. A musky and woody trail brings a punch character for playful and audacious little guys.</p>\r\n\r\n<p>Scent pyramid<br />\r\nTop notes : Bergamot, Mandarin, Orange, Verbena.<br />\r\nMiddle notes : Ginger, Nutmeg, Jasmine.<br />\r\nBase notes : White Woods, White Musks.<br />\r\n<br />\r\nScent family<br />\r\nTrend : Fresh, Spicy, Woody.</p>\r\n', '', '', NULL, '50', NULL, NULL, 1, '2016-08-20 12:08:15', 1, 0, '2016-11-09 01:54:23'),
(626, 0, 90, 55, 0, 'PRO-626', 'Lomani Panda Little Monsters100 ml for Kids', 'little-monsters1.gif', 'LITTLE Captain of the Lomani Kid’s Collection is a sparkling and luminous fragrance. The freshness of zesty Citrus opens with a playful note and continues to radiate with the clear and vegetal note of Verbena.\r\n\r\nMade In France', '<p>Overview and Scent description<br />\r\nLITTLE Captain of the Lomani Kid&rsquo;s Collection is a sparkling and luminous fragrance, for little mischievous boys ! The freshness of zesty Citrus opens with a playful note and continues to radiate with the clear and vegetal note of Verbena. The brightness of ginger and the gentleness of Nutmeg reveal a stimulating and spicy heart, to which Jasmine adds a touch of innocence and spring happinness. A musky and woody trail brings a punch character for playful and audacious little guys !</p>\r\n\r\n<p>Scent pyramid<br />\r\nTop notes : Bergamot, Mandarin, Orange, Verbena.<br />\r\nMiddle notes : Ginger, Nutmeg, Jasmine.<br />\r\nBase notes : White Woods, White Musks.<br />\r\n<br />\r\nScent family<br />\r\nTrend : Fresh, Spicy, Woody.</p>\r\n', '', '', NULL, '50', NULL, NULL, 1, '2016-08-20 12:08:17', 1, 0, '2016-11-09 01:54:23'),
(627, 0, 67, 0, 0, 'PRO-627', 'Play Station Gold Wireless Stereo Headset', 'SM_A510F_BLACK-2.jpg', 'The Gold Wireless Stereo Headset delivers amazing depth and audio clarity, elevating your gaming experience with custom audio modes created by developers exclusively for PlayStation®.', '<p>The Gold Wireless Stereo Headset delivers amazing depth and audio clarity, elevating your gaming experience with custom audio modes created by developers exclusively for PlayStation&reg;.</p>\r\n\r\n<ul>\r\n	<li>A Headset for Gamers: Experience everything from the big booms to whisper-quiet warnings in stunning 7.1 virtual surround sound and chat with friends through the hidden noise cancelling microphone.</li>\r\n	<li>Developed by PlayStation: With the Headset Companion App, download custom game modes created exclusively for PlayStation by developers that are specifically tuned to enhance the audio in your favorite games</li>\r\n	<li>Stylish Comfort: Slip into comfort you can enjoy for hours and a look you can take anywhere. Further customize your look by swapping out the removable faceplates for something more your style.</li>\r\n	<li>Adaptable Audio: Connect wirelessly to your PS4, PS3, and home computer, or connect to your PS Vita system or other mobile device with the included 3.5mm audio cable and take your sound with you</li>\r\n</ul>\r\n', '', '', NULL, '20', NULL, NULL, 2, '2016-08-21 05:08:38', 1, 0, '2016-08-21 12:02:49'),
