(640, 0, 74, 41, 0, 'PRO-640', 'Guess Seductive Homme EDT for him 100 ml', 'Doha_Web.jpg', 'The Seductive Homme by Guess for Men is an alluring Eau de Toilette that never fails to mesmerize. This fragrance was released in the August of the year 2011 and has been a hit with the men ever since', '<p>The Seductive Homme by Guess for Men is an alluring Eau de Toilette that never fails to mesmerize. This fragrance was released in the August of the year 2011 and has been a hit with the men ever since. The composition is defined by woody, aromatic, fougere notes and was created for the charming, charismatic man who&rsquo;s a magnet among the ladies. This scent embodies seduction and makes an eloquent signature. Available in a 100ml glass flacon, this scent only enhances that irresistible charm.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The fragrance starts off with the intensely resinous, aromatic, and slightly spicy note of cardamom milk. It is complemented by succulent, juicy, honeyed faceted mandarin pulp, and rounded off by spicy but rosy pink pepper.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>The heart is assorted, drawing its intricacy from three unique smelling notes: orchids, violet leaves, and vetiver. While orchid is known for lending a powdery veneer to floral bouquets, violet leaves bring in its own brand of metallic smelling, green, aqueous nuance. These two notes take solace in the musty, woody scent of vetiver that also contributes bitter chocolate and smoky facets to the composition.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>The base of the fragrance is a mixture of dark and bright, warm and exciting. It consists of earthy patchouli, milky rich sandalwood, resinous, warm amber, and sensual musk.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '33', NULL, NULL, 1, '2016-08-23 11:08:46', 1, 0, '2016-11-09 01:54:23'),
(641, 0, 74, 44, 0, 'PRO-641', 'CK in 2U for Him EDT 100 ml', 'Calvin_Klein_Ck_IN2U_Him_PIC-450x450.jpg', 'The Calvin Klein Ck In2U Perfume for Men is created for the young generation that is liberated by technology. Termed as the ‘technosexual generation'', they express freedom and venture out to explore the world around.', '<p>The Calvin Klein Ck In2U Perfume for Men is created for the young generation that is liberated by technology. Termed as the &lsquo;technosexual generation&#39;, they express freedom and venture out to explore the world around. This aromatic Fougere fragrance with a woody oriental base is sure to garner attention with its combination of aromatic flora. The perfume was introduced in 2007 by the house of Calvin Klein and was created by perfumers Bruno Jovanovic, Jean Marc Chaillan, Loc Dong, and Carlos Benaim. This perfume can be described as fruity with a woody oriental base, whose composition opens with lemon and tomato leaf. Cacao pod are is the heart, while the base notes are vetiver, and white musk. The 100ml scent comes packed in a chic white bottle with minimal design that is simple, and attractive.</p>\r\n', '', '', NULL, '35.55', NULL, NULL, 1, '2016-08-23 11:08:32', 1, 0, '2016-11-09 01:54:23'),
(642, 0, 93, 1, 0, 'PRO-642', 'Kent AH7G Cushioned Large Setting & Styling Paddle Brush', 'LGE_PHINE_PINCU_BGREY.jpg', 'The Air Hedz Pro Range of Kent is the choice of professionals and consumers the world across. Crafted with the best quality materials from around the world, the body has a profound and rich black mat effect. The handle has rubber grips making it extremely', '<p>The Air Hedz Pro Range of Kent is the choice of professionals and consumers the world across. Crafted with the best quality materials from around the world, the body has a profound and rich black mat effect. The handle has rubber grips making it extremely ergonomic and stress free to use. Use your oils, creams and products and if by mistake you grab the brush, it just won?t slip off your hands. If you comb your hair too often or have a great amount of styling, setting &amp;combing to do at home or in a salon, this rubberized handle won?t stress your wrists and fingers much. The bristles are mounted on a rubberized base, this base is resistant to water, treatments, conditioners, creams and product build-ups. High quality rubberized base gives that extra bounce, cushion and life to the brush. The hallmark of this series is the super premium quality of bristles, which are polished and finished using the most advanced technology. Due to this the bristles do not scratch the cuticle or damage your hair. When you use the brush for blow-drying, setting, styling or blast drying, the bristles close the cuticle and impart gloss and shine to the hair. Made with a very high quality premium material, these bristles are heat resistant imparting years to the life of the brush. Investment in a good quality brush makes a lot of sense when you spend thousands on consumable products like shampoos, conditioners and treatments. Kent Air Hedz Pro range is one such great investment you will make. You ideal routine after a shampoo or hair wash should be conditioning, detangling and then combing and if required blow-drying</p>\r\n', '', '', NULL, '15', NULL, NULL, 1, '2016-09-20 11:09:22', 1, 0, '2016-10-14 10:34:07'),
(643, 0, 93, 3, 0, 'PRO-643', 'Kent AH10 W Detangle and Grooming', 'AIRHEDZ_TAMING_STRAIGHTENING_BRUSH.jpg', 'A slim paddle brush for short, thick hair.  The air cushioned heads massage the scalp whilst the large cone pins emulate fingers, to slide through tangled hair without abrasive tugging', '<p>A slim paddle brush for short, thick hair.&nbsp; The air cushioned heads massage the scalp whilst the large cone pins emulate fingers, to slide through tangled hair without abrasive tugging</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-09-20 11:09:32', 1, 0, '2016-10-15 14:26:54'),
