(661, 0, 74, 29, 0, 'PRO-661', 'Eternity Aqua by Calvin Klein for Men - Eau de Toilette, 100ml', 'Aqua_450x450.jpg', 'CK and Coty are presenting a new fragrance&Eternity Aqua for Men, which arrives on the market in 2010. Cover face of the new edition is Ben Hill - supermodel', '<p>The new fragrance was created with an intention to presents a new face of Eternity edition for men, highlighted with a modern, casual, aquatic-woody composition.&nbsp;<strong>Eternity Aqua for Men</strong>&amp; opens with accords of cold cucumbers, citruses, lotus and green leaves. A heart blooms with a union of Sichuan pepper, Mirabelle plum, lavender, and cedar while a base finishes with sandalwood, Guaiac wood, patchouli, and musk.&amp;</p>\r\n\r\n<p><strong>Calvin Klein</strong>&nbsp;Inc. is an American fashion brand started by Calvin Klein at the end of the 1960s. The brand is famous for its minimalism and classic style and helped launch the craze for designer jeans in the 1970s when Klein began adding his name on the back pocket. Today, Calvin Klein is known worldwide for their jeans, casual collections, underwear collections and perfumes. Watches and a jewelry collection became part of the brand&#39;s offering in 1997. The company&#39;s &quot;cK&quot; logo is as recognizable as its brand name and adorns many products in their line.</p>\r\n\r\n<p>The company&#39;s first perfume, Calvin, was launched in 1981. Calvin Klein has since launched a series of successful perfumes that, for many, capture the spirit of the decades in which they were introduced, including Obsession (1985 for Women, 1986 for Men), cK One (one of the first fragrances marketed as unisex, in 1994), and Euphoria (2005 for women, 2006 for Men). Klein&#39;s license for perfumes now belongs to Coty.</p>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-03 09:10:32', 1, 0, '2016-11-09 01:54:23'),
(662, 0, 74, 27, 0, 'PRO-662', 'Hugo Boss Hugo Just Different for Men 75 ml,  Eau de Toilette', 'hugo_450x450.jpg', 'Product Features : Top Notes are Granny Smith Apple and MintMiddle Notes are Freesia, Coriander and BasilBase Notes are Olibanum, Labdanum, Patchouli and CashmeranRecommended for : Any OccasionRelease Year : 2011Eau de ToiletteSize : 75 ml', '<ul>\r\n	<li><strong>PRODUCT FEATURES :</strong></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Top Notes are Granny Smith Apple and Mint</li>\r\n	<li>Middle Notes are Freesia, Coriander and Basil</li>\r\n	<li>Base Notes are Olibanum, Labdanum, Patchouli and Cashmeran</li>\r\n	<li>Recommended for : Any Occasion</li>\r\n	<li>Release Year : 2011</li>\r\n	<li>Eau de Toilette</li>\r\n	<li>Size : 75 ml</li>\r\n</ul>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-03 09:10:12', 1, 0, '2016-11-09 01:54:23'),
(663, 0, 74, 31, 0, 'PRO-663', 'Lacoste Pour Homme for Men -Eau Toilette, 75ml', 'Lacoste_450x450.jpg', 'A youthful and trendy fragrance with notes of cedar and jasmine for a cool, cutting-edge scent.Lacoste Pour Homme was created for all Rene Lacoste''s followers, the men who follow the style embodied in the crocodile: men of class, reliance, and elegance. ', '<p>A youthful and trendy fragrance with notes of cedar and jasmine for a cool, cutting-edge scent.Lacoste Pour Homme was created for all Rene Lacoste&#39;s followers, the men who follow the style embodied in the crocodile: men of class, reliance, and elegance.&nbsp;</p>\r\n\r\n<p><strong>Fragrance Notes:</strong></p>\r\n\r\n<ul>\r\n	<li>Top notes: Ruby grapefruit, plum accord, Italian bergamot &amp; apple</li>\r\n	<li>Heart notes: Juniper, cardamom, cinnamon bark &amp; berry pink peppercorn</li>\r\n	<li>Base notes: Jamaican rum, agarwood, sandalwood &amp; vanilla bean</li>\r\n</ul>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-03 10:10:19', 1, 0, '2016-11-09 01:54:23'),
(664, 0, 74, 28, 0, 'PRO-664', 'Versace Pour Homme by Versace for Men - Eau de Toilette, 100ml', 'Versace_450x450.jpg', 'Versace Pour Homme by Versace for Men is a sensual aromatic Fougere fragrance that has an aura of masculinity. The enigmatic Eau de Toilette is not only good for parties but also for work and casual outings with your loved ones.', '<p>Versace Pour Homme by Versace for Men is a sensual aromatic Fougere fragrance that has an aura of masculinity. The enigmatic Eau de Toilette is not only good for parties but also for work and casual outings with your loved ones. Master perfumer Alberto Morillas has perfectly blended lemon, bergamot, neroli, and rose de mai with essences of fresh flowers, green grass, and fragrant, subtle spices. The scent comes in a 100ml flacon with bold cuts. The design is as manly as the scent.</p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>Versace Pour Homme by Versace for Men opens with accords of citrusy lemon, fresh neroli, tart bergamot, and intense rose de mai. The aroma radiated by the opening notes is extremely refreshing.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>The middle notes of the Versace Pour Homme by Versace for Men are focused mainly on floral elements. Intensely fresh hyacinth coalesces with the green notes of clary sage, geranium, and cedar, to give off an aroma that is engaging and mysterious.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>The heart notes of the Versace Pour Homme by Versace for Men are followed by base notes that comprise of almond smelling tonka bean, warm, comforting musk, and amber. These notes support the upper layers of the composition, highlighting them, for a dry down that is nothing short of sophisticated.</p>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-03 10:10:02', 1, 0, '2016-11-09 01:54:23'),
(665, 0, 74, 32, 0, 'PRO-665', 'The Game by Davidoff for Men - Eau de Toilette, 100ml', 'davidoff_450x450.jpg', 'The Game by Davidoff Eau de Toilette for Men provides you with a subtle yet strong scent that will complement your finest attires. Made for the strong and confident man, this Davidoff perfume speaks of a bold, irresistible fragrance that will linger all t', '<p>The Game by Davidoff Eau de Toilette for Men provides you with a subtle yet strong scent that will complement your finest attires. Made for the strong and confident man, this Davidoff perfume speaks of a bold, irresistible fragrance that will linger all through the day. Since 2012</p>\r\n\r\n<p>the Game from Davidoff has been providing men with a scent that is ideal for pleasure and business. A light spritz will go a long way to adding a sense of cool to your already suave demeanor. With its notes of ebony wood, precious woods, iris, juniper berries, and gin, this masculine fragrance provides a refreshing and energetic feeling. The 100ml EDT bottle features multiple black and gray casino chips that make it unique and distinct.</p>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-03 10:10:15', 1, 0, '2016-11-09 01:54:23'),
(666, 0, 74, 33, 0, 'PRO-666', 'Individuel by Mont Blanc for Men - Eau de Toilette, 75ml', 'Mont_Blanc_450x450.jpg', 'The house of Mont Blanc reputed for its style and elegance brings you a fragrance that is simply marvelous and calls it Individuel for Men. This is an oriental, woody fragrance and is made for a man who is classy and smart and highly efficient and skillfu', '<p>The house of Mont Blanc reputed for its style and elegance brings you a fragrance that is simply marvelous and calls it Individuel for Men. This is an oriental, woody fragrance and is made for a man who is classy and smart and highly efficient and skillful in everything he does. He is stylish in a very offhanded way and might be considered intimidating by most.&nbsp;</p>\r\n\r\n<p>The creator of this fragrance is none other than the brilliant Pierre Bourdon. It is contained in a simple and sleek looking flacon that uses glass and metallic elements for a chic and svelte look. The liquid is a pale sky blue color and the stopper a polished silver color.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The top notes of the fragrance include a carefully blended composition of fresh and lively accords from rosemary, pineapple, coriander, cinnamon, lavender, juniper berries, mint, bergamot and cardamom.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>The heart of the fragrance is made up of floral notes and include orange blossom, violet, jasmine and geranium.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>Oriental sandalwood, warm amber, earthy patchouli, refined musk, raspberry, vanilla, dark chocolate, oak moss and vetiver.</p>\r\n\r\n<p><a href="javascript:void(0);">Read less</a></p>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-04 06:10:25', 1, 0, '2016-11-09 01:54:23'),
(667, 0, 56, 2, 0, 'PRO-667', '  DELL INSPIRON 3552 BLACK', 'DELL_3552_450x4502.jpg', 'The Dell Inspiron 15 3542 Laptop is an ideal device for daily computing needs. Available in a stylish black finish, this Dell laptop bears a sophisticated design that boasts durability for years to come. Enjoy an immersive viewing experience on its spacio', '<p>The Dell Inspiron 15 3542 Laptop is an ideal device for daily computing needs. Available in a stylish black finish, this Dell laptop bears a sophisticated design that boasts durability for years to come. Enjoy an immersive viewing experience on its spacious 15.6inch LED screen that offers crisp details and vibrant colors with every click. The laptop is equipped with a high quality hard drive that offers a massive storage space of 500GB, thus, enabling you to hoard up on all those games, movies, music, and other files that matter. It also has an optical DVDRW drive, in which you can insert CD&rsquo;s belonging to various genres. WiFi support comes to the rescue for when you want to surf the Internet at high speed when in the vicinity of a wireless network. The laptop is preinstalled with the highly efficient DOS operating system that offers a host of new and innovative features to choose from</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-10-05 11:10:44', 1, 0, '2016-10-27 06:48:05'),
(668, 0, 56, 4, 0, 'PRO-668', 'Lenovo Ideapad 110 Laptop', 'LENOVO_450x450.jpg', 'Powered for Fun\r\nThe Ideapad 110 is powered by an Intel® processor with integrated graphics, giving you plenty of processing power for casual surfing, streaming, and playing.', '<h2>Powered for Fun</h2>\r\n\r\n<p>The Ideapad 110 is powered by an Intel&reg; processor with integrated graphics, giving you plenty of processing power for casual surfing, streaming, and playing.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-05 12:10:04', 1, 0, '2016-11-01 08:26:42'),
