(670, 0, 75, 34, 0, 'PRO-670', 'Moschino Cheap and Chic I Love Love For Women - 100 ml', 'Doha_Web_(6)1.jpg', 'I Love Love is a very optimistic scent, bursting with love, sun and bright colors. Fresh and sparkly, yet balmy bouquet opens with notes of citruses and red fruits. The heart introduces fresh flowers: lily of the valley, bulrush, tea rose and cinnamon lea', '<p>I Love Love is a very optimistic scent, bursting with love, sun and bright colors. Fresh and sparkly, yet balmy bouquet opens with notes of citruses and red fruits. The heart introduces fresh flowers: lily of the valley, bulrush, tea rose and cinnamon leaves</p>\r\n\r\n<p>Brand:&nbsp;Moschino</p>\r\n\r\n<p>Size: 100ml</p>\r\n\r\n<p>Targeted Group:&nbsp;Women</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perfume Name</p>\r\n\r\n<p>MOSCHINO CHEAP AND CHIC</p>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-14 03:10:19', 1, 0, '2016-11-09 01:54:23'),
(671, 0, 75, 35, 0, 'PRO-671', 'Dolce & Gabbana Light Blue for Women 100ml, Eau de Toilette', 'Doha_Web_(2).jpg', 'The Dolce & Gabbana Light Blue for Women is a sparkling floral fragrance that captures the spirit of the Sicilia that appears bright as it basks in the overhead sun. With the set of brilliantly balanced notes, the fragrance closes with pleasant notes that', '<p>The Dolce &amp; Gabbana Light Blue for Women is a sparkling floral fragrance that captures the spirit of the Sicilia that appears bright as it basks in the overhead sun. With the set of brilliantly balanced notes, the fragrance closes with pleasant notes that keep the aroma for long hours. ...</p>\r\n', '', '', NULL, '40', NULL, NULL, 1, '2016-10-14 03:10:39', 1, 0, '2016-11-09 01:54:23'),
(672, 0, 74, 36, 0, 'PRO-672', 'Lanvin Lanvin for Men -100ml, Eau de Parfum', 'Lanvin1.jpg', 'Product Features : Top Notes are Pomegranate Blossom, Lavender, Mandarin Orange, Neroli and BergamotMiddle Notes are Pepper, Mint, Sage and CardamomBase Notes are Sandalwood, Amber, Musk and VanillaRecommended Use: Daytime WearRelease Date: 1997Eau de Par', '<p>Product Features : Top Notes are Pomegranate Blossom, Lavender, Mandarin Orange, Neroli and BergamotMiddle Notes are Pepper, Mint, Sage and CardamomBase Notes are Sandalwood, Amber, Musk and VanillaRecommended Use: Daytime WearRelease Date: 1997Eau de ParfumSize: 100ml</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Brand:&nbsp;Lanvin</p>\r\n\r\n<p>Size:&nbsp;100ml</p>\r\n\r\n<p>Targeted Group:&nbsp;Men</p>\r\n\r\n<p><strong>Fragrance Notes</strong></p>\r\n\r\n<p>pomegranate blossom, lavender, mandarin orange, neroli, bergamot, pepper, mint, sage, cardamom, sandalwood, amber, musk and vanilla</p>\r\n', '', '', NULL, '25', NULL, NULL, 1, '2016-10-14 03:10:33', 1, 0, '2016-11-09 01:54:23'),
(673, 0, 74, 37, 0, 'PRO-673', '1 Million Intense by Paco Rabanne for Men - Eau de Toilette, 100ml', 'Million_Intense1.jpg', 'Coming from the reputed and top rated brand, the 1 Million Intense new perfume from Paco Rabanne was created in 2008. This sweet and intense fragrance is perfect for modern men and can be worn with evening wear. It is created to enhance the feeling of fre', '<p>Coming from the reputed and top rated brand, the 1 Million Intense new perfume from Paco Rabanne was created in 2008. This sweet and intense fragrance is perfect for modern men and can be worn with evening wear. It is created to enhance the feeling of freshness and is also an epitome of extravagance</p>\r\n', '', '', NULL, '40', NULL, NULL, 1, '2016-10-14 03:10:15', 1, 0, '2016-11-09 01:54:23'),
