(676, 0, 95, 4, 0, 'PRO-676', 'Choco Pro Cappuccino 20x55G', '17_CHOCO_PRO_CAPPUC.jpg', 'Choco Pro Cappuccino 20x55G', '<h2><strong>INGREDIENTS:</strong></h2>\r\n\r\n<p>vegetable fat, defatted cocoa powder, soy lecithin, maltodextrin, flavoring, salt.</p>\r\n\r\n<p>Chocolate coating: vegetable fat, sugar, defatted cocoa powder, 10/12% cocoa butter, soy lecithin, and flavoring.&nbsp;</p>\r\n\r\n<h2>NUTRITION INFORMATION&nbsp;</h2>\r\n\r\n<p>Serving size: 1 bar (55 g) Servings Per Bar: 1</p>\r\n\r\n<p>Amount &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;per bar &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; per 100 g</p>\r\n\r\n<p>Energy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;888 kJ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1614 kJ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;212 kcal &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;385 kcal</p>\r\n\r\n<p>Protein &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;18 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;33 g</p>\r\n\r\n<p>Carbohydrate &nbsp; &nbsp; &nbsp;&nbsp;22 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;40 g</p>\r\n\r\n<p>Fat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5.8 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;10.5 g</p>\r\n\r\n<p>Dietary Fiber &nbsp; &nbsp; &nbsp;&nbsp;1.65 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3g</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-14 09:10:42', 1, 0, '2016-10-22 16:32:24'),
(677, 0, 95, 6, 0, 'PRO-677', 'Choco Pro Double Chocolate 20x55G', '19_CHOCO_PRO_DOUBLE_CHOCO.jpg', 'Choco Pro Double Chocolate 20x55G', '<h2><strong>INGREDIENTS:</strong></h2>\r\n\r\n<p>High fructose corn syrup, protein matrix (calcium caseinate, whey protein concentrate, milk protein concentrate),</p>\r\n\r\n<p>vegetable fat, defatted cocoa powder, soy lecithin, maltodextrin, flavoring, salt.</p>\r\n\r\n<p>Chocolate coating: vegetable fat, sugar, defatted cocoa powder, 10/12% cocoa butter, soy lecithin, and flavoring.&nbsp;</p>\r\n\r\n<h2><strong>NUTRITION INFORMATION</strong></h2>\r\n\r\n<p>Serving size: 1 bar (55 g) Servings Per Bar: 1</p>\r\n\r\n<p>Amount &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;per bar &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; per 100 g</p>\r\n\r\n<p>Energy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;888 kJ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1614 kJ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;212 kcal &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;385 kcal</p>\r\n\r\n<p>Protein &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;18 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;33 g</p>\r\n\r\n<p>Carbohydrate &nbsp; &nbsp; &nbsp;&nbsp;22 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;40 g</p>\r\n\r\n<p>Fat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5.8 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;10.5 g</p>\r\n\r\n<p>Dietary Fiber &nbsp; &nbsp; &nbsp;&nbsp;1.65 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3g</p>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-14 09:10:14', 1, 0, '2016-10-22 16:32:34');
