(679, 0, 95, 9, 0, 'PRO-679', 'Choco Pro Tiramisu 20x55G', '21_CHOCO_PRO_TIRAMISU.jpg', 'Choco Pro Tiramisu 20x55G', '<h2><strong>INGREDIENTS:</strong></h2>\r\n\r\n<p>vegetable fat, defatted cocoa powder, soy lecithin, maltodextrin, flavoring, salt.</p>\r\n\r\n<p>Chocolate coating: vegetable fat, sugar, defatted cocoa powder, 10/12% cocoa butter, soy lecithin, and fla&nbsp;</p>\r\n\r\n<h2><strong>NUTRITION INFORMATION</strong></h2>\r\n\r\n<h2>NUTRITION INFORMATION&nbsp;</h2>\r\n\r\n<p>Amount &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;per bar &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; per 100 g</p>\r\n\r\n<p>Energy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;888 kJ &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1614 kJ</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;212 kcal &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;385 kcal</p>\r\n\r\n<p>Protein &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;18 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;33 g</p>\r\n\r\n<p>Carbohydrate &nbsp; &nbsp; &nbsp;&nbsp;22 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;40 g</p>\r\n\r\n<p>Fat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5.8 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;10.5 g</p>\r\n\r\n<p>Dietary Fiber &nbsp; &nbsp; &nbsp;&nbsp;1.65 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3g</p>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-14 09:10:30', 1, 0, '2016-10-22 16:32:46'),
(680, 0, 95, 10, 0, 'PRO-680', 'Proteinissimo Vanilla Caramel Crunch 15x50G', '42_PROTEINISSIMO_VANILLA_CARAMEL_CRUNCH.jpg', 'Proteinissimo Vanilla Caramel Crunch 15x50G', '<h2><strong>INGREDIENTS:</strong></h2>\r\n\r\n<p>VANILLA CARAMEL CRUNCH: Calcium Caseinate (from Milk) (22.8%), Invert Sugar Syrup, Whole Milk Couverture Chocolate (20%) [Sugar, Cocoa Butter, Whole MilkPowder, Cocoa Mass, Emulsi-er (Soy Lecithin), Flavor], Caramel Paste (13.5%) [Glucose Fructose Syrup, Sugar, Palm Fat, Sweetened Condensed Skimmed Milk, Butterfat, Emulsi-er (Mono- and diglycerides of fatty acids), Caramelised Sugar Syrup, Gelling Agent (Carrageenan), Salt], Whey Protein (6.2%), Glucose Syrup, Soy Crisps [Soy Protein (4%), Starch,</p>\r\n\r\n<p>Salt], Humectant (Glycerol), Flavor (with Milk), Emulsi-er (Soy Lecithin)</p>\r\n\r\n<h2>NUTRITION INFORMATION&nbsp;</h2>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;50 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;RI%* &nbsp; &nbsp; &nbsp; 100 g</p>\r\n\r\n<p>Energy &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;811 kJ &nbsp; &nbsp; &nbsp; &nbsp;10%&nbsp; &nbsp; &nbsp; &nbsp;1621 kJ</p>\r\n\r\n<p>Carbohydrate &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;22 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;8% &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;44 g</p>\r\n\r\n<p>of which sugars &nbsp; &nbsp; &nbsp;&nbsp;17 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;19% &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;34 g</p>\r\n\r\n<p>Protein &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;15 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;30% &nbsp; &nbsp; &nbsp; &nbsp;30 g</p>\r\n\r\n<p>Salt &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;0.15 g &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3% &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;0.30 g</p>\r\n\r\n<p>Fat &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &