(689, 0, 80, 15, 0, 'PRO-689', 'L-Glutamine 600G', '36_L_GLUTAMINE_600g.jpg', 'L-GLUTAMINE\r\n100% L-Glutamine Amino Acid', '<p>Glutamine is the most abundant amino acid in the human blood. Glutamine may become conditionally essential in certain situations, including intensive physical training, when the body cannot meet its needs by synthesizing glutamine. This conditionally essential amino acid can be provided by dietary protein intake, including by food supplements.</p>\r\n\r\n<h1><strong>NUTRITION INFORMATION</strong></h1>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="width:958px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="7"><strong>Serving size:&nbsp;</strong>6 g (1/2 scoop)</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" rowspan="1"><strong>Amount per serving</strong></td>\r\n			<td>&nbsp;</td>\r\n			<td colspan="2" rowspan="1">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>L-Glutamine</strong></td>\r\n			<td>6000 mg</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-15 07:10:40', 1, 0, '2016-10-22 16:32:46'),
