td>2.6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-Leucine**</td>\r\n			<td colspan="3" rowspan="1">10.6</td>\r\n			<td>&nbsp;</td>\r\n			<td>L-Valine**</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>5.9</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="9">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="9">*RI%: Reference intake of an average adult (8400 kJ/2000 kcal)<br />\r\n			**Essential Amino Acids</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', NULL, '30', NULL, NULL, 1, '2016-10-22 10:10:07', 1, 0, '2016-10-22 16:52:07'),
(702, 0, 89, 11, 0, 'PRO-702', 'INCANTO COLLECTIONS 5pcs each 5 ML- WOMEN', 'incanto_collection_5_pcs.jpg', 'Gift Set Dream 5 ml + Heaven 5 ml, Shine 5 ml, Charm 5 ml, Bloom 5 ml \r\nEau De Toilette\r\nBeauty Code:', '<p>Never afraid to experiment, Salvatore Ferragamo was revered by Hollywood stars for his fashion ideas and original shoe designs.&nbsp; After his death in 1960, his family honored his legacy by continuing to produce high-quality shoes, accessories and clothing.&nbsp; As a tribute, the company introduced charming fragrances like Salvatore Ferragamo Pour Femme and Salvatore Ferragamo Pour Homme in the 1990s.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 10:10:43', 1, 0, '2016-11-09 01:54:23'),
(703, 0, 75, 1, 0, 'PRO-703', 'Lacoste Touch of Pink 90 ml- Women', 'touch_of_pink.jpg', 'Lacoste Touch of Pink 90 ml- Women\r\n\r\nFresh, playful, and vital - this is what Lacoste Touch of Pink is. This eau de toilette is suitable rather for young girls and women full of energy, playfulness, and joy of life. A fragrance as pure as a soul of the i', '<p>Fresh, playful, and vital - this is what&nbsp;Lacoste Touch of Pink is. This eau de toilette is suitable rather for young girls and women full of energy, playfulness, and joy of life. A fragrance as pure as a soul of&nbsp;the innocent woman who will wear it.</p>\r\n\r\n<p>However, its essences combine not only fresh citruses, but also fine tones of flowers, sandal wood, and vanilla. This mixture of ingredients will create a virtual veil around you to turn you into a fascinating woman in full control of her life, following only what makes her happy.</p>\r\n\r\n<p>Far from&nbsp;sumptuous or cheap so every woman&nbsp;can find in it what is close to her heart. Thanks to its fresh scent, Lacoste Touch of Pink is suitable rather for warm summer days. Also, its practical pink package easily fits in every young woman&#39;s purse.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 10:10:51', 1, 0, '2016-11-09 01:54:23'),
(704, 0, 74, 2, 0, 'PRO-704', 'Scuderia Ferrari Black by Ferrari 125ML- Men', '70243M.jpg', 'Scuderia Ferrari Black by Ferrari is a Aromatic Fougere fragrance for men. Scuderia Ferrari Black was launched in 2013. Top notes are citruses, lime, bergamot, apple and plum; middle notes are cardamom, cinnamon, rose and jasmine; base notes are cedar, am', '<p>Scuderia Ferrari Black by Ferrari is a Aromatic Fougere fragrance for men. Scuderia Ferrari Black was launched in 2013. Top notes are citruses, lime, bergamot, apple and plum; middle notes are cardamom, cinnamon, rose and jasmine; base notes are cedar, amber, musk and vanilla.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 10:10:41', 1, 0, '2016-11-09 01:54:23');
INSERT INTO `product` (`id`, `manufacture`, `category`, `order_no`, `reorder_qty`, `code`, `title`, `image`, `short`, `description`, `meta_des`, `meta_key`, `price`, `discount`, `clearance`, `clearance_discount`, `status`, `create_date`, `create_by`, `company_id`, `last_update`) VALUES
(705, 0, 75, 3, 0, 'PRO-705', 'Tommy by Tommy Hilfiger 100ml Eau de Toilette Spray for Men', 'tommy_boy_edt_grande.jpg', 'Tommy Boy by Tommy Hilfiger 100ml Eau de Toilette Spray for Men\r\n\r\nTommy by Tommy Hilfiger is a fragrance made just for men. Tommy was released in the year 1995.\r\n\r\nTommy by Tommy Hilfiger is the classic Tommy Hilfiger fragrance and has a timeless, ever f', '<p>Tommy Boy by Tommy Hilfiger&nbsp;100ml Eau de Toilette&nbsp;Spray for Men</p>\r\n\r\n<p>Tommy by Tommy Hilfiger is a fragrance made just for men. Tommy was released in the year 1995.</p>\r\n\r\n<p>Tommy by Tommy Hilfiger is the classic Tommy Hilfiger fragrance and has a timeless, ever fresh scent. It&#39;s fruity fresh, natural and sexy with a casually musky note.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 10:10:50', 1, 0, '2016-11-09 01:54:23'),
(706, 0, 75, 4, 0, 'PRO-706', 'Escada Desire ME 75 ML- Women', '67338w.jpg', 'History and background of Escada. ESCADA is the international luxury fashion group in women´s designer fashion. It has pursued a course of steady expansion since its founding in 1976 by Margaretha and Wolfgang Ley and today has nearly 440 shops and corner', '<p>History and background of Escada. ESCADA is the international luxury fashion group in women&acute;s designer fashion. It has pursued a course of steady expansion since its founding in 1976 by Margaretha and Wolfgang Ley and today has nearly 440 shops and corners in more than 60 countries.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 11:10:59', 1, 0, '2016-11-09 01:54:23'),
(707, 0, 75, 5, 0, 'PRO-707', 'Eclat D Aprege Lanvin 100 ml', 'ECLAT.jpg', 'Eclat d’Arpège is classified as fruity-floral. Lanvin revives the musical theme of his legendary Arpege perfume. The composition is delicate, fragile and angelic. Eclat d’Arpège’s first accords are green lilac and Sicilian lemon leaves which transports us', '<p><strong>Eclat d&rsquo;Arp&egrave;ge</strong>&nbsp;is classified as fruity-floral.&nbsp;<strong>Lanvin</strong>&nbsp;revives the musical theme of his legendary Arpege perfume. The composition is delicate, fragile and angelic.<strong>Eclat d&rsquo;Arp&egrave;ge</strong>&rsquo;s first accords are green lilac and Sicilian lemon leaves which transports us to the first day of spring. Summer&rsquo;s near , flowers are in full bloom, the scent is more intense, it&rsquo;s a wisteria blossom that blooms at perfume&rsquo;s heart, accentuated by lush peach blossom and sensual red peony. Airy green tea leaves are refreshing.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-10-31 11:10:07', 1, 0, '2016-11-09 01:54:23'),
(708, 0, 75, 6, 0, 'PRO-708', 'Guess pink for women 75 ml EDP', 'guess-pink-lds.jpg', 'Guess pink for women 75ml 3 in 1 guess pink t marciano guess by parlux 2 5 oz edp eau de parfum women 39 s spray perfume new nib 75 ml original guess pink women edp 75ml perfume', '<p>Guess pink for women 75ml 3 in 1 guess pink t marciano guess by parlux 2 5 oz edp eau de parfum women 39 s spray perfume new nib 75 ml original guess pink women edp 75ml perfume</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-02 08:11:08', 1, 0, '2016-11-09 01:54:23'),
(709, 0, 75, 10, 0, 'PRO-709', 'Estée Lauder Pleasures Intense EDP 100 ml Women', 'Estee_Lauder_Pleasures_Intense_Edp_100ml.jpg', 'Pleasures Intense by Estée Lauder is a Floral fragrance for women. Pleasures Intense was launched in 2002. Top notes are peony, black currant, ylang-ylang, green lily and cassis; middle notes are lily, tiare flower, jasmine and moroccan rose; base notes a', '', '', '', NULL, '', NULL, NULL, 1, '2016-11-02 08:11:22', 1, 0, '2016-11-09 01:54:33'),
(710, 0, 75, 7, 0, 'PRO-710', 'Estee Lauder Pleasure Bloom Edp 50ml', 'Estee_Lauder_Pleasure_Bloom_Edp_50ml.jpg', 'Estee Lauder Pleasure Bloom Edp 50ml', '<p>Estee Lauder Pleasure Bloom Edp 50ml Estee Lauder introduced (July 2010) a new fruity floral version of their iconic fragrance Pleasures, -&nbsp;Pleasures Bloom. &quot;We wanted to take the timeless core concept of pleasures - the enjoyment of life&rsquo;s simple pleasures as the balance to a life that is often over connected and overextended &ndash; and express it with a new level of animation and vibrancy that reflects the world we live in today,&rdquo; said Karyn Khoury, Senior Vice President, Corporate Fragrance Development Worldwide, The&nbsp;Est&eacute;e Lauder&nbsp;Companies Inc. The notes of this fragrance are: grapefruit, raspberry, lychee, violet flower pink peony, rose, jasmine, green lily, musk, patchouli, creamy vanilla</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-03 07:11:14', 1, 0, '2016-11-09 01:54:33'),
(711, 0, 74, 8, 0, 'PRO-711', '24 Gold The Fragrance Cologne 100 ml - Men', '70159m.jpg', '24 Gold The Fragrance Cologne 100 ml - Men', '<p>24 Gold The Fragrance Cologne by ScentStory, Splash on 24 gold the fragrance jack bauer brought to you by scentstory&nbsp;. This fragrance keeps you feeling like an action hero with notes of agarwood, cedar and jasmine for a clean, crisp scent in the toughest of conditions. Wear this men&#39;s fragrance on date night or around the office for an attractive aura as you walk by. This mood altering scent includes sandalwood notes to improve your confidence level and keep you happy throughout the day.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-05 10:11:38', 1, 0, '2016-11-09 01:54:33'),
(712, 0, 74, 9, 0, 'PRO-712', '24 PLATINUM OUD EDITION 100 ML- MEN', '1-paris-gallery-24-the-fragrance-24098.jpg', '24 PLATINUM OUD EDITION 100 ML- MEN', '<p>24 PLATINUM Fragrance, completely reinterpeted. More projection, even longer lasting qualities for 24 hours and more. Platinum is the symbol of exclusivity and wealth. It is precious and rare, widely used in jewelry for its inert and ultra shining properties, and very high density. 24 Platinum is its resulting fragrance: deep and intense, it is an exhilarating fragrance for a shining sensorial journey. A full-bodied, long lasting fragrance with a strong flowery and woody heart, blending rapidly and smoothly with vanilla and musk. 24 hours of pure intense pleasure.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-05 10:11:08', 1, 0, '2016-11-09 01:54:33'),
(713, 0, 75, 12, 0, 'PRO-713', 'Escada-Rockin-Rio-Womens-3_3-ounce-EDT-Spray-Limited-Edition-100ML', 'Escada-Rockin-Rio-Womens_.jpg', 'Escada-Rockin-Rio-Womens-3_3-ounce-Eau-de-Toilette-Spray-Limited-Edition', '<p>Rockin Rio is a sweet and fresh fruity floral fragrance inspired by Brazilian samba drum beats, tropical scents, and the spirit of glamour and passion. The limited edition holiday scent features a hint of pineapple and coconut with a zingy tango of tangerine and papaya top notes, sweet heart notes of sugar cane and peach, and the sexy harmony of soft, creamy sandalwood and musk base notes.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Design house: Escada</li>\r\n	<li>Scent name: Rockin Rio (Limited Edition)</li>\r\n	<li>Eau de toilette is available in a 3.3-ounce spray</li>\r\n	<li>Gender: Women&#39;s</li>\r\n	<li>Features a sweet, fresh blend of pineapple, coconut, tangerine, papaya, sugar cane, peach, sandalwood and musk</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 02:11:09', 1, 0, '2016-11-09 01:54:23'),
(714, 0, 75, 13, 0, 'PRO-714', 'Escada-Island-Kiss-Womens-3_3-ounce-EDT-100ML', 'Escada-Island-Kiss-Womens.jpg', 'Escada-Island-Kiss-Womens-3_3-ounce-EDT-100ML', '<p>Steal away to a deserted tropical island where every day is summer when you wear Island Kiss by Escada. Crisp and refreshing top notes of zesty orange, ripe mango and sweet white peach blend with floral notes of passion flower, magnolia and hibiscus to deliver a paradisiacal fragrance. Warm musk, blond woods and juicy red fruits add layers of depth and intrigue to your captivating scent.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 02:11:47', 1, 0, '2016-11-09 01:54:23'),
(715, 0, 75, 14, 0, 'PRO-715', 'Escada-Sexy-Graffiti-Womens-3_3-ounce-EDT- 100ML', 'Escada-Sexy-Graffiti-Women.jpg', '', '<p>Sexy Graffiti limited edition perfume was launched by Escada in 2011. This women&#39;s fragrance possesses a blend of wild strawberry, raspberry, pink grapefruit, blackcurrant, lilly of the valley, red peony, violet, cashmeran, vanilla, musks.<br />\r\n<br />\r\nSexy Graffiti by Escada comes in a 3.3-ounce bottle that is small enough to fit into your purse if you are on the go. As unique as the design house that created it, this sweet and fresh scent pairs well with daytime business looks and evening formal attire to make a stunning impression.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 02:11:15', 1, 0, '2016-11-09 01:54:23'),
(716, 0, 74, 15, 0, 'PRO-716', 'Gucci Guilty Cologne Intense 75ML-Men', 'Gucci_Guilty.jpg', 'Gucci Guilty Cologne Intense 75ML', '<p>Gucci Guilty Cologne by Gucci, Dare to be bold and different with guilty for men, introduced by the house of gucci in 2011 . This delightfully daring and intoxicating fragrance was designed to be a companion for the popular 2010 female edition of guilty. Created specifically for the man who knows exactly what he wants and just how to get it..., this intriguing masculine fragrance combines top notes of lemon and lavender with middle notes of warm orange blossom. Mysterious and seductive hints of musk and cedar make up the closing base notes of the fragrance. All products are original, authentic name brands. We do not sell knockoffs or imitations.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 02:11:21', 1, 0, '2016-11-09 01:54:23'),
(717, 0, 75, 16, 0, 'PRO-717', 'Clinique-Happy-Womens-Eau-de-Parfum-100 ml', 'Clinique-Happy-Womens-.jpg', 'Clinique-Happy-Womens-Eau-de-Parfum-100 ml', '<p>Layer your natural scent with a few sprays of Clinique Happy, an everyday women&#39;s fragrance that lifts your spirits and helps you express your feminine side. Perfect for beautiful spring and summer days, this eau de parfum spray emits a gentle mist that lightly covers your skin and leaves a lovely fragrance behind without overpowering. Rely on Clinique Happy to keep you smelling great throughout the day.<br />\r\n<br />\r\nSpray on Clinique Happy before heading to the beach or out to lunch with friends. Sweet citrus tones and deep floral notes combine to create a scent that&#39;s perfect for casual wear.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Created by the Clinique design house</li>\r\n	<li>Fragrance launched in 1997</li>\r\n	<li>Women&#39;s eau de parfum spray comes in 1-ounce bottle</li>\r\n	<li>Fragrance is a blend of a floral and citrus notes, making it perfect for daytime wear</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 06:11:25', 1, 0, '2016-11-09 01:54:23'),
(718, 0, 75, 17, 0, 'PRO-718', 'Clinique happy heart for women 100ml ', '202-500x500.jpg', 'Clinique happy heart for women 100ml ', '<p>Happy Heart Perfume by Clinique Explore your playful side with Happy Heart by Clinique. This lovely scent mixes sandalwood, mandarin and cucumber for a green and fresh fragrance that will add joy to your day. This women&#39;s scent is perfect for casual occasions, whether you&#39;re walking the dogs or heading to the grocery store to pick up supplies. Spritz it on your skin before leaving the house for a delicate, balanced scent that will bring smiles to everyone you meet.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 06:11:22', 1, 0, '2016-11-09 01:54:23'),
(719, 0, 75, 18, 0, 'PRO-719', 'Chloé eau de parfum 100 ml for women ', '000015194.jpg', 'Chloé eau de parfum 100 ml for women \r\n', '<p>Chlo&eacute; eau de parfum captures the confident individuality of a free spirited woman.</p>\r\n\r\n<p>Warm amber, honey and cedarwood notes are blended with the overpowering aroma of roses to created this luxurious and feminine scent. Housed in a vintage iconic glass bottle with a silver plated collar.</p>\r\n\r\n<ul>\r\n	<li><strong>Top notes:</strong>&nbsp;Freesia, lychee, peony</li>\r\n	<li><strong>Heart notes:</strong>&nbsp;Lily-of-the-valley, magnolia, rose</li>\r\n	<li><strong>Base notes:</strong>&nbsp;Amber, cedar</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 06:11:53', 1, 0, '2016-11-09 01:54:23'),
(720, 0, 75, 19, 0, 'PRO-720', 'Daisy Marc Jacobs for women 100 ml ', 'nd_1361.jpg', 'Daisy Marc Jacobs for women 100 ml \r\n', '<p><strong>Daisy</strong>&nbsp;is a sparkly floral-woody fragrance, fresh and feminine at the same time. It is devoted to a sophisticated, seductive, and dazzling woman, which at the same time strives to simplicity. It is captured in a lovely bottle decorated with&nbsp;<strong>daisy</strong>&nbsp;flowers on the top. Creator of this fragrance is&nbsp;<a href="http://www.fragrantica.com/noses/Alberto_Morillas.html" target="_blank"><strong>Alberto Morillas</strong></a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Charming&nbsp;<strong>Daisy</strong>&nbsp;fragrance caresses with the fruity strawberry notes, intensive green aroma of violet leaf and sparkling spicy pink grapefruit. Its heart beats in floral rhythm, composed of silky and intoxicating gardenia, delicate violet, and jasmine petals. The powdery soft dry down is composed of white woods, vanilla and musk.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-07 06:11:03', 1, 0, '2016-11-09 01:54:23'),
(721, 0, 29, 0, 0, 'PRO-721', 'HTC One M9E Smartphone', '10292015104707AM_635_htc_one_m9e.jpg', '', '<p>HTC One M9e smartphone was launched in October 2015. The phone comes with a 5.00-inch touchscreen display with a resolution of 1080 pixels by 1920 pixels.</p>\r\n\r\n<p>The HTC One M9e is powered by 2.2GHz octa-core MediaTek MT6795T processor and it comes with 2GB of RAM.</p>\r\n\r\n<p>The phone packs 16GB of internal storage that can be expanded up to 2000GB via a microSD card. As far as the cameras are concerned, the HTC One M9e packs a 13-megapixel primary camera on the rear and a 0-megapixel front shooter for selfies.</p>\r\n\r\n<p>The HTC One M9e runs Android 5.0 and is powered by a 2840mAh non removable battery. It measures 144.60 x 69.70 x 9.61 (height x width x thickness) and weighs 157.00 grams.</p>\r\n\r\n<p>The HTC One M9e is a single SIM (GSM) smartphone that accepts a Nano-SIM. Connectivity options include Wi-Fi, GPS, Bluetooth, NFC, Infrared, FM, 3G and 4G. Sensors on the phone include Compass Magnetometer, Proximity sensor, Accelerometer, Ambient light sensor and Gyroscope.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 07:11:11', 1, 0, '2016-11-08 02:23:11'),
(722, 0, 29, 0, 0, 'PRO-722', 'Sony''s Xperia Z5 Premium- Silver', 'Xperia-Z5-Premium-SO-03H_1-640x688.jpg', 'Sony''s Xperia Z5 Premium- Silver', '<p>Sony&#39;s Xperia Z5 premium is the flagship phone Sony has owed us for a long time. While the standard Z5 was a fairly uninspiring reissue of the brilliant Z3, the Z5 Premium packs a bigger screen with a whopping 4K resolution, which is 3,840x2,160 pixels. It&#39;s the first phone to have a 4K resolution and it&#39;s the highest resolution I&#39;ve ever seen on a phone.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 07:11:49', 1, 0, '2016-11-08 02:27:49'),
(723, 0, 29, 0, 0, 'PRO-723', 'Sony Xperia Z5 White Color', 'Sony-Xperia-Z5-Compact.jpg', 'Sony Xperia Z5 White Color', '<p>The Sony Xperia Z5 Compact has just broken cover and it&#39;s quite the rarity in today&#39;s world of supersized smartphones: it is a small-screen, compact and easily pocketable phone that does not make a compromise in terms of specs and ships with the latest and most powerful system chip out there.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 08:11:18', 1, 0, '2016-11-08 02:33:18'),
(724, 0, 29, 0, 0, 'PRO-724', ' Huawei Nexus 6P 64GB', 'Huawei_nexus_6p_64gb.png', '', '<p>All-metal design Unlocked, LTE smartphone with a powerful 2GHz Snapdragon 810 V2.1 Processor and the newest Android software, Android 6.0 marshmallow....</p>\r\n\r\n<p><br />\r\n&bull; A 5.7-Inch, high-resolution WQHD AMOLED display and front-facing stereo speakers to experience your photos and videos in cinematic Quality.<br />\r\n&bull; The powerful 12 MP Camera was built to capture your world in true-to-life detail. Larger 1.55 &micro;M pixels absorb more light&sup1; in even the dimmest conditions to make your photos Brighter.<br />\r\n&bull; Quicker access and more security with a fingerprint sensor placed on the back to complement the way you naturally hold your Phone.<br />\r\n&bull; Long lasting 3,450 mAh battery with quick charging USB Type-C plug. it&#39;s reversible, so there&#39;s no more guessing which way is up.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 08:11:47', 1, 0, '2016-11-08 02:35:47'),
(725, 0, 75, 20, 0, 'PRO-725', 'Marc Jacobs Daisy Dream Eau De Toilette for women', 'daisy_dream.jpg', '', '<p>Inspired by the boundless spirit of daisies and blue sky, Daisy Dream is marc&rsquo;s newest dream girl--ethereal, innocent and free.<br />\r\n<br />\r\nChanneling daisy&rsquo;s easy charm and reverie, Daisy Dream embodies a new take on being youthful, spirited and romantic. Daisy Dream reflects marc&rsquo;s irresistible mix of intricate details, elegance and femininity for a fresh interpretation of the iconic daisy motif.<br />\r\nLight and airy, Daisy Dream is both floral and fruity. The fragrance captivates with delectable top notes of blackberry, fresh grapefruit and succulent pear. The heart imparts a rich, feminine jasmine, notes of lychee and blue wisteria. A dreamy drydown of white woods, musks and coconut water.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 08:11:45', 1, 0, '2016-11-09 01:54:23'),
(726, 0, 75, 21, 0, 'PRO-726', 'Daisy Eau So Fresh Marc Jacobs for women', 'PRFM-193907.jpg', 'Daisy Eau So Fresh by Marc Jacobs is a Floral Fruity fragrance for women. Daisy Eau So Fresh was launched in 2011. Top notes are grapefruit, green notes, raspberry and pear; middle notes are jasmine, rose, violet, litchi and apple blossom; base notes are ', '<h1>Daisy Eau So Fresh by Marc Jacobs is a Floral Fruity fragrance for women. Daisy Eau So Fresh was launched in 2011. Top notes are grapefruit, green notes, raspberry and pear; middle notes are jasmine, rose, violet, litchi and apple blossom; base notes are musk, virginia cedar and plum.</h1>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 08:11:15', 1, 0, '2016-11-09 01:54:23'),
(727, 0, 74, 22, 0, 'PRO-727', 'Fahrenheit EDT by Dior for men', 'dior_by_fahrenheit_perfume_for_men.jpg', 'This exquisite perfume artfully blends the scents of lavender, mandarin orange, and nutmeg flower, creating a floral aroma. With hints of violet leaf and jasmine, the house of Dior has created a Woody FLoral Musk fragrance.', '<h1>This exquisite perfume artfully blends the scents of lavender, mandarin orange, and nutmeg flower, creating a floral aroma. With hints of violet leaf and jasmine, the house of Dior has created a Woody FLoral Musk fragrance.</h1>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-08 08:11:49', 1, 0, '2016-11-09 01:54:23'),
(728, 0, 29, 0, 0, 'PRO-728', 'Lenovo A2010 series', 'Lenovo_2010_white.jpg', '', '<ul>\r\n	<li>The&nbsp;<strong>a2010</strong>&nbsp;Mobile Phone is manufactured by Lenovo and was added around September 2016 and is part of the Lenovo A2010 series.</li>\r\n	<li>This version of the Mobile Phone comes in Color : White , Capacity : 8 GB , Band : LTE , Display Size : 4.5 Inch , Sim Cards Slots : Single Sim , Special Features : Touch Screen , Special Features : External Memory Card , Device RAM : 1 GB.</li>\r\n	<li>The model comes in 13 other variations including combination of LTE Band , 8 GB Capacity , Black, White Color , 1 GB Device RAM , 4.5 Inch Display Size , 1 GHZ Processor Speed GHZ , Single Sim, Dual Sim Cards Slots , Touch Screen, External Memory Card Special Features.</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 06:11:57', 1, 0, '2016-11-09 01:27:57'),
(729, 0, 29, 0, 0, 'PRO-729', 'Lenovo A1000 Smartphone', 'Lenovo_A1000.jpg', 'Lenovo A1000 smartphone was launched in October 2015. The phone comes with a 4.00-inch touchscreen display with a resolution of 480 pixels by 800 pixels.', '<p>Lenovo A1000 smartphone was launched in October 2015. The phone comes with a 4.00-inch touchscreen display with a resolution of 480 pixels by 800 pixels.<br />\r\n<br />\r\nThe Lenovo A1000 is powered by 1.3GHz quad-core Spreadtrum SC7731 processor and it comes with 1GB of RAM. The phone packs 8GB of internal storage that can be expanded up to 32GB via a microSD card. As far as the cameras are concerned, the Lenovo A1000 packs a 5-megapixel primary camera on the rear and a 0.3-megapixel front shooter for selfies.<br />\r\n<br />\r\nThe Lenovo A1000 runs Android 5.0 and is powered by a 2000mAh removable battery. It measures 124.50 x 64.00 x 10.60 (height x width x thickness) and weighs 132.00 grams.<br />\r\n<br />\r\nThe Lenovo A1000 is a dual SIM (GSM and GSM) smartphone that accepts Regular and Regular. Connectivity options include Wi-Fi, GPS, Bluetooth, FM and 3G. Sensors on the phone include Accelerometer.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 07:11:39', 1, 0, '2016-11-09 01:31:39'),
(730, 0, 29, 0, 0, 'PRO-730', 'LENOVO A2020- Smart Phone', 'Lenovo_A2020_BLACK.jpg', '', '<ul>\r\n	<li>\r\n	<h2>The A<strong>2020</strong>&nbsp;Mobile Phone is manufactured by Lenovo and was added around September 2016 and is part of the Lenovo A2020 series.</h2>\r\n	</li>\r\n	<li>\r\n	<h2>This version of the Mobile Phone comes in Color : Black , Capacity : 16 GB , Band : LTE , Display Size : 5 Inch , Sim Cards Slots : Single Sim , Special Features : Touch Screen , Special Features : External Memory Card , Device RAM : 1 GB.</h2>\r\n	</li>\r\n	<li>\r\n	<h2>The model comes in 12 other variations including combination of LTE Band , 16 GB Capacity , Black, White Color , 1 GB Device RAM , 5 Inch Display Size , Single Sim, Dual Sim Cards Slots , Touch Screen, External Memory Card Special Features.</h2>\r\n	</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 07:11:51', 1, 0, '2016-11-09 01:36:51'),
(731, 0, 29, 0, 0, 'PRO-731', 'LENOVO VIBE K5 PLUS 6020', 'Vibe_k5_plus_6020.jpg', 'LENOVO VIBE K5 PLUS 6020', '<p>Finally Lenovo has come back with a stunning smartphone that is known as Lenovo K5 Plus while featuring some amazing qualities and advanced hardware. The smart phone is geared up with quality hardware and alluring design which will give more grace to your personality. Lenovo K5 Plus acquired Qualcomm Snapdragon 1.5 GHz Octa core processor for fast processing in no time, comprised with&nbsp;2 GB RAM and 16 GB of ROM that is good combination for storage and 2GB is much enough for fast&nbsp;communication with processor. Lenovo K5 Plus has 5.0&Prime; elegant Full HD display of (1080 x 1920) resolution. Hence the features of this smartphone completes with 13 MP AF rear camera and support of LED flash for low light areas and 5 MP Fixed Focus front camera. The smartphone is capable of supporting 4G/LTE network. Lenovo K5 Plus is packed up with 2750 mAh battery which is&nbsp;huge battery capacity for nonstop 3G/4G browsing.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 07:11:48', 1, 0, '2016-11-09 01:40:48'),
(732, 0, 29, 0, 0, 'PRO-732', 'Lenovo A7010 Android Smartphone ', 'lenovo_a7010_black.jpg', 'Lenovo A7010 Android Smartphone running is Android Operating System version 5.1 serial of LollyPop.', '<p><strong>Lenovo A7010</strong><strong>&nbsp;Android Smartphone</strong><strong>&nbsp;running is Android Operating System version 5.1 serial of LollyPop</strong>. This device powerful&nbsp;MediatTek MT6735 chipset based on Cortex True 8Core, Octa-core 1.5 GHz Cortex A53 64 Bit processor. It provides the great experience with&nbsp;Mali T720MP3 graphic processor unit. The 2GB of RAM and 8GB of internal storage expandable memory micro SD card slot.&nbsp;Lenovo A7010 features 5.5 inches display touchscreen with IPS technology LCD. The device has a screen resolution of 1920 x 1080 pixels with multi touch and Sensor. Lenovo A7010 comes a 13 Mega pixels Camera with auto focus Geo-tagging, panorama, HDR and Make Batter Quality Videos and Images with LED Flash on Low light. The device make videos calling and videos shearing with 5MP front facing camera.&nbsp;Lenovo A7010 is Support a GSM Network, EDGE, GPRS, GPS, Bluetooth version of 4.0, micro USB version 2.1 with host, NFC Wi Fi, Dual Band with Hotspot. The device comes a multimedia features stereo Speakers, MP4, MP3 and Full HD Supported Player and Google Play, Facebook, Google+, twitter, HTML, FM radio, Image and video viewer and editor and Microsoft Office document viewer and editor, SMS, MMS, Emails, I mail, Push mail and threading view Text input. This phone is a Li-po 3300 mAh battery. It is provide the talk time about 23 hours and 9 hours videos watching, web browsing.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 07:11:24', 1, 0, '2016-11-09 01:44:24'),
(733, 0, 29, 0, 0, 'PRO-733', 'LENOVO P1M A40 ', 'Lenovo_Vibe_P1_M42_grey.jpg', 'Lenovo Vibe P1 smartphone was launched in September 2015. The phone comes with a 5.50-inch touchscreen display with a resolution of 1080 pixels by 1920 pixels   \r\n', '<p>Lenovo Vibe P1 smartphone was launched in September 2015. The phone comes with a 5.50-inch touchscreen display with a resolution of 1080 pixels by 1920 pixels&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><br />\r\nThe Lenovo Vibe P1 is powered by 1.5GHz octa-core Qualcomm Snapdragon 615 processor and it comes with 2GB of RAM. The phone packs 32GB of internal storage that can be expanded up to 128GB via a microSD card. As far as the cameras are concerned, the Lenovo Vibe P1 packs a 13-megapixel primary camera on the rear and a 5-megapixel front shooter for selfies.&nbsp;</p>\r\n\r\n<p>The Lenovo Vibe P1 runs Android 5.0 and is powered by a 4900mAh non removable battery. It measures 152.90 x 75.60 x 9.90 (height x width x thickness) and weighs 189.00 grams.&nbsp;&nbsp;&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-09 07:11:14', 1, 0, '2016-11-09 01:49:14'),
(734, 0, 56, 0, 0, 'PRO-734', 'Lenovo B 5080 (Core i3 (5th Gen)/4 GB DDR3/1 TB/39.62 cm (15.6)/DOS) (Black)', 'lenovo_1.jpg', 'Lenovo B5080 (80EW052YIH) (Core i3 (5th Gen)/4 GB DDR3/ 1 TB/39.62 cm (15.6)/DOS) (Black)', '<p>&nbsp;</p>\r\n\r\n<p>Model B50-80 Style Attributes Dimensions(WxHxD) 380 x 262 x 24.7 mm Colors Black Weight 2.2 Kg Display Features:HD LED Backlit TN Anti-glare Flat Display Display Resolution 1366 x 768 Pixels Display Size 15.6 Inches Display Type LED Processor 5th Gen.Intel Core i3-5005U Processor Variant 5005U Clock-speed 2.0 Ghz Graphic Processor Intel HD 5500 Memory:Expandable Memory 16 GB Memory Slots 2 DIMM RAM :4 GB DDR3 RAM speed 1600 Mhz HDD Capacity 1 TB HDD type SATA HDD Speed(RPM) 5400 RPM OS DOS Type 64 Battery type Li-Ion Battery Life 4.5 Hrs Power Supply 45 W AC Adapter W Networking Ethernet Ports(Numbers) 1 Ethernet type 10/100 Mbps Wireless LAN 802.11 a/b/g/n/ac Bluetooth Yes Bluetooth Version 4.0 USB 2.0 slots 1 USB 3.0 slots 2 HDMI 1 Digital Media Reader Yes Web-cam Yes Secondary cam(Rear-facing) No Headphone Jack Yes Microphone Jack Yes VGA Port Yes Other Networking Options 4-in-1 Card Reader Audio Solution HD Audio Solution Speakers 2 x 1.5W speakers In-built Microphone Yes Sound Technologies Dolby Audio Sound Peripherals Optical Drive CD/DVD writer Drive Type CD Writer Rate 8x CD/DVD writer Optical Drive Read &amp; Write speed 8x Pointing device Touchpad with Multi-touch Gestures Support Keyboard AccuType Keyboard Fingerprint scanner</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 08:11:43', 1, 0, '2016-11-14 14:48:07'),
(735, 0, 75, 0, 0, 'PRO-735', 'Giorgio Armani Si for women', 'Giorgio-Armani-SI.jpg', 'Sì is a tribute to modern femininity, an irresistible combination of grace, strength, and independent spirit. A modern chypre reinvented, Sì opens with deep blackcurrant nectar that softly recedes to airy floral. A base of musky blond wood adds lightness ', '<p>DESCRIPTION</p>\r\n\r\n<p>Indulge in the modern elegance of Giorgio Armani Si, a timeless Eau de Parfum for compelling women. Inspired by the classic chypre fragrances worn by his mother, Giorgio Armani&rsquo;s Si exudes strength and modernity, bound together by endlessly fascinating notes. Inviting and chic, it is the epitome of unforgettable Armani style.</p>\r\n\r\n<p><strong>PRODUCT FEATURES :</strong></p>\r\n\r\n<ul>\r\n	<li>Fragrance Family : Chypre</li>\r\n	<li>Top Notes are Sicilian Bergamot, Mandarin Oil and Liquer de Cassis</li>\r\n	<li>Middle Notes are Rose de Mai Absolute, Neroli Absolute and Egyptian Jasmine Absolute</li>\r\n	<li>Base Notes are Patchouli Oil, Blond Woods, Amber, Orcanox and Vanille Absolute</li>\r\n	<li>Eau de Parfum</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 08:11:29', 1, 0, '2016-11-14 14:51:29'),
(736, 0, 29, 0, 0, 'PRO-736', 'Galaxy J1 ace 3G White and Black', 'Galaxy_J1_ace_3G_BLACK.png', 'Samsung Galaxy J1 Ace smartphone was launched in September 2015. The phone comes with a 4.30-inch touchscreen display with a resolution of 480 pixels by 800 pixels.', '<p>Samsung Galaxy J1 Ace smartphone was launched in September 2015. The phone comes with a 4.30-inch touchscreen display with a resolution of 480 pixels by 800 pixels.<br />\r\n<br />\r\nThe Samsung Galaxy J1 Ace is powered by 1.3GHz dual-core it comes with 512MB of RAM. The phone packs 4GB of internal storage that can be expanded up to 128GB via a micro SD card. As far as the cameras are concerned, the Samsung Galaxy J1 Ace packs a 5-megapixel primary camera on the rear and a 2-megapixel front shooter for selfies.<br />\r\n<br />\r\nThe Samsung Galaxy J1 Ace runs Android 4.4 and is powered by a 1800mAh removable battery. It measures 130.10 x 67.60 x 9.50 (height x width x thickness) .<br />\r\n<br />\r\nThe Samsung Galaxy J1 Ace is a dual SIM (GSM and GSM) smartphone that accepts Micro-SIM and Micro-SIM. Connectivity options include Wi-Fi, GPS, Bluetooth, FM and 3G. Sensors on the phone include Proximity sensor, Accelerometer, Ambient light sensor and Gyroscope.</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2016-11-14 08:11:11', 1, 0, '2016-12-11 17:44:02'),
(737, 0, 29, 0, 0, 'PRO-737', 'Lenovo A319 WHITE AND BLACK', 'Lenovo_A319_BLACK.jpg', 'Lenovo A319 is a also known as Lenovo RocStar, 4inch(480 x 800)of display, 4GB of memory, Dual-core 1.3 GHz Cortex-A7 of processor speed.', '<p>Lenovo A319 is a also known as Lenovo RocStar, 4inch(480 x 800)of display, 4GB of memory, Dual-core 1.3 GHz Cortex-A7 of processor speed.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 08:11:29', 1, 0, '2016-11-14 15:10:29'),
(738, 0, 29, 0, 0, 'PRO-738', ' Lenovo K920 BLACK', 'Lenovo_K920_BLACK.jpg', '', '<h2><strong>Features&nbsp;</strong></h2>\r\n\r\n<ul>\r\n	<li>6-Inch 2560x1440(2K) Quad HD Display 491 PPI</li>\r\n	<li>Snapdragon 801 Quad Core 2.5GHz</li>\r\n	<li>Adreno 330 GPU</li>\r\n	<li>3GB RAM+32GB ROM</li>\r\n	<li>4G-LTE:TDD-LTE（B38/B39/B40),FDD-LTE(B3/B7)</li>\r\n	<li>Camera:16-megapixel,Front camera:5-megapixel</li>\r\n	<li>4000mAh</li>\r\n	<li>3G(WCDMA)WCDMA：2100MHz/1900MHz/850MZ</li>\r\n	<li>WiFi,NFC,OTG,Gravity Sensor,Light sensors,Proximity sensors,Gyro:Support</li>\r\n	<li>USB 2.0 Bluetooth 4.0</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 08:11:42', 1, 0, '2016-11-14 15:15:42'),
(739, 0, 29, 0, 0, 'PRO-739', ' LENOVO X2 RED COLOR', 'Lenovo_X2_RED.jpg', '', '<p>Lenovo has launched it&rsquo;s mid-range smartphone in the company&rsquo;s Vibe series, called it the Lenovo Vibe X2 in India. Announced back in September at the IFA 2014 event in Berlin and the phone has went on sale exclusively on e-commerce marketplace Flipkart starting November 10. According to the latest news report, the Vibe X2 on</p>\r\n\r\n<p>Flipkart sold out in just 2 days of its official release.</p>\r\n\r\n<p>About the smartphone, it got a &lsquo;multi-layered&rsquo; design with its edges giving the inspiration of different colored layers stacked together. The phone however comes with 7.27mm thin and will be available to buy in White, Red, Gold and Dark Grey colors.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 08:11:41', 1, 0, '2016-11-14 15:23:41'),
(740, 0, 29, 0, 0, 'PRO-740', 'Lenovo S850 BLUE', 'Lenovo_S850_BLUE.jpg', '', '<p>Lenovo S850 Dark Blue 16GB is a stylish, elegant android phone with its all glass exterior. Its wide- view HD screen with in-plane switching technology, quad core processor, and an excellent camera makes it the most desirable gadget in the market. This light weight (140g<a href="https://www.snapdeal.com/brand/lenovo/mobiles-mobile-phones" target="_blank">) Lenovo mobile</a>&nbsp;is a dual sim, touch screen 3G phone. It has premium apps like SHAREit for easy file transfer, Snapit camera app for enhancing picture perfectness and SYNCit app for restoring contacts and other data on your phone. The sensors used in this phone are &ndash; Gravitation Sensor, Proximity Sensor, and Light Sensor. Buy this sleek phone online at Snapdeal mobile store and boosts your personality.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-14 09:11:53', 1, 0, '2016-11-14 15:31:53'),
(741, 0, 75, 0, 0, 'PRO-741', 'Prada Candy by Prada EDP ', 'prada_candy.jpg', 'Prada Candy is instantly seductive, pure pleasure wrapped in impulsive charm. In an explosion of shocking pink and gold, Prada Candy takes you on a walk on the wild side, showing off a new facet of Prada femininity where more is more and excess is everyth', '<h2>Prada Candy is instantly seductive, pure pleasure wrapped in impulsive charm. In an explosion of shocking pink and gold, Prada Candy takes you on a walk on the wild side, showing off a new facet of Prada femininity where more is more and excess is everything.</h2>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-17 08:11:46', 1, 0, '2016-11-17 16:22:50'),
(742, 0, 29, 0, 0, 'PRO-742', 'Samsung Galaxy A7 (2016)', 'Samsung-Galaxy-A7-White.jpg', 'Samsung Galaxy A7 (2016) White', '<p>The Korean manufacturer Samsung has often been infamously known for its use of plastic material which although is undeniably durable and long lasting is now making a come back with some premium produced phones at middling costs aimed at younger folks who are more driven by trending appearance and phone fads. The birth of the Galaxy A series is what stands on this promise. If big is your thing, the Samsung Galaxy A7 (2016) launched late last year, has larger than life features such as a satisfying 5.5 inch Super AMOLED display of 1920 x 1080 pixel resolution. It is powered by a 1.6GHz octa-core processor with 3GB of RAM and 16GB storage and runs Android 5.1.1. Those who mourned the absence of the MicroSD card slot feature in the previous Samsung Galaxy S6 will happily greet this feature as the first to exist in Samsung&rsquo;s glass phones of up to 128GB external storage. The masterpiece, beautifully layered with Gorilla Glass 4 on both sides along with its metal materials make both a sturdy and stylish handpiece. Weighing in at 172g, the device surely feels convincingly heavier and not necessarily a bad thing if you look back at the original A series phone which seem to appear considerably cheap due to the lightweight and lean panel on the back.</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-17 10:11:11', 1, 0, '2016-12-12 09:14:42'),
(743, 0, 93, 0, 0, 'PRO-743', 'Set of 5 pcs Toothbrush Style Eyebrow Brush Foundation Eyeliner Makeup', '12345.jpg', 'Set of 5 pcs Toothbrush Style Eyebrow Brush Foundation Eyeliner Makeup Brushes (Rose-golden) + 1 pcs Cleaning Makeup Brush egg (Pink)', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>2016 Latest fashion Toothbrush design, Gorgeous rose golden+black brush handle. No paint off NO irritate.</li>\r\n	<li>5PC/Set Toothbrush Eyebrow Foundation Eyeliner Lip Oval Brushes cover basic needs of application</li>\r\n	<li>Silky soft and dense brushes help to smear evenly without leaving traces.</li>\r\n	<li>Package included: 5pcs toothbrush makeup brushes + 1pcs Makeup brush egg</li>\r\n	<li>BeautyKate is a registered trademark and Youlun is the authorized seller of BeautyKate branded products</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-21 08:11:53', 1, 0, '2016-11-21 15:20:38'),
(744, 0, 93, 0, 0, 'PRO-744', 'Coastal Scents Eye Shadows, Revealed Smoky', '51LME6yre4L.jpg', 'Twenty Exquisite Eye Shadows\r\nConvenient Portable Palette\r\nCreate Infinite Smoky Looks', '<p>DESCRIPTION</p>\r\n\r\n<p>The Revealed Smoky palette features twenty sultry, smoldering eye shadows, in a stunning variety of hues and textures. Where there&#39;s smoke, there&#39;s fire!</p>\r\n\r\n<p><strong>Product Features:</strong></p>\r\n\r\n<ul>\r\n	<li>An incredible variety of colours and textures</li>\r\n	<li>Revitalize and highlight your eyes</li>\r\n	<li>Blendable</li>\r\n	<li>Long-lasting</li>\r\n	<li>Color/Shade: Revealed Smoky</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-21 08:11:31', 1, 0, '2017-03-06 18:18:18'),
(745, 0, 75, 0, 0, 'PRO-745', 'Juicy Couture Malibu Juicy Couture EDT', 'o_27043.jpg', '', '<p>Juicy Couture Malibu reflects the free-spirited California attitude and embraces the glamorous and confident essence of L.A. Whimsical pink passion fruit merges with fresh jasmine and musk, creating a radiant and enticing fragrance that captures the casual glamour of Los Angeles. Available as ...</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-21 08:11:19', 1, 0, '2016-11-21 15:31:06'),
(746, 0, 75, 0, 0, 'PRO-746', 'Juicy Couture Malibu Juicy Couture EDT', 'o_27043.jpg', '', '<p>Juicy Couture Malibu reflects the free-spirited California attitude and embraces the glamorous and confident essence of L.A. Whimsical pink passion fruit merges with fresh jasmine and musk, creating a radiant and enticing fragrance that captures the casual glamour of Los Angeles. Available as ...</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-21 08:11:21', 1, 0, '2016-11-21 15:29:21'),
(747, 0, 75, 0, 0, 'PRO-747', 'Viva La Juicy Gold Couture by Juicy Couture for Women - Eau de Parfum', 'jucvjgw_20_01__2.jpg', 'DESCRIPTION\r\nThis ""golden"" composition begins with luscious wild berries that form an introduction to the heart of Sambac jasmine and honeysuckle. The base features warm aromas of sandalwood, golden amber, caramel and vanilla elixir.', '<p>This &quot;&quot;golden&quot;&quot; composition begins with luscious wild berries that form an introduction to the heart of Sambac jasmine and honeysuckle. The base features warm aromas of sandalwood, golden amber, caramel and vanilla elixir</p>\r\n\r\n<p>notes:Top Notes: Wild berries Middle Notes: Jasmine Sambac, Honeysuckle Base Notes: Sandalwood, Amber, Caramel, Vanilla</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-21 09:11:37', 1, 0, '2016-11-21 16:04:37'),
(748, 0, 75, 0, 0, 'PRO-748', ' Juicy Couture Perfume EDP for Women', 'Juicy_Court.jpg', ' Juicy Couture Perfume is a lovely floral fruity fragrance designed by Harry Fremont for the eponymous brand. It was launched in 2006 and became an instant hit with both the American audience and the critics who awarded it with the industry''s top honor', '<p>Juicy Couture Perfume by Juicy Couture 1.7oz Eau De Parfum spray for Women.&nbsp;<strong>Juicy Couture Perfume</strong>&nbsp;is a lovely floral fruity fragrance designed by&nbsp;<a href="http://www.perfumeblvd.com/index.php?main_page=advanced_search_result&amp;search_in_description=1&amp;keyword=Harry+Fremont" target="_blank">Harry Fremont</a>&nbsp;for the eponymous brand. It was launched in 2006 and became an instant hit with both the American audience and the critics who awarded it with the industry&#39;s top honor - The FiFi Fragrance of the Year 2006. Europe followed suit very quickly. The top notes reveal pleasant freshness of watermelon, mandarin, pink passion fruit, green leaves, water hyacinth and marigold flowers. The heart brings with it charming notes of tuberose, lily, and wild rose, while the base unites notes of caramels, powdery vanilla, creme brulee, patchouli and woods. The fragrance is truly multifaceted - light yet not naive, fresh but not in the just-got-out-of the-shower way and sexy without being too suggestive. It seems like Juicy Couture is telling us a few stories (or, in step with this brand&#39;s tradition, fairytales) at the same time.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 05:11:26', 1, 0, '2016-11-22 00:11:26'),
(749, 0, 75, 0, 0, 'PRO-749', 'Viva La Juicy by Juicy Couture for Women - EDP', '1037_viva_la_juicy_l.jpg', 'The Viva la Juicy girl never turns down a glass of champagne or the chance to get into the tiniest bit of trouble. Viva la Juicy combines delicious wild berries, with creamy vanilla and bright jasmine.', '<p>DESCRIPTION</p>\r\n\r\n<p>Juicy Couture Viva La Juicy for Women is yet another mesmerizing perfume from the fabulous collection of Juicy Couture perfumes. It is a lovely fruity, floral, and woody fragrance that is extremely light and airy. This fragrance is made for a woman who is charming, sexy, and confident. This scent was created by the renowned perfumer Honorine Blanc, and comes in a gorgeous 100ml glass flacon with an elegantly designed nozzle. It has a fuchsia color ribbon that adds elegance to the overall appearance of the bottle. Its enchantingly light aroma makes it perfect for daily use, whether it is in the office or when out shopping.</p>\r\n\r\n<p><strong>PERFUME NOTES</strong></p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>TOP NOTES</p>\r\n\r\n<p>The fragrance begins with a wave of wild berries and juicy mandarin, which takes one back to serene wilderness and nature.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>MIDDLE NOTES</p>\r\n\r\n<p>At the heart is the floral blend of honeysuckle, gardenia, and jasmine, which make you feel energized and rejuvenated.</p>\r\n\r\n<p><img alt="" src="http://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" /></p>\r\n\r\n<p>BASE NOTES</p>\r\n\r\n<p>The base features gourmet rhapsody of amber, caramel, vanilla, sandalwood and pralines.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 05:11:27', 1, 0, '2016-11-22 00:18:27'),
(750, 0, 75, 0, 0, 'PRO-750', 'Viva La Juicy Noir by Juicy Couture for Women EDP', 'viva_la_juicy_noir.jpg', 'The new fragrance from Viva la Juicy. Bold. Sensual. Arresting. An enticing rendition of the original best-selling fragrance, Viva la Juicy Noir embodies the woman who is dangerous in a good way. She likes her eyes smoky and her lips rouge. Unapologetic, ', '<p>Viva la Juicy Noir highlights the succulent ripe berry notes and gourmand accents, while adding a juicy touch of honeysuckle and a sultry hint of sandalwood. Leave a lasting impression with Viva la Juicy Noir.</p>\r\n\r\n<p>DESCRIPTION</p>\r\n\r\n<p>An expression of fun and mischief, the Juicy Couture Viva La Juicy Noir for Women is a tantalizing perfume for a woman who takes risks and gets rewarded. The mesmerizing scent embodies the spirit of a woman who is dangerous in a good way, a woman with smoky eyes and rouge lips. The perfume adds a lavish twist to Viva la Juicy girl fragrance by Juicy Couture. Created for the in vogue woman, the Juicy Couture Viva La Juicy Noir for Women is an intensely fruity perfume that leaves a lasting impression. Its top notes consist of a fruity blend of juiciest berries and mandarin. The perfume has flowery middle notes of honeysuckle, gardenia, and jasmine. The base has intense aromas of amber, caramel, vanilla, and sandalwood. The fragrance is packaged in a gorgeous 50ml pink colored glass bottle with a lovely black satin bow&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 06:11:08', 1, 0, '2016-11-22 00:32:53'),
(751, 0, 75, 0, 0, 'PRO-751', 'VIVA LA JUICY ROSÉ for Girls', 'o_35938.jpg', 'Celebrate the season with viva la juicy rose, a light-hearted toast to the forever vibrant viva girls.', '<p>Sparkling. Charming. Exuberant. Celebrate the season with Viva la Juicy Ros&eacute;, a light-hearted toast to the forever vibrant Viva girl. Dressed in sparkling pink, she experiences the world through Ros&eacute; colored glasses. This effervescent fragrance pops with fizzy citrus perfection. It sparkles in a dew of Jasmine and Rose honey-like blossoms for a dreamy scent that is kissed by the glow of sensual Amber. Cheers! Unfortunately products deemed unsafe to travel by air are unable to be expedited.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 06:11:52', 1, 0, '2016-11-22 00:41:52'),
(752, 0, 93, 0, 0, 'PRO-752', 'Too Faced Christmas Miracles (Bronzer, Lipstick, Mascara) 3-pc Set', '51KN-ojVUSL.jpg', '', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>Duluxe Chololate soleil Matte Bronzer mat 2.5g/0.08oz</li>\r\n	<li>Deluxe melted Liquified Long wear lipstick-Melted Candy 5ml/0.16 fl oz</li>\r\n	<li>Deluxe better than sex mascara 4.8g/0.17oz</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 06:11:34', 1, 0, '2017-03-06 18:18:21'),
(753, 0, 93, 0, 0, 'PRO-753', 'Too Faced Most Loved Set', 'SL1500.jpg', '', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>A set of five innovative, deluxe-sized, makeup essentials in one kit.</li>\r\n	<li>0.16 oz Hangover Replenishing Face Primer - 0.17 oz Shadow Insurance Eye Shadow Primer - 0.08 oz Chocolate Soleil Matte Bronzer - 0.16 oz Melted LongWear Lipstick in Melted Fig - 0.17 oz Better Than Sex Mascara</li>\r\n	<li>Most Loved Set features a curated collection of Too Faced&rsquo;s most innovative, must-have products&mdash;all in one deluxe-sized kit. It includes Hangover Replenishing Face Primer, infused with coconut water, probiotic-based ingredients, and additives to revive skin. Packed with collagens, Better Than Sex Mascara thickens, lengthens, and curls lashes for dramatic and extreme volume. Create a natural-looking tan with Chocolate Soleil Matte Bronzer, a matte bronzer that&rsquo;s infused with antioxidant-rich cocoa powder for an allover glow. Lock down eye shadow for crease-free, stay-put wear up to 24 hours with Shadow Insurance Eye Shadow Primer, and then comfortably coat lip in Melted Liquified Long Wear Lipstick for saturated, high-impact color that stays put.</li>\r\n	<li>What it is formulated WITHOUT: - Parabens - Sulfates - Phthalates</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 06:11:16', 1, 0, '2017-03-06 18:18:24'),
(754, 0, 93, 0, 0, 'PRO-754', 'Too Faced Totally Obsessed Set', '51scZmcB0aL.jpg', '', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>5-piece deluxe kit with bestselling, full-face essentials.</li>\r\n	<li>This set contains: - 0.17 oz Better Than Sex Mascara - 0.08 oz Chocolate Soleil Medium/Deep Matte Bronzer - 0.16 oz Melted Liquidfied Long Wear Lipstick in Chihuahua - 0.17 oz Shadow Insurance Anti-Crease Eye Shadow Primer - 0.16 oz Hangover Replenishing Face Primer</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 06:11:41', 1, 0, '2017-03-06 18:18:13'),
(755, 0, 93, 0, 0, 'PRO-755', 'Coastal Scents 88 Color Palette, Warm', 'Coastal_Scents_88_Color_Palette,_Warm.jpg', '88 matte, shimmer, smokey, and neutral shadows\r\nPlenty of highlight shades for below the brow line and inner eye\r\nGreat size for storing and traveling', '<p>88 matte, shimmer, smokey, and neutral shadows</p>\r\n\r\n<p>Plenty of highlight shades for below the brow line and inner eye</p>\r\n\r\n<p>Great size for storing and traveling</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 06:11:09', 1, 0, '2016-11-22 01:08:09'),
