(758, 0, 93, 0, 0, 'PRO-758', 'Coastal Scents 88 Color Palette, Metal Mania', 'Coastal_Scents_88_Color_Palette,_Metal_Mania.jpg', '88 satin shadows\r\nBeautiful metallic colors\r\nGreat size for storing and traveling', '<p>88 satin shadows</p>\r\n\r\n<p>Beautiful metallic colors</p>\r\n\r\n<p>Great size for storing and traveling</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 07:11:05', 1, 0, '2016-11-22 01:54:05'),
(759, 0, 93, 0, 0, 'PRO-759', 'Coastal Scents 88 Original Palette', '91n0xqNos9L__SL1500_.jpg', '88 matte and satin shadows with slight shimmer\r\nGreat size for storing and traveling\r\nHighly pigmented shadows', '<p>88 matte and satin shadows with slight shimmer</p>\r\n\r\n<p>Great size for storing and traveling</p>\r\n\r\n<p>Highly pigmented shadows</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-22 07:11:52', 1, 0, '2016-11-22 01:59:52');
