(760, 0, 93, 0, 0, 'PRO-760', 'Coastal Scents Beauty Collection Makeup Set, Smoky', '816jR7OmMJL__SL1500_.jpg', 'Shipping takes 10 to 14 days (calendar days)', '<p>package includes:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Beautifully pre packaged set</p>\r\n\r\n<p>Fifty seven eye shadows</p>\r\n\r\n<p>Five blush/bronzers</p>\r\n\r\n<p>Five brushes</p>\r\n\r\n<p>Case and six-step smoky eyes guide</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Founded in 2005, Coastal Scents emerged on the cosmetics scene, and is now recognized as a premier cosmetics brand. The best quality makeup, with the lowest price and the best customer service is was what made Coastal Scents stand out since more than a decade ago.</p>\r\n\r\n<p>Coastal Scents is a makeup and beauty brand owned by K-Plex LLC, with demographics of teenage girls to mid thirty-year-old woman. By providing more than 800 affordable beauty products, Coastal Scents is able to provide a complete selection, from eye shadows, mascara and blushes to concealers, makeup brushes, lipsticks &amp; more.</p>\r\n\r\n<p>Customer suggestions are welcome, we are geared to accommodating a priority customer demand.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Coastal Scents does not test products on animals and only support suppliers that do the same. All the products Coastal Scents carries are produced cruelty free and no animals are harmed. Even though some companies still test on animals, Coastal Scents believes that it is unnecessary and unethical.</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 07:11:54', 1, 0, '2017-03-06 18:18:08'),
(761, 0, 93, 0, 0, 'PRO-761', 'Coastal Scents Beauty Collection Makeup Set, Glamour', '81ecGfFUW5L__SL1500_.jpg', 'Founded in 2005, Coastal Scents emerged on the cosmetics scene, and is now recognized as a premier cosmetics brand. The best quality makeup, with the lowest price and the best customer service is was what made Coastal Scents stand out since more than a de', '<p>Beautifully pre packaged set</p>\r\n\r\n<p>Includes five pencil liners</p>\r\n\r\n<p>Includes five brushes</p>\r\n\r\n<p>Includes twenty eye shadows</p>\r\n\r\n<p>This set is a perfect gift</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Founded in 2005, Coastal Scents emerged on the cosmetics scene, and is now recognized as a premier cosmetics brand. The best quality makeup, with the lowest price and the best customer service is was what made Coastal Scents stand out since more than a decade ago.</p>\r\n\r\n<p>Coastal Scents is a makeup and beauty brand owned by K-Plex LLC, with demographics of teenage girls to mid thirty-year-old woman. By providing more than 800 affordable beauty products, Coastal Scents is able to provide a complete selection, from eye shadows, mascara and blushes to concealers, makeup brushes, lipsticks &amp; more.</p>\r\n\r\n<p>Customer suggestions are welcome, we are geared to accommodating a priority customer demand.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Coastal Scents does not test products on animals and only support suppliers that do the same. All the products Coastal Scents carries are produced cruelty free and no animals are harmed. Even though some companies still test on animals, Coastal Scents believes that it is unnecessary and unethical.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 07:11:11', 1, 0, '2017-03-06 18:18:10'),
(762, 0, 59, 0, 0, 'PRO-762', 'Coastal Scents Beauty Collection Makeup Set, Luxury ', '810VmYjhNyL__SL1500_.jpg', 'Shipping Period:  10 to 14 days ', '<p>Coastal Scents Beauty Collection Makeup Set, Luxury</p>\r\n\r\n<p>Beautifully pre packaged set</p>\r\n\r\n<p>Includes 88 eye shadows</p>\r\n\r\n<p>Includes 10 blush and bronzer shades</p>\r\n\r\n<p>Includes 22 brushes</p>\r\n\r\n<p>Includes brush carrying case</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2016-11-22 07:11:03', 1, 0, '2017-03-06 18:18:05'),
(763, 0, 75, 0, 0, 'PRO-763', 'Hugo Boss The Scent- EDP', 'Boss.jpg', 'This floralfruity fragrance is combined with thick gourmand shades making it an equivalent of the modern perfume scene. Gourmand trendy composition touched many designer collections suggesting that the focus lies on sophisticated sweetness.', '<p>After last year&rsquo;s BOSS THE SCENT, Hugo Boss presents BOSS THE SCENT FOR HER in June, 2016. Announced as an extremely seductive and luxurious scent, the aim of the new fragrance is to attract attention to the Hugo Boss fashion line for women launched in 2001, and which is now managed by the creative director Jason Wu. The floral-fruity fragrance is combined with thick gourmand shades making it an equivalent of the modern perfume scene. The gourmand trendy composition touched many designer collections suggesting that the focus lies on sophisticated sweetness.&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-29 09:11:10', 1, 0, '2016-11-29 04:05:10'),
(764, 0, 93, 0, 0, 'PRO-764', 'Lagure Cream Contour Kit', '1212.jpg', 'Best Contour Palette and Creamy Concealer with Smooth, Pigmented Cream - Step-by-Step Contour Guide Included\r\n ', '<p>Best Contour Palette and Creamy Concealer with Smooth, Pigmented Cream - Step-by-Step Contour Guide Included</p>\r\n\r\n<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>Lagure cream contour kit flawlessly defines your naturally beautiful features with a radiant glow</li>\r\n	<li>Our contour kit contains 6 smooth and easy-to-blend contour shades suitable for every skin tone</li>\r\n	<li>Each shade on our contour kit is made of cruelty-free, non-toxic cream safe for every skin type</li>\r\n	<li>Be a contour pro with our step-by-step user guide included on our travel friendly, magnetic palette</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-29 09:11:53', 1, 0, '2016-12-14 17:31:26'),
(765, 0, 93, 0, 0, 'PRO-765', 'Super Soft Oval Toothbrush Makeup Brush Cosmetic Brushes', '22_.jpg', 'Super Soft Oval Toothbrush Makeup Brush Cosmetic Brushes', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>Complete Equipment: Powder Brush, Blush Brush, Foundation Brush, Brow Brush, Eye Shadow Brushes, Concealer Brush, Lip Brush, and provide a special packing bag.</li>\r\n	<li>Humanity Design: Toothbrush soft anti-slip make up brushes give your whole new make up experience.</li>\r\n	<li>Professional Results: Enjoy a salon quality, multiple functions to meet makeup needs.</li>\r\n	<li>Popular and Convenient: Fashion style, small size and easy to carry.</li>\r\n	<li>Save Your Time: Smooth and easier to make up.</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-11-29 09:11:21', 1, 0, '2016-11-29 04:18:21'),
(766, 0, 75, 0, 0, 'PRO-766', 'Omnia Crystalline by Bvlgari for Women - Eau de Toilette', 'bvlgari-omnia-crystalline-woman.jpg', 'Omnia crystalline is inspired by the perfection of crystal. It is delicate and gentle like the touch of flower petals. This sparkling Eau de Toilette captures the essence of frosted flowers. The top notes bring aery bamboo and exotic Asian fruit Nashi tha', '<p>Make a fantastic and memorable first impression by wearing Bvulgari Omnia Crystalline for women. This eau de toilette spray features has woody notes of balsa and bamboo that mix with floral and fruity notes such as nashi and lotus flower for a feminine scent that&#39;s great for daytime or nighttime use. Wear it to the office to leave your mark in the boardroom, or spritz it on your pulse points on your next date or night out with friends.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Fragrance is aromatic and delicate</li>\r\n	<li>Bvlgari Omnia Crystalline women&#39;s fragrance is feminine and refined</li>\r\n	<li>Women&#39;s scent possesses a blend of balsa wood, bamboo, lotus flower, and nashi</li>\r\n	<li>Available in a 2.2-ounce eau de toilette spray</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-05 05:12:33', 1, 0, '2016-12-05 00:29:33'),
(767, 0, 75, 0, 0, 'PRO-767', 'Omnia Indian Garnet by Bvlgari for Women', 'Bvlgari-Omnia-Indian-Garnet.jpg', 'ITS ORIENTAL - FLORAL COMPOSITION OPENS WITH CITRUSY AROMAS OF MANDARIN AND ORANGE.\r\nTHE HEART IS DOMINATED BY OSMANTHUS FLOWER, LAID ON THE ORIJENTAL BASE OF AMBER.\r\nTHE FRAGRANCE IS SIGNED BY ALBERTO MORILLAS', '<p>Indulge in a sexy and seductive scent when splashing on the Bvlgari Omnia Indian Garnet eau de toilette spray, designed exclusively for women. The delicate, fruity scent features nuances of Osmanthus flowers and a blend of saffron and mandarin for a soft, yet mysterious aroma.<br />\r\n<br />\r\nOpt for an elegant perfume created by Master Perfumer Alberto Morillas, who specializes in rich florals. The feminine scent is available in a 2.2-ounce spray bottle that is ideal for the woman on the go who wants to restore her charm with a spritz during the day when stored in a small handbag or tote.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-05 06:12:16', 1, 0, '2016-12-05 00:36:16'),
