(804, 0, 29, 0, 0, 'PRO-804', 'Lenovo S60, 8GB, 4G LTE', 'gsmarena_0012.jpg', '', '<p>Powering the Lenovo S60 smartphone is a 64-bit 1.2GHz quad-core Qualcomm processor and 2GB of RAM. The smartphone has 8GB of internal storage that can be further expanded by up to 32GB via microSD card. Check the Lenovo S60 price in Doha Qatar and detail specs.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-15 09:12:23', 1, 0, '2016-12-15 15:42:23'),
(805, 0, 29, 0, 0, 'PRO-805', '  Lenovo VIBE S1a40 5.0" Smartphone 32GB 4G/DS', 'RS18430_VIBES1_DarkBlue_Hero_01.jpg', 'The Vibe S1 is the ultimate showstopper. That’s because, the front Gorilla Glass 3 disperses reflections in such a manner that the images will always appear softer and richer. While an 8 -step engineering process has gone into creating the Vibe S1’s impec', '<p>Be the centre of all attention by owning the exquisite and elegant Lenovo Vibe S1 Smartphone. A no-nonsense performer, the handset is a pure amalgamation of form and substance carrying a reasonable price tag. If style and efficiency are all what you are looking for in a Smartphone, then this Lenovo product does the magic for you.</p>\r\n\r\n<ul>\r\n	<li>World&#39;s First Dual Selfie Camera</li>\r\n	<br />\r\n	<li>Stunning Design with Curved Gorilla Glass</li>\r\n	<br />\r\n	<li>Super Sleek Rounded Metal Frame Design</li>\r\n	<br />\r\n	<li>Unmatched Power with OctaCore &amp; 3GB RAM</li>\r\n	<br />\r\n	<li>Unlease creativity with Dual Selfie Camera</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-15 09:12:47', 1, 0, '2016-12-15 15:50:47'),
(806, 0, 29, 0, 0, 'PRO-806', 'Lenovo Vibe P1 m42', 'lenovo-vibe-p1-32gb-rom-2gb-ram-5000mah-grey-0638-7812078-1.jpg', '', '<p>Lenovo Vibe P1 smartphone was launched in October 2015. The phone comes with a 5.50-inch touchscreen display with a resolution of 1080 pixels by 1920 pixels at a PPI of 401 pixels per inch.<br />\r\n<br />\r\nThe Lenovo Vibe P1 is powered by 1.5GHz octa-core Qualcomm Snapdragon 615 processor and it comes with 2GB of RAM. The phone packs 32GB of internal storage that can be expanded up to 128GB via a microSD card. As far as the cameras are concerned, the Lenovo Vibe P1 packs a 13-megapixel primary camera on the rear and a 5-megapixel front shooter for selfies.<br />\r\n<br />\r\nThe Lenovo Vibe P1 runs Android 5.1.1 and is powered by a 4900mAh non removable battery. It measures 152.90 x 75.60 x 9.90 (height x width x thickness) and weighs 189.00 grams.<br />\r\n<br />\r\nThe Lenovo Vibe P1 is a dual SIM (GSM and GSM) smartphone that accepts Nano-SIM and Nano-SIM. Connectivity options include Wi-Fi, GPS, Bluetooth, NFC, USB OTG, FM, 3G and 4G (with support for Band 40 used by some LTE networks in India). Sensors on the phone include Compass Magnetometer, Proximity sensor, Accelerometer and Ambient light sensor.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-15 09:12:07', 1, 0, '2016-12-15 15:55:07'),
