(814, 0, 75, 0, 0, 'PRO-814', 'Estée Lauder Sensuous Noir EDPS 50ml', '817496.jpg', 'Eau de Parfum SpraySensuous after dark. Intensely rich. Mysteriously seductive. A deep heart of Molten Woods, Creme Noir and Patchouli, surrounded by Spiced Lily and other night-blooming florals. The ultimate in sensuality. ', '', '', '', NULL, '', NULL, NULL, 1, '2016-12-19 01:12:43', 1, 0, '2016-12-19 08:03:43'),
