(816, 0, 75, 0, 0, 'PRO-816', 'CK One Gold Calvin Klein for women and men', 'o_40921.jpg', 'Available in 200ml & 100ml\r\n\r\nCK One fragrance from Calvin Klein that was launched in 1994 marked the teenage generation of the 90s and 2000s. The new aroma for her and for him, coming out mid-2016, is a modern interpretation of the iconic fragrance conve', '<p><strong>CK One Gold</strong> is seasonal, youthful scent of juicy and fresh woody character which supposedly combines the power of both sexes. Energetic freshness in the top notes is achieved by an unusual blend of fig, bergamot and sage. The luminous heart of neroli is complemented by flowers of jasmine and violet. Sunny vetiver gives depth to the perfume, leaving a sensual and warm trail on the skin together with notes of patchouli and guaiac wood.</p>\r\n\r\n<p>Rhiannon McConnell is the face of the ad. The signature transparent CK One bottle is dipped in gold paint. The fragrance is available from September 2016 as a 50, 100 and 200 ml Eau de Toilette.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-19 01:12:22', 1, 0, '2016-12-19 08:19:22'),
(817, 0, 75, 0, 0, 'PRO-817', 'Cool Water Sea Rose By Davidoff 100ml Edt', 'davidoff_cool_water_sea_rose_for_women_100ml_edtlbjo.jpg', 'Davidoff launched a new edition of the women''s Cool Water perfume from 1996. After Cool Water Sensual Essence edition that was presented in 2012, Cool Water Sea Rose launches in 2013 as a new chapter in the saga of love between a woman and the sea.\r\n\r\n\r\nP', '', '', '', NULL, '10', NULL, NULL, 1, '2016-12-19 01:12:58', 1, 0, '2017-02-03 11:29:17'),
(818, 0, 63, 0, 0, 'PRO-818', 'IRISNotes Executive 2', '123452.jpg', 'The digital pen that types what you write!\r\n\r\nIRISnotes is a digital note taker designed to turn your handwritten notes into on-screen text, fully editable and compatible with any text editor!\r\n\r\n', '<p>Capture notes &amp; drawings</p>\r\n\r\n<p>Stop losing time retyping your handwritten notes and redrawing your sketches on the computer!&nbsp;With the IRISnotes, you can take notes or draw sketches on any paper surface and easily turn them into editable digital text, ready to be shared or archived. Simply place the small receiver on the top of your documents and your notes will be recorded as you write!</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-23 10:12:45', 1, 0, '2016-12-23 17:11:45'),
(819, 0, 94, 0, 0, 'PRO-819', 'Steel Boned Waist Trainer Corset Cincher Vest Body Shaper -BLACK', '86.jpg', 'This is a pre order product.  Shipping will take 7 - 10 days.  Free Shipping\r\n\r\nHigh quality material: 90% Polyester, 5% Cotton, 5% Elastan \r\n\r\n3 hook-and-eye closures for flexible sizing. 360 degrees of firm control, trimming waist and tummy, you will ge', '<p>This waist training corset can maximize your workout and flatter your figure. It gives support to your spine, lifting bust through posture correction.<br />\r\nThis waist cincher helps you take inches off your waist and creates an hourglass figure and promotes a quick post pregnancy recovery.<br />\r\nFirm compression and comfortable fabric provide midsection control and comfort at the same time.<br />\r\nPerfect for everyday use, postpartum and after a tummy tuck or liposuction. You can wear it under everyday clothes or on special occasions.<br />\r\n<br />\r\n<strong>Please choose the size by your natural waist measurement: </strong><br />\r\nS/22&quot; (Fit Natural Waist 23&quot;-25&quot;)<br />\r\nM/23&quot; (Fit Natural Waist 25&quot;-27&quot;)<br />\r\nL/24&quot; (Fit Natural Waist 27&quot;-29&quot;)<br />\r\nXL/25&quot; (Fit Natural Waist 29&quot;-31&quot;)<br />\r\n2XL/26&quot; (Fit Natural Waist 31&quot;-33&quot;)<br />\r\n3XL/27&quot; (Fit Natural Waist 33&quot;-35&quot;)</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-26 02:12:51', 1, 0, '2016-12-26 08:35:49'),
(820, 0, 94, 0, 0, 'PRO-820', 'Lace Waist Trainer Cincher 3 Hooks for Women - BLACK', '255.jpg', 'This is a pre order product. Shipping will take 7 - 10 days. Free Shipping. High quality material: 90% Polyester, 5% Cotton, 5% Elastan 3 hook-and-eye closures for flexible sizing.\r\n\r\nThis waist cincher is designed to reshapes and trains your waist to be ', '<p>Specifications:<br />\r\nMaterial: 90% Polyester, 5% Cotton, 5% Elastan.<br />\r\nColors: Black, Beige<br />\r\nSizes: X-Small, Small, Medium, Large, XL, 2XL, 3XL, 4XL, 5XL, 6XL<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Please choose the size by your natural waist measurement: </strong><br />\r\nXS/ Fit Natural Waist 22&quot;-24&quot;<br />\r\nS/ Fit Natural Waist 24&quot;-26&quot;<br />\r\nM/ Fit Natural Waist 26&quot;-28&quot;<br />\r\nL/ Fit Natural Waist 28&quot;-30&quot;<br />\r\nXL/ Fit Natural Waist 30&quot;-32&quot;<br />\r\n2XL/ Fit Natural Waist 32&quot;-34&quot;<br />\r\n3XL/ Fit Natural Waist 34&quot;-36&quot;<br />\r\n4XL/ Fit Natural Waist 36&quot;-38&quot;<br />\r\n5XL/ Fit Natural Waist 38&quot;-40&quot;<br />\r\n6XL/ Fit Natural Waist 40&quot;-42&quot;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-26 02:12:57', 1, 0, '2016-12-26 08:39:57'),
(821, 0, 94, 0, 0, 'PRO-821', 'Lace Waist Trainer Cincher 3 Hooks for Women - IVORY', '313.jpg', 'This is a pre order product. Shipping will take 7 - 10 days. Free Shipping High quality material: 90% Polyester, 5% Cotton, 5% Elastan 3 hook-and-eye closures for flexible sizing.', '<p>Specifications:<br />\r\nMaterial: 90% Polyester, 5% Cotton, 5% Elastan.<br />\r\nColors: Black, Beige<br />\r\nSizes: X-Small, Small, Medium, Large, XL, 2XL, 3XL, 4XL, 5XL, 6XL<br />\r\n<strong>Please choose the size by your natural waist measurement: </strong><br />\r\nXS/ Fit Natural Waist 22&quot;-24&quot;<br />\r\nS/ Fit Natural Waist 24&quot;-26&quot;<br />\r\nM/ Fit Natural Waist 26&quot;-28&quot;<br />\r\nL/ Fit Natural Waist 28&quot;-30&quot;<br />\r\nXL/ Fit Natural Waist 30&quot;-32&quot;<br />\r\n2XL/ Fit Natural Waist 32&quot;-34&quot;<br />\r\n3XL/ Fit Natural Waist 34&quot;-36&quot;<br />\r\n4XL/ Fit Natural Waist 36&quot;-38&quot;<br />\r\n5XL/ Fit Natural Waist 38&quot;-40&quot;<br />\r\n6XL/ Fit Natural Waist 40&quot;-42&quot;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-26 02:12:38', 1, 0, '2016-12-26 08:44:38'),
(822, 0, 94, 0, 0, 'PRO-822', 'Womens Adjustable Shoulder Strap Waist Trainer Vest Underbust Corset -BLACK', '1118.jpg', 'This is a pre order product. Shipping will take 7 - 10 days. Free Shipping High quality material: 90% Polyester, 5% Cotton, 5% Elastan 3 hook-and-eye closures for flexible sizing.', '<p><strong>Features: </strong><br />\r\n1. Underbust waist training vest corset.<br />\r\n2. 3 hook-and-eye closures in the front make sure that this vest corset could fit your figure at the most extent. The adjustable bra straps put you in total control.<br />\r\n3. This latex waist cincher helps you burn your axunge, improve your posture and enhance your curves, which provides you unparallel midsection control and comfort at the same time.<br />\r\n4. It is not just look great for a special occasion, also a daily garment. You can use it while working out at the gym, at work and just daily life.<br />\r\n5. Everbellus corsets help you minimize your waistline and midriff for an hourglass shape, make your curves look more fascinating and charming.<br />\r\n<br />\r\n<strong>Specifications: </strong><br />\r\nMaterial: Core: 100% Latex, Lining: 96% Cotton+4% Spandex.<br />\r\nColors: Black</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Please choose the size by your natural waist measurement: </strong><br />\r\nXS/ Fit Natural Waist 22&quot;-24&quot;<br />\r\nS/ Fit Natural Waist 24&quot;-26&quot;<br />\r\nM/ Fit Natural Waist 26&quot;-28&quot;<br />\r\nL/ Fit Natural Waist 28&quot;-30&quot;<br />\r\nXL/ Fit Natural Waist 30&quot;-32&quot;<br />\r\n2XL/ Fit Natural Waist 32&quot;-34&quot;<br />\r\n3XL/ Fit Natural Waist 34&quot;-36&quot;<br />\r\n4XL/ Fit Natural Waist 36&quot;-38&quot;<br />\r\n5XL/ Fit Natural Waist 38&quot;-40&quot;<br />\r\n6XL/ Fit Natural Waist 40&quot;-42&quot;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-26 02:12:21', 1, 0, '2016-12-26 09:00:21'),
(823, 0, 56, 0, 0, 'PRO-823', 'Lenovo Ideapad Miix 310 Detachable 10" Tablet 4G LTE 64GB', 'lenovo_ideapad_miix_310_detachable_tablet_1_1.jpg', 'The incredible Lenovo Ideapad Miix 310. Both a tablet and a laptop at once! Tthe affordable Miix 310 is eminently mobile, so you won’t feel confined to a physical keyboard or budget .', '<p><strong>Brilliant Display with IPS Technology:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At a mere 580g and only 9.2mm thick, carry your Miix 310 &nbsp;just about anywhere without geting that aweful shoulder pain. Ideapad Miix 310 comes equipped with a vibrant 10&quot; wide-view 1280*800 or 1920*1200 pixels display, complete with in-plane switching (IPS) for vibrant colors and nearly 180-degree viewing angles. In addition, the multitouch technology integrates with Windows 10, giving you more precise control.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Integrated Webcams:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The&nbsp;Lenovo Ideapad Miix 310 Detachable 10&quot; Tablet features a couple of stunning cameras. 2MP front and 5MP rear cameras will help you enjoy web conferences or online video chats like you&rsquo;re really there.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Detachable Keyboard:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;A detachable keyboard is standard with Miix 310. A laptop when you need it or turn it into a tablet if you want it, so the choice is yours. Attach the tablet for increased productivity, adjusting the hinge for picture-perfect viewing just like a traditional laptop. What more do you want!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Long Battery Life:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>On just one charge, get up to 10 hours of local video playback, play games and listen to music all day long. You will probably get tired before the battery does!</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-28 01:12:24', 1, 0, '2016-12-27 20:28:24'),
(824, 0, 56, 0, 0, 'PRO-824', 'Lenovo Tab 2 A10-30 16GB 2GB Ram 4G LTE Gaming Tablet Pearl White ', 'item_XL_8653715_8627493.jpg', 'Ready to meet the new Lenovo Tab 2 with its amazing features\r\n• Large, wide-view display for vivid crisp visuals\r\n• Long battery life\r\n• Slim, portable design\r\n• Dual speakers\r\n• Optional 4G-LTE connectivity', '<p><strong>Remarkable Design</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A 10-inch amazing glossy screen with a <strong>resolution of 1280&times;800 pixels</strong>&nbsp;features not only&nbsp;high-quality images that are so vibrant and close to real life but also take gaming and internet surfing to an all new level.&nbsp;The <strong>soft-touch coating</strong> makes it super easy to handle. No more worrying about the tablet sliping out of your hand. Another plus in the treasury of practicality is the size of the new <strong>tablet Lenovo TAB 2 A10 30</strong> following 247x171x9 mm dimension and weighing <strong>only 525 grams</strong>.&nbsp;TAB 2 A10-30 is less than 9mm thick for maximum portability. And it comes in two stunning color options &mdash; Pearl White and Midnight Blue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>High Quality Camera</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Note the excellent brightness and contrast ratio.&nbsp;The <strong>colors of the output are just juicy and realistic</strong>. Now capture pictures like never before.. Added to that, the Tab 2 is packed with a&nbsp;<strong>high-quality basic webcam</strong>. With a 5M rear and 2M front camera, your video chats with family and friends will really shine. Lightning-quick 4G-LTE lets you stay connected anywhere you go. Available on 4G-LTE versions. Chat like never before..</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Great Acoustics</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This new tablet<strong> Lenovo TAB 2 A10 30</strong> has all the necessary interfaces for high-quality work. It runs on Android 5.1 operating system. Processor is a Qualcomm Snapdragon 210 quad-core MSM8909, clocked at 1.1 GHz.&nbsp;With a built-in lithium-ion battery, it will definitely last even longer! Operate without recharging <strong>up to 10 hours</strong> of uninterrupted use&nbsp;and up to 117 days of standby time.&nbsp;You can use your tablet all day long without recharging.</p>\r\n\r\n<p>Dual speakers deliver a crisp sound experience. The TAB 2 A10-30 is great for music and videos. 16GB of internal storage give you plenty of room to stash your media files and everything else.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-28 02:12:49', 1, 0, '2016-12-27 20:31:49'),
(825, 0, 30, 0, 0, 'PRO-825', 'Lenovo Yoga Tab 3 X50, IPS 10.1" 4G 16GB, 2GB Ram ', 'Herstellerfoto2.jpg', 'The Yoga Tab 3 10 lets you enjoy your favorite shows anytime, anywhere. While its vibrant display delivers great video, powerful speakers emit truly immersive audio. And thanks to its epic battery life, you can binge-watch on the go. What’s more, a rotati', '<p><strong>Outstanding Battery:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>With its brilliant battery life, sit back and relax because the <strong>YOGA Tab 3 8</strong> will keep on going and won&#39;t suddenly shut down. With <strong>up to 18 hours on one charge</strong>, it&rsquo;s watch two series of your favorite TV show back to back or play games all day long. Enjoy your time with it!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Multimode Capabilities:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Stand, tilt, hold or even hang the <strong>YOGA Tab 3 8</strong> to a way that suits you. Scroll through recipes while you cook, check your social feeds while you eat, and watch movies while you work out.&nbsp;All designed for your pleasure!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>180&deg; Rotatable Camera:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fond of taking photos? Constantly chatting on Skype? The <strong>YOGA Tab 3 8&#39;s pin-sharp 8MP 180&deg; rotatable camera</strong> boasts camera gesture controls and offers a new way of taking beautiful photos and chatting. Now you can simply strike a pose, open and close your hand to take a picture. Fun, easy and extremely cool!</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-28 02:12:22', 1, 0, '2016-12-27 20:37:22'),
(826, 0, 30, 0, 0, 'PRO-826', 'Lenovo Yoga Tablet 3 2GB Ram 16GB 4G 850M', 'cixsudbyrq_1.jpg', 'The Yoga Tab 3 is more than just your average tablet. With four usage modes including tilt, stand, hold and hang, this 8" multi-mode tablet is packed with multimedia features, a rotable camera, and epic battery life.\r\n\r\n\r\n• Display LCD 8", resolution 1280', '<p>The Yoga Tab 3 is more than just your average tablet. With four usage modes including tilt, stand, hold and hang, this 8&quot; multimode tablet is packed with multimedia features, a rotable camera, and epic battery life.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Four Ways to Use Your Tablet</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>YOGA Tab 3 8&#39;s innovative design places a battery cylinder and kickstand on the side of the device, shifting the center of gravity and opening up multiple ways to use it: Hold, Tilt, Stand, and Hang. That means there are four different ways to enjoy media content, games, and more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Enhanced Multimedia and Audio</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>YOGA Tab 3 8&rsquo;s HD resolution is perfect for casual gaming and intense web browsing. It delivers incredible brightness for a great viewing experience under all angles and ambient lights.<br />\r\nYOGA Tab 3 8 delivers rich home theater sound that you will not experience on any other tablet. The two integrated front-facing speakers and powerfully immersive Dolby Atmos&reg; sound give louder, clearer and dynamic audio&hellip; even without headphones!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Gorgeous Display</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The YOGA Tab 3 8&rsquo;s HD resolution is perfect for casual gaming and intense web browsing, and delivers incredible brightness for a great viewing experience under all angles and ambient lights. Your games are crisp and your videos simply beautiful to watch.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Rotatable Camera</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>YOGA Tab 3 8&rsquo;s camera rotates 180 degrees. Better picture quality at any angle, better Skype chats, better selfies. All in all, a more creative approach to tablet photography.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Epic Battery Life</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>With a battery life that hits 20 hours on a single charge, the YOGA Tab 3 8 will run all day - and into the night - without plugging in.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>AnyPen Technology</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Use any conductive object &ndash; a regular pen or pencil; even a carrot! &ndash; as a stylus on your YOGA Tab 3 8&rsquo;s touchscreen.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2016-12-28 02:12:03', 1, 0, '2016-12-27 20:42:03');
INSERT INTO `product` (`id`, `manufacture`, `category`, `order_no`, `reorder_qty`, `code`, `title`, `image`, `short`, `description`, `meta_des`, `meta_key`, `price`, `discount`, `clearance`, `clearance_discount`, `status`, `create_date`, `create_by`, `company_id`, `last_update`) VALUES
(827, 0, 56, 0, 0, 'PRO-827', 'Lenovo YogaBook Windows 64GB 4GB 10.1" Wi-Fi', 'lenovo-yoga-book-windows-raw.jpg', 'Yogabook Hybrid with Combined Virtual Keyboard and Digitizer\r\n\r\nIt''s a Notebook Perfected for your Imagination', '<h3>Note Saver &amp; Real Pen Stylus With Real Ink &ndash; the New, Natural Way to Take Notes.</h3>\r\n\r\n<p>Write in ink on paper with the Real Pen, and let the <strong>YOGA Book</strong> seamlessly digitize your notes. Edit, organize, merge, and share your notes in a second. Use the included Book Pad clipboard to magnetize your papers and easily keep them in place. Do it while looking at your screen and seeing your notes being digitized before your eyes, or using the Lenovo NoteSaver application to use your <strong>YOGA Book</strong> as a smart paper pad&mdash;folded open for the most natural way to take notes.</p>\r\n\r\n<p>Now you&rsquo;ll never lose track of your ideas and inspirations.</p>\r\n\r\n<h3>Use Real Pen to Draw Like a Real Pro.</h3>\r\n\r\n<p>When artistic inspiration strikes, <strong>YOGA Book</strong> has you covered.</p>\r\n\r\n<p>When the keyboard is off, the Create Pad and Real Pen give you the precision and control you expect from a traditional pen on paper.</p>\r\n\r\n<p>Draw with the included Real Pen that detects 2048 levels of pressure&mdash;capturing subtle nuances of every stroke. No need to worry about batteries; the Real Pen works without ever needing a charge. You can even be more creative by using two hands: one on the screen to select tools, pan, and pinch-to-zoom the other hand using the Real Pen to draw on the Create Pad. Best of all, you can see your creations come alive on the display &ndash; unlike most tablets, where your hand blocks the display as you draw.</p>\r\n\r\n<h3>Slim, Light, with All-Day Battery Life &ndash; Unleash your Imagination, Anywhere.</h3>\r\n\r\n<p>Only 4.55 mm thin when opened, weighing just 1.5 lbs (690 g), and with up to 15 hours of use on a single charge &ndash; the YOGA Book allows you to use your creativity wherever you are. Its awesome-looking design is crafted with a premium high-quality alloy of Aluminum (Al) and Magnesium (Mg). The YOGA Book comes in a choice of Gunmetal Grey and Champagne Gold.</p>\r\n\r\n<p>Expect to turn heads when you unpack your <strong>YOGA Book</strong>.</p>\r\n\r\n<h3>The Power of Windows.</h3>\r\n\r\n<p>Tablet productivity soars when you&rsquo;re working in the familiar Windows environment. Get things done quickly and efficiently on mobile versions of apps like Word, Excel, and PowerPoint.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Choose a Mode to Match Your Needs.</h3>\r\n\r\n<p>With a hinge that opens 360&ordm;, the <strong>YOGA Book</strong> can be used in 4 modes to fit your lifestyle: lie-flat Create Mode for note taking and drawing, Browse Mode as a compact 10.1&rdquo; tablet, Watch Mode for entertainment, and Type Mode as a productive laptop.</p>\r\n\r\n<p>Make no mistake &ndash; <strong>YOGA Book</strong> has what it takes under the hood to keep up with the demands of your busy life</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Enjoy Cinema-Level Sound and Video.</h3>\r\n\r\n<p>Not only is the <strong>YOGA book</strong> great to create, it&#39;s great to watch. With access to Google Play and your favorite Android apps, this 2-in-1 tablet features a bright 10.1&rdquo; Full-HD display &amp; Dolby Atmos&reg; speakers give you an immersive, cinematic sound&mdash;putting you at the center of the action.</p>\r\n\r\n<p>Relax and enjoy binge-watching.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Speed Through Your Day With Lightning-Fast Processing.</h3>\r\n\r\n<p>Intel&reg; Atom&trade; gives you advanced technology and processing capabilities, packed onto an ultrathin and lightweight chip that is more energy efficient&mdash;perfect for keeping mobile devices going as long as you do on the road.</p>\r\n\r\n<h3>What&#39;s in the Box?</h3>\r\n\r\n<ul>\r\n	<li>1 Yoga Book</li>\r\n	<li>1 Real Pen</li>\r\n	<li>1 Book Pad</li>\r\n	<li>20 Paper Book Pad Refills</li>\r\n	<li>2 Real Pen Ink Refills</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '5', NULL, NULL, 1, '2016-12-30 12:12:33', 1, 0, '2016-12-29 18:48:33'),
(828, 0, 60, 0, 0, 'PRO-828', 'DAFNI Hair Straightening Brush', '1456883382648.jpg', 'The DAFNI hair straightening brush styles hair with advanced technology and superior materials in as little as just 3-5 minutes. Created by one woman, for all women everywhere that do not have time for trips to the salon or the long process of a blow dry.', '<p>THE ORIGINAL ceramic hair straightening brush with patented technology</p>\r\n\r\n<ul>\r\n	<li>8x FASTER than traditional flat irons and blow drying</li>\r\n	<li>PROFESSIONAL STYLING that looks like a fresh blow dry in only 3-5 minutes</li>\r\n	<li>ADVANCED TECHNOLOGY and materials with safety mechanisms</li>\r\n	<li>185 DEGREES celsius keeps heat consistent from the root to the tip of the hair with each stroke</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-01-06 05:01:00', 1, 0, '2017-01-06 14:23:00'),
(829, 0, 60, 0, 0, 'PRO-829', 'Babyliss Curl Pods', '1215.jpg', 'BaByliss translates more than 50 years of styling runways, fashion shoots and red carpets into its haircare products. Give your hair an instant refresh with its salon-ready range of straighteners, hairdryers and styling tools. ', '<p>Curl Pods by BaByliss &bull;All-in-one heated curling system...<br />\r\n&bull;Contains 18 rollers<br />\r\n&bull;Quick heating design in 3 to 5 minutes<br />\r\n&bull;Roll the hair around the barrel and snap shut<br />\r\n&bull;Curl two inch sections at a time<br />\r\n&bull;Leave the rollers in to cool<br />\r\n&bull;Ideal for long-lasting waves and curls <a href="https://www.facebook.com/dohabestbuy/photos/pb.1700647500194605.-2207520000.1483802683./1800388156887205/?type=3&amp;theater#">See More</a></p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2017-01-07 06:01:09', 1, 0, '2017-03-06 18:17:43'),
(830, 0, 74, 0, 0, 'PRO-830', 'Davidoff Leather Blend Davidoff 100ml', '5878468044102192.jpg', 'This opus celebrates leather, this valued material pays a vibrant homage to Zino Davidoff’s love of luxury and fine craftsmanship.', '<p>Fuelled by an unquenchable curiosity, Zino Davidoff kept exploring the world, searching for worthy materials and skillful workmanship. His passion for discovery and dedication to excellence soon equated the Davidoff brand with uncompromising quality and unrivalled elegance. The new Davidoff Blend Collection is a tribute to this philosophy. Composed of carefully selected exclusive ingredients and packaged with style, it offers a unique experience, an olfactory and sensory journey into Zino Davidoff&rsquo;s universe.</p>\r\n', '', '', NULL, '5', NULL, NULL, 1, '2017-01-07 06:01:11', 1, 0, '2017-01-07 15:34:11'),
(831, 0, 30, 0, 0, 'PRO-831', 'Samsung Galaxy Tab A 2016 T285 7 Inch, 8GB, 4G LTE', 'item_xl_10612608_13945829.jpg', 'Network: 4G LTE\r\nDisplay: 7 INCH LCD\r\nProcessor: 1.3 CORE\r\nRAM: 1.5 GB \r\nCamera: 5MP\r\nBattery: 4000 mAh', '<p><strong>Storage</strong></p>\r\n\r\n<p><br />\r\nThe Samsung Galaxy Tab SM-T285 comes with 1.5GB Ram and 8GB internal storage,Expandable up to 200GB via microSD card and Dual SIM (Nano-SIM, dual stand-by), if we discuss about the processing of Tablet, which comes with Quad-core 1.3 GHz Cortex-A53 Processor with Samsung Exynos 3 Quad 3475 which makes phone processing faster. Company launch its phone in Black and White color options.</p>\r\n\r\n<p><br />\r\n<strong>Connectivity &amp; Display</strong></p>\r\n\r\n<p><br />\r\nThe Samsung Galaxy Tab SM-T285 comes with WXGA display, with TFT capacitive touch screen including 16 million colors with physical 7.0-inch display size, as far as the display resolution is 1280&times;800 pixel, the Tablet comes with multitouch.The network technology of phone is GSM / HSPA / LTE (2G, 3G, 4G), included downloading and uploading up to 150 and 50 Mbps 4G network.</p>\r\n\r\n<p><br />\r\n<strong>OS</strong></p>\r\n\r\n<p><br />\r\nSamsung Galaxy Tab SM-T285 runs with Android 5.1 Lollipop operating system including high-performance CPU and GPU.</p>\r\n\r\n<p><br />\r\n<strong>Cameras</strong></p>\r\n\r\n<p><br />\r\nTABLET comes with 5 Megapixel back and 2 megapixel front selfie camera, comes withwithGeo-tagging, touch focus, face detection, HDR, panorama and much more functionalities, however, you can capture 720p@30fps video recording.</p>\r\n\r\n<p><br />\r\n<strong>Other features</strong></p>\r\n\r\n<p><br />\r\nIf we go deep into the sensor and more features of Samsung Galaxy Tab SM-T285, you will get Accelerometer with the different type of messaging views SMS(threaded view), MMS, Email, Push Mail, IM and the handset is powered by 4,000 mAh Lithium-Polymer Battery.It measures 186.9 x 108.8 x 8.7 mm and 283 Grams weight.</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2017-01-09 11:01:11', 1, 0, '2017-01-09 08:34:11'),
(832, 0, 93, 0, 0, 'PRO-832', 'CLIP IN REMY REAL HUMAN HAIR EXTENSIONS 7PCS 20 Inch color medium dark brown', '256.jpg', 'CLIP IN REMY REAL HUMAN HAIR EXTENSIONS 7PCS 20 Inch color medium dark brown', '<p>&nbsp;Usage: Can be trimmed to length, curled, straightened, washed &amp; dyed. The temperature is better under 200℃,It&#39;s better not coloring because it may influence its quality! Hair Type: 100% Silky Remy Human Hair Style, May last upto 15 months of great care.</p>\r\n\r\n<p>7pcs/set hair extensions, which include: i) 8&quot; wide piece (4 clips- For the Upper Back of Head) *1 pcs ii) 6&quot; wide piece (3 clips- For the Lower Back of Head) *2 pcs iii) 4&quot; wide piece (2 clips- For sides) *2 pcs iv) 2&quot; wide piece (1 clip- For Front of Head) *2 pcs The thickness is depended on the weight and length.</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2017-01-10 03:01:24', 1, 0, '2017-01-10 12:09:24'),
(833, 0, 93, 0, 0, 'PRO-833', '18" Tape in Hair Extensions Skin Weft Dip Dye Real Hair Extensions Balayage Hair Color #2 Fading to #6 and #18 Ash Blonde Full Head', '314.jpg', '', '<p>About the Product&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Full Shine Hair works on improving the customer experience by exploring the new hair material and tape. We will provide customer the finest hair and the strongest tape with our improvement. And All Photos Are Taken by Full Shine Hair, nobody is authorised to sell our product. You can know more details for the previous contact with us.</li>\r\n	<li>Takes 7 to 10 Business Day to Deliver. Items are coming from USA</li>\r\n	<li>Products Name: Balayage Ombre Remy Tape Human Hair Extensions; Color: Color #2 Fading to Color #6 and Color #18 Ash Blonde Balayage; Different Monitors Will show color a bit different; Length: 18&quot;; Quantity: 20pcs/Pack; 50gram.40 to 80 pcs is suggested for a full head.Quality: Thick End but is not double drawn, Tangle Free Shedding Free.</li>\r\n</ul>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2017-01-10 03:01:06', 1, 0, '2017-01-10 12:20:28'),
(834, 0, 81, 0, 0, 'PRO-834', 'Casio Watch With 50M Water Resist Function', '104.jpg', 'Product Details\r\nWatch by Casio •Resin strap and case \r\n•Three hand movement\r\n•Dash and numbered indices\r\n•Single crown to side \r\n•Pin buckle fastening\r\n•Single keeper \r\n•5ATM: water resistant to 50 metres (160 feet)\r\n', '<p>Product Details</p>\r\n\r\n<p><a href="http://www.asos.com/Men/Watches/Cat/pgecategory.aspx?cid=5034"><strong>Watch</strong></a> by <a href="http://www.asos.com/Men/A-To-Z-Of-Brands/Casio/Cat/pgecategory.aspx?cid=3735"><strong>Casio</strong></a></p>\r\n\r\n<ul>\r\n	<li>Resin strap and case&nbsp;</li>\r\n	<li>Three hand movement</li>\r\n	<li>Dash and numbered indices</li>\r\n	<li>Single crown to side&nbsp;</li>\r\n	<li>Pin buckle fastening</li>\r\n	<li>Single keeper&nbsp;</li>\r\n	<li>5ATM: water resistant to 50 metres (160 feet)</li>\r\n</ul>\r\n', '', '', NULL, '50', NULL, NULL, 2, '2017-01-12 07:01:28', 1, 0, '2017-01-12 16:19:22'),
