(836, 0, 56, 0, 0, 'PRO-836', 'ACER ASPIRE E5-473-14" ', '11-53-600x571.jpg', 'Processor: INTEL CORE I3 5005U (2.0GHZ)\r\n•Operating System: WINDOWS 10\r\n•Memory: 4GB DDR3\r\n•Graphics: INTEL HD 5500\r\n•Display Size: 14″ HD DISPLAY\r\n•Storage: 1TB SATA\r\n', '<p>A variety of vivid interior colors with a stylish textile pattern are enjoyable to the eye and pleasant to touch. Additional edge highlights emphasize the stylish look of the entire series and are complemented by the smart undercut design that is both good looking and lets you easily raise the lid with just one hand.</p>\r\n', '', '', NULL, '5', NULL, NULL, 1, '2017-01-23 02:01:40', 1, 0, '2017-01-23 11:54:40'),
(837, 0, 56, 0, 0, 'PRO-837', 'Dell Inspiron 15 5559 Notebook (6th Gen Intel Core i5- 8GB RAM- 1TB HDD- 39.62 cm (15.6)- Windows 10- 2GB Graphics)', '713JffMN1LL__SL1500_.jpg', 'Dell Inspiron i5559-5347SLV 15.6 Inch FHD Touchscreen Laptop with Intel RealSense (6th Generation Intel Core i5, 12 GB RAM, 1 TB HDD)', '', '', '', NULL, '5', NULL, NULL, 1, '2017-01-23 03:01:56', 1, 0, '2017-01-23 12:04:56'),
(838, 0, 75, 0, 0, 'PRO-838', 'Dolce & Gabbana The One EDP For Women Perfume ', 'sdfcsadfc.jpg', 'Dolce & Gabbana has launched its brand new fragrance, The One. Packaged in gold, The One symbolizes the very essence of luxury. From its regal flask to its precious sparkling scent, this new fragrance is every inch a diva that demands to be celebrated and', '<p>Imagine sun-touched citrus blended with bergamot, fruity notes of lychee and the sweetest peaches &ndash; and that&rsquo;s just the top notes! Allow the fragrance to settle on your body before breathing in a heart of fresh spring jasmine and a base of vanilla, amber and musk. Sure, it&rsquo;s an outrageous sensory indulgence, but do you deserve anything less? it was envisioned by designers, The One is a fragrance for an exceptional woman who instantly draws attention, not only with her looks, but also with her manners, pose and inner world. This fragrance, like all of the fragrances of D&amp;G house, is a `fragrance with character`, special and alluring. Its oriental floral-fruity composition is very warm and sensual with powdery vanilla trace. The color of the fragrance perfectly matches its tone. The composition opens with softly fresh mandarin, bergamot, litchi and peach. The heart is thin and balmy, with the notes of jasmine, lily of the valley and white lily which graciously intertwine with the fruity touch of plum. The woodsy-powdery base is created of vetiver root, amber, musk and vanilla.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 08:02:15', 1, 0, '2017-02-02 17:59:15'),
(839, 0, 62, 0, 0, 'PRO-839', 'Jeju Volcanic Pore Clay Mask ', 'jeju-volcanic-pore-clay-mask-original-title.jpg', '3-in-1: Removes Sebum + Brightens Skin + Treats Blemishes! Soothing and Moisturizing\r\n\r\nGreat absorption of sebum thanks to Jeju volcanic clay!\r\nClean Jeju volcanic ingredients, made from hardened lava, deeply cleanse pores to purify your skin.\r\n', '<p>1. Amazing absorption of sebum and impurities<br />\r\nThe fine, porous structure of Jeju volcanic clay strongly absorbs sebum inside pores.<br />\r\nRemove impurities and give your skin a clear and complete look.<br />\r\n<br />\r\n2. Creates good conditions for skin and makeup<br />\r\nOur clay mask, containing volcanic scoria from Jeju, absorbs sebum and impurities to create clean skin. It delivers minerals deep inside your skin, brightens and clarifies your skin tone, and creates an ideal texture.<br />\r\n<br />\r\n*Super volcanic clay vs. Original volcanic clay<br />\r\n- Super volcanic pore clay mask: Great for treating pores!<br />\r\n- Volcanic pore clay mask (Original): Great for controlling sebum!</p>\r\n\r\n<p>What else you need to know</p>\r\n\r\n<p>Free from: mineral oil, animal-originated ingredients, artificial fragrances, imidazolidinyl urea</p>\r\n\r\n<p>How to use</p>\r\n\r\n<p>After washing your face and applying toner, gently smoothen the product over your entire face. Avoid using the product on your eye and lip areas. Rinse off the mask with lukewarm water after 15 minutes. (Use 1-2 times per week)</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 09:02:57', 1, 0, '2017-02-02 18:06:57'),
(840, 0, 62, 0, 0, 'PRO-840', 'Secret key Snow White Whitening Milky Pack Mask for Face and Body', 'Snow-White-Milky-Pack-3.jpg', 'Mark the skin immediately, a mixture of milk, add a smooth surface, the need for urgent skin \r\n• Skin like a princess, Snow White \r\n• For coating is 20-30 then wash out the white insert instantly \r\n• The skin available delicate and sensitive \r\n', '<p>Description</p>\r\n\r\n<ul>\r\n	<li>Niacinamide Contained</li>\r\n	<li>Natural Looking Brightening Effect from Face to Body!</li>\r\n</ul>\r\n\r\n<p>Just apply and wash out, and Whitening Pack will brighten you complexion. Its quick absorption will not make it rub off on clothes, and its smooth texture will make application very easy. Whitening agent niacinamide will multiply the whitening effects. It will provide moisture to keep skin soft and relieve irritated skin. Your skin will look most natural and brilliant, making you look more beautiful. Your skin will look and feel brighter with continued use.</p>\r\n\r\n<h3><strong>Suggested Use</strong></h3>\r\n\r\n<p>Wash the areas you want to apply the product on then apply over the said areas and rub in a massaging motion.</p>\r\n\r\n<p>Leave on for 2-3 minutes then cleanse with warm water without rubbing.</p>\r\n\r\n<p>Gently tap the skin while drying for milky-white skin.</p>\r\n\r\n<h3><strong>Other Ingredients</strong></h3>\r\n\r\n<p>Titanium dioxide, sodium hyaluronic acid, niacinamide, sorbitan rate, ceresin, methylparaben, purified water, spices, cyclopentasiloxane cyclohexanone siloxane, dimethicone, cyclopentasiloxane, butylene glycol, not chilpi / p fiji -10 /dimethicone cross 1 dimethicone, penta-cycle annals sandi the chicon vinyl menu polymer, dimethyl siloxane.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 09:02:47', 1, 0, '2017-02-02 18:13:47'),
(841, 0, 62, 0, 0, 'PRO-841', 'TONYMOLY Floria Brightening Peeling Gel ', 'Screen_Shot_2014-12-21_at_4_47_31_PM2.png', '', '<p>Treat dead skin giving bright and clear flowery soft skin texture.&nbsp;</p>\r\n\r\n<p>&nbsp;Gommage peeling removing dead skin and impurities giving refreshment.&nbsp;</p>\r\n\r\n<p>&nbsp;Fresh moisture gel type with no irritation scrub, but only moisturizing texture.&nbsp;</p>\r\n\r\n<p>&nbsp;[5 non additive] Paraben, Mineral oil, Benzophenone, Triethanoleamine, Tar color</p>\r\n\r\n<ul>\r\n	<li>How to use :&nbsp;Apply right amount onto face massage, rinse off with lukewarm water.</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 09:02:48', 1, 0, '2017-02-02 18:25:48'),
(842, 0, 62, 0, 0, 'PRO-842', 'Secret key Snow White Whitening Milky Cream', 'Koreal-Secret-Key-Snow-White-Milky-Pack-200g-Snow-White-Cream-50g-Lightening1.jpg', '', '<p>Description</p>\r\n\r\n<ul>\r\n	<li>Niacinamide Contained</li>\r\n	<li>It is Whitening Cream for Bright Skin Tone</li>\r\n</ul>\r\n\r\n<p>Provides healthy complexion for dull or makeup-less skin for bright and luminous look. Applies lightly on skin without oily or sticky sensation, for soft and lustrous skin. Also, whitening agent niacinamide suppresses the formation of melanin, for gorgeous skin tone. Soft moisture is delivered deep into skin for energetic, resilient skin. In place of thick base makeup, just use Snow White Princess Cream for beautiful skin. It&#39;s all-in-one makeup that needs no other. It will adhere closely to sebum to prevent oiliness, making the need for makeup retouching not as frequent. Also, it prevents pores from enlarging due to sebum, for baby-like skin. Natural amino acid moisturizer betaine extracted from sugar beets provides suppleness and resilience to skin.</p>\r\n\r\n<p>Suggested Use</p>\r\n\r\n<p>Step 1: Use a spatula to take an appropriate amount.</p>\r\n\r\n<p>Step 2: Or take an appropriate amount on to back of your hand.</p>\r\n\r\n<p>Step 3: Spread-apply the cream along with your skin texture and gently tap on the face for absorption.</p>\r\n\r\n<h3><strong>Other Ingredients</strong></h3>\r\n\r\n<p>Water, cyclopentasiloxane cyclohexa siloxane, propylene glycol, glycerin, titanium dioxide, paraffin, dimethyl siloxane, cetearyl alcohol, glyceryl stearate, PEG-100 stearate, dimethicone, beeswax, niacinamide, carbomer, stearic acid, methylparaben, triethanolamine, disodium EDTA, fragrance.</p>\r\n\r\n<p>Free of artificial coloring, mineral oil, benzophenone, phenoxyethanol, and animal oils. By excluding these harmful components, it can be used for highly sensitive skins.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 09:02:09', 1, 0, '2017-02-02 18:29:09'),
(843, 0, 62, 0, 0, 'PRO-843', 'The Face Shop Jeju Aloe 99% Fresh Soothing Gel', '2015-08-05-16-01-13_photo1.jpg', '', '<p>Description</p>\r\n\r\n<ul>\r\n	<li>All Skin Type</li>\r\n	<li>Moisturizer</li>\r\n</ul>\r\n\r\n<p>Enriched with natural aloe vera! This soothing gel with California aloe vera can be used to mildly moisturize various parts of the body such as the face, arms, legs, and hair.</p>\r\n\r\n<p><strong>Skin- Firming and Moisturizing Effects </strong></p>\r\n\r\n<p>The Fast absorbing gel provides a refreshing feel to skin.</p>\r\n\r\n<p><strong>Soothing and Moisturizing Effects</strong></p>\r\n\r\n<p>Provides soothing and moisturizing effects to the sensitive skin.</p>\r\n\r\n<p><strong>Makes the skin healthy</strong></p>\r\n\r\n<p>Keeps the surface of the face and body health.</p>\r\n\r\n<p><strong>Have a refreshing and moisturizing summer with the original Aloe Vera Soothing Gel!</strong></p>\r\n\r\n<p>This soothing gel which contains California CCOF-certified organic Aloe Vera, is mild to the skin and can be used to moisturize the face, arms, legs and hair.</p>\r\n\r\n<p>This soothing gel contains 92% Aloe Vera Extract, which moisturizes the skin quickly without leaving a sticky feeling behind.</p>\r\n\r\n<p><strong>Can you tell me about the Aloe Vera extract?</strong></p>\r\n\r\n<p>The vitamins from the Aloe Vera extract, such as vitamin E, C and other minerals , keep the skin moisturized and protect the skin from UV rays. The fresh Aloe Vera ingredient absorbs quickly into the skin without leaving any sticky residue behind.</p>\r\n\r\n<h3><strong>Suggested Use</strong></h3>\r\n\r\n<p>Apply an appropriate amount to dry, sensitive parts of the face and body often for the best results.</p>\r\n\r\n<h3><strong>Other Ingredients</strong></h3>\r\n\r\n<p>Aloe barbadensis leaf extract (92%), alcohol, glyceryl polyacrylate, dipropylene glycol, butylene glycol, glycerin, propylene glycol 1,2-hexanediol polygutamic acid, betaine, sodium hyaluronate, calendula officinalis flower extract, mentha virdis (spearmint) extract, melissa officinalis extract, carbomer, peg-60 hydrogenated castor oil, triethanolamine, phenoxyethanol, water, parfum, disodium edta</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-02 09:02:25', 1, 0, '2017-02-02 18:37:25'),
(844, 0, 75, 0, 0, 'PRO-844', 'Modern Muse Le Rouge 100 ml', '14484938226981.jpg', 'Be daring. Be an inspiration.  Experience the fragrance that captures your glamour, your sophistication, your bravado\r\n', '<p>A sexy, provocative contrast of two distinctively different accords&mdash;rich roses awakened by ripe fruit, with a seductive velvet creme accord&mdash;provide an intriguing dual impression. It&#39;s a true innovation in fragrance design, as complex and fascinating as the woman who inspires it.</p>\r\n\r\n<p><!-- attribute 2 --></p>\r\n\r\n<p>The Inspiration</p>\r\n\r\n<p>Like the award-winning original Modern Muse and Modern Muse Chic, Modern Muse Le Rouge was inspired by the complexity of a modern woman. Who is Modern Muse Le Rouge? She&#39;s the captivating woman who makes a bold, colorful statement without saying a word. Her mantra is never go unnoticed. Daring, fearless, and seductive. When she wants to make a show-stopping impression, she wears the ultimate red&mdash;Le Rouge.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-03 02:02:21', 1, 0, '2017-02-03 11:00:21'),
(845, 0, 74, 0, 0, 'PRO-845', 'Bvlgari Man Black Orient Eau de Parfum 100 ml', '783320971082_t1_1200x1200.jpg', 'BVLGARI MAN BLACK ORIENT is a rare oriental fragrance, highly sensual and intensely elegant. A very wild juice with a highly recognizable imprint, enveloping and powerful. A bold olfactory pyramid carved like a black diamond, consisting of beautiful and p', '<p>After the success of Bvlgari Man In Black fragrance from 2014, presented as a flanker of the original Bvlgari Man from 2010, Bvlgari launches its two new editions in 2016. First came Bvlgari Man Black Cologne, an unusual summer, oriental-fresh Eau de Toilette, and that is now followed by <strong>Bvlgari Man Black Orient</strong>, a lush oriental Eau de Parfum for the fall season. The fragrances are developed by <a href="http://www.fragrantica.com/noses/Alberto_Morillas.html"><strong>Alberto Morillas</strong></a>.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-03 02:02:27', 1, 0, '2017-02-03 11:04:27'),
(846, 0, 75, 0, 0, 'PRO-846', 'Carolina Herrera Good Girl 80 ml', 'o_44147.jpg', 'Give a girl the right shoes and she can conquer the world. Such was the inspiration for GOOD GIRL. The result: a uniquely designed bottle in the shape of a stiletto. The beauty of Couture combined with a highly innovative savoir faire as only the House Of', '<p><a href="http://www.fragrantica.com/designers/Carolina-Herrera.html"><strong>Carolina Herrera</strong></a> announces the release of a new women&#39;s fragrance in September 2016. The new, sexy oriental fragrance is ironically named <a href="http://www.fragrantica.com/perfume/Carolina-Herrera/Good-Girl-39681.html"><strong>Good Girl</strong></a> with the message <strong>&quot;It&#39;s so good to be bad!&quot; </strong>(<em>#goodtobebad</em>).<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-03 02:02:06', 1, 0, '2017-02-03 11:10:06'),
(847, 0, 62, 0, 0, 'PRO-847', 'INNISFREE New Super Volcanic Pore Clay Mask 100ml', 'pore.jpg', 'Innisfree Super Volcanic Pore Clay Mask \r\n\r\nBenefits\r\n\r\nPore Squeezing\r\nSebum Control\r\nExfoliating\r\nDeep Cleansing\r\nHealthy Face Skin Tone\r\nCooling effects\r\n', '<p><strong>Feature</strong><br />\r\n1. Upgraded volcanic clay capsule removes excessive sebum out of pores.<br />\r\n&nbsp;2. Cooling &amp; refreshing clay mask.<br />\r\n&nbsp;3. As capsule pops on the skin while massasing with it, it physically removes debris and dead skin cells pilled on the skin.<br />\r\n&nbsp;4. AHA chemically smoothes skin without irritation.<br />\r\n&nbsp;5. Powerful sebum absorption and cooling effect makes enlarged pores squeezed.<br />\r\n&nbsp;6. Non mineral oil, Non animal oriented content, Non synthetic fragrance, Non imidazolidinyl urea.</p>\r\n\r\n<p><strong>Volume</strong><br />\r\n100ml</p>\r\n\r\n<p><strong>How to use</strong><br />\r\n1. After washing face, apply volcanic clay on face avoiding mouth and eye near area, massage gently in circular motion as breaking capsules with finger.<br />\r\n&nbsp;2. After 10 minute, wash it off thoroughly as gently massaging with fingers.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '10', NULL, NULL, 1, '2017-02-08 06:02:12', 1, 0, '2017-02-08 15:35:12'),
(848, 0, 62, 0, 0, 'PRO-848', 'Rice Mask Wash Off ', 'ricemaskwashoff.jpg', 'SKINFOOD''s Rice Brightening Cleansing skin care line is a brightening line containing Odae rice water. Odae rice is expensive and valued because Cheorwon County is in the Demilitarized Zone, the space in between North and South Korea, and is lauded to hav', '<p><strong>How to Use:</strong></p>\r\n\r\n<p>After cleansing, massage gently into damp skin, or mix with water/cosmetic water and apply. Avoid skin around the eyes and lips. After 10-15 minutes, rinse with lukewarm water.</p>\r\n\r\n<p><strong>Ingredients:</strong></p>\r\n\r\n<p>Water, Cetyl Ethylhexanoate, Caprylic/Capric Triglyceride, Cyclopentasiloxane, Cetyl Alcohol, Glycerin, Propylene Glycol, Oryza Sativa (Rice) Bran Water, Stearic Acid, Polysorbate 80, Hydrogenated Jojoba Oil, Glyceryl Stearate, Peg-100 Stearate, Sorbitan Stearate, Carbomer, Dimethicone, Triethanolamine, Sodium Acrylates Copolymer, Sucrose Cocoate, Tocopheryl Acetate, Disodium Edta, Methylparaben, Imidazolidinyl Urea, Butylparaben, Fragrance.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-08 06:02:17', 1, 0, '2017-02-08 15:41:17'),
(849, 0, 62, 0, 0, 'PRO-849', 'Etude House Face Blur  SPF15/PA+ 35g', 'etude-house-beauty-shot-face-blur-poster.jpg', 'Ever wished there was a real-life Photoshop button to create that soft-focus effect on your face? Well, now you can with Beauty Shot Face Blur SPF15/PA+ from ETUDE HOUSE!\r\n\r\nThis multi-purpose cream helps smooth over your complexion and create the appeara', '<p><strong>Key Product Characteristics</strong></p>\r\n\r\n<p>So what makes Beauty Shot Face Blur SPF15/PA+ so great?</p>\r\n\r\n<p>First, its lightweight formula consists of the terrific Airy Skin Powder, to allow your skin to breathe comfortably without any heavy feeling. This is in stark contrast to other cakey makeup primers, which are filled with Silicone Gel, which makes your skin feel &ldquo;weighted down&rdquo;.</p>\r\n\r\n<p>Second, this hardworking product also helps soften and smooth skin texture, blurs out any bumps or enlarged pores, and brightens your complexion. Finally, Beauty Shot Face Blur comes enhanced with the Sebum Control Effect, which controls the production of sebum for long-lasting satin-smooth skin.</p>\r\n\r\n<p><strong>Key Product Ingredients</strong></p>\r\n\r\n<p>Beauty Shot Face Blur SPF15/PA+ is an amalgamation of precious powders to help you achieve that breathtaking radiance. Apart from Airy Skin Powder, the product is also formulated with Baby Pixel Powder, which comprises extremely fine particles to help smooth out your skin texture; Cover Powder to lightly correct skin blemishes; and the highly transparent Plate Powder, which helps maintain a bright complexion. It also comes with Amati Pearl TM, which comprises fine glow particles that are spread evenly and firmly across your skin.</p>\r\n\r\n<p><strong>How To Use</strong></p>\r\n\r\n<ul>\r\n	<li>Start by dispensing your desired amount and apply in a thin, even layer across your face.</li>\r\n	<li>Use your fingertips to apply product in a circular motion, and lightly press to adhere.</li>\r\n	<li>Next, apply an extra-thin layer on any concern areas such as enlarged pores, bumps, or fine lines. For perfect coverage, tap and lightly press ETUDE HOUSE Precious Mineral Any Cushion SPF50+/PA+++ with the Cushion Air Puff.</li>\r\n</ul>\r\n\r\n<p>There you go &ndash; you&rsquo;re now ready for your close-up!</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-08 06:02:50', 1, 0, '2017-02-08 15:50:50'),
(850, 0, 62, 0, 0, 'PRO-850', 'The face Shop Photo Blur Effect (SPF37/PA++) 40g', '123685.png', 'Get that perfect Photoshop effect with Face Shop Photo Blur\r\nGet spotless\r\nGet poreless', '<p><strong>Feature</strong><br />\r\n1. Resilient skin expression BB cream.</p>\r\n\r\n<p>2. A #Selfie BB cream that expresses clean and bright, spot-less and pore-less skin by blurring effect.</p>\r\n\r\n<p>Also expresses smooth resilient skin.</p>\r\n\r\n<p>3. Clean and bright effect expression.<br />\r\n4. Expresses smooth and resilient, spot-less skin without Photoshop by blurring effect.<br />\r\n5. Extra fine particle blur powder smoothly covers pore, skin bump and fine wrinkles without crumbling.<br />\r\n6. Completes smooth and resilient skin as if it is photoshopped by expressing clean and bright skin tone.<br />\r\n7. Minimizes pore &amp; sebum care and glossiness, increased gorgeousness BB cream.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-08 06:02:43', 1, 0, '2017-02-08 15:59:43'),
(851, 0, 93, 0, 0, 'PRO-851', 'ETUDE HOUSE Tint My Brows Gel 5g 3 Color / 2016 New', '16649383_1814849125441108_9112556089355174683_n.jpg', 'Sold Individually\r\n\r\nFeature\r\n New-concept eyebrow gel tint that makes eyebrow makeup last longa after removing the tint.\r\n\r\n Color Option\r\n#Brown\r\n#Light Brown\r\n#Gray Brown\r\n\r\n Volume\r\n 5g\r\n', '<p>How to use<br />\r\n1. After trimming the eyebrows without applying skincare product or makeup, apply a liberal amount according to the desired shape of the eyebrow.<br />\r\n(Apply a liberal amount to remove the pack easily.)<br />\r\n2. Dry for at least 2 hours. For stronger coloration, apply before going to bed at night and remove the next morning.<br />\r\n3. After drying completely, remove slowly starting from the tail of the eyebrow.<br />\r\n(Do not remove the pack forcibly since it may pull out the eyebrow.)<br />\r\n4. Do not use a cleansing product (product with detergency) or apply force on the eyebrow area within 24 hours of using the product.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-17 11:02:10', 1, 0, '2017-02-17 08:52:16'),
(852, 0, 62, 0, 0, 'PRO-852', 'ETUDE HOUSE Precious Mineral BB Cream Blooming Fit (SPF30/PA++) 60g ', 'ETU-41079-1.jpg', 'Feature\r\n1. All skin type\r\n 2. Contains pearl ingredients\r\n 3. Whitening + Wrinkle improvement + UV protection (SPF30/PA++)\r\n 4. Control sebum to care the darkening, make skin tone bright.\r\n 5. Even though spread many times, will not be erased, make your ', '<p><strong>Volume</strong><br />\r\n60g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\nAfter base makeup,applay proper amount of cream and spread well,Pat to finish.<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-19 04:02:13', 1, 0, '2017-05-23 18:15:07'),
(853, 0, 62, 0, 0, 'PRO-853', 'ETUDE HOUSE Wonder Pore Clearing Emulsion 150ml', 'big_1283326506554c6eb777b51.jpg', 'Etude House Wonder Pore Clearing Emulsion 150ml\r\n\r\n/ Sebum control / Oily skin\r\n', '<p><strong>Feature</strong><br />\r\n1. Wonder pore ultra solution for overall concerns about pores.<br />\r\n2. Light weight and refreshing emulsion that arranges skin texture.<br />\r\n3. Subacidity PH pore treatment.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n150ml<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\nApply appropriate amount on the skin and smooth over it.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-19 04:02:06', 1, 0, '2017-02-19 13:55:06'),
(854, 0, 62, 0, 0, 'PRO-854', 'ETUDE HOUSE Wonder Pore Black Mask Sheet 21ml ', 'big_2081411797554c6e55d007c.jpg', 'Etude House Wonder Pore Black Mask Sheet 21ml \r\n\r\n/ Sebum control / Oily skin\r\n\r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Wonder pore ultra solution for overall concerns about pores.<br />\r\n2. As it control excessive sebum, it makes pore clean.<br />\r\n3. Efficiently removing bodily wastes and sebum stuck in the pores.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n21ml * 3pcs<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. After facial wash, put it on the face and align it with nose and mouth.<br />\r\n2. After 15~20 minutes, pat gently for better absorption.<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-19 04:02:57', 1, 0, '2017-05-16 08:54:34'),
(855, 0, 94, 0, 0, 'PRO-855', 'Zip-Front Latex Waist Cincher Corset Adjustable Straps Bodysuit ', 'Everbellus_Women1.jpg', 'Material: 96%cotton + 4%spandex', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Made of high quality and high elastic latex, durable and good stretch.</li>\r\n	<li>Adjustable straps can be adjusted to fit you perfectly and make you be in a comfortable status. Zipper and hooks closure front and lace decorated on the hem.</li>\r\n	<li>This latex bodysuit makes you loose inches effectively. Firm control can shape your figures very wel. Comfortable for all-day wearing. Can be used for fitness activities.</li>\r\n	<li>100% Everbellus brand. Everbellus is a registered USPTO trademark. Trademark No. 86778926</li>\r\n</ul>\r\n\r\n<p>This bodysuit can raise your bustline, flatten your belly and shape your waist and derriere. It helps give you a smoother and curvier looking figure.<br />\r\nOpen-bust design allows you to wear your own bra, so you can get the fit and coverage you want from your bustline with any outfit. Zip closure in the central front for your convenience.&nbsp; This shapewear is not just designed for fitness activities. It can be used either as an everyday shaper or as a postpartum girdle after pregnancy.</p>\r\n\r\n<p>Sizing guide</p>\r\n\r\n<p>XXS for Waist 22&quot;-23&quot;<br />\r\nXS for Waist 24&quot;-25&quot;<br />\r\nS for Waist 26&quot;-27&quot;<br />\r\nM for Waist 28&quot;-29&quot;<br />\r\nL for Waist 30&quot;-31&quot;<br />\r\nXL for Waist 32&quot;-33&quot;<br />\r\n2XL for Waist 34&quot;-35&quot;<br />\r\n3XL for Waist 36&quot;-37&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-21 07:02:21', 1, 0, '2017-02-21 16:21:21'),
(856, 0, 62, 0, 0, 'PRO-856', 'MIZON Let Me Out Byebye Black Head 3-Setp Kit 35g+35ml+30ml ', 'korean1234.jpg', 'MIZON Let Me Out Byebye Black Head 3-Setp Kit 35g+35ml+30ml ', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>Open Your Pore Heating Gel 35g (1.23 oz.) + Peel off Blackhead out Pack 35ml (1.18 fl.oz.) + Closing Pore Cooling Serum 30ml (1.01 fl.oz.)</li>\r\n	<li>Simple 3-set kit to say goodbye to blackheads</li>\r\n	<li>Gets rid of blackheads, whiteheads, sebum, and clogged pores</li>\r\n	<li>Contains charcoal for blackhead removal</li>\r\n	<li>Part of Let Me Out Blackhead Line</li>\r\n</ul>\r\n\r\n<p><strong>Description:</strong><br />\r\nYou need fundamental pore control to firmly eliminate all sebum, whiteheads, and blackheads. Mizon&rsquo;s Let Me Out Bye Bye Black Head 3-Step Kit is an easy 3-step process to say goodbye. The 1st &lsquo;Warming Up&rsquo; stage is Open Your Pore Heating Gel that opens pores and uses sea salt ingredient to help remove dead skin cells. The 2nd &lsquo;Let Me Out&rsquo; stage is Peel Off Blackhead Out Pack that extracts blackheads with charcoal and black garlic extracts and removes sebum and waste with milk protein. The 3rd &lsquo;Let Me In&rsquo; stage is Closing Pore Cooling Serum that soothes, cool, and contracts pores with witch hazel and green tea extract. Say goodbye to blackheads and hello to soft and fair skin&nbsp;<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-21 07:02:13', 1, 0, '2017-02-21 16:35:13'),
(857, 0, 62, 0, 0, 'PRO-857', 'SECRET KEY Black Out Pore Peel-Off Pack 100ml ', 'secretkeypeeloff2.jpg', '', '<p>About the Product</p>\r\n\r\n<ul>\r\n	<li>Black out pore peel off pack closely adheres onto curvy areas that are difficult to care and removes inpurities regardless of the size and depth.</li>\r\n	<li>Transforming gel-type formula that turns into film-type texture without irritation or trace.</li>\r\n	<li>Sebum care: Cares the excessive sebum of skin to adjust oil-water balance of skin.</li>\r\n	<li>Pore care: Pulls out all the whiteheads and blackheads to make pores clear.</li>\r\n	<li>Exfoliation: Removes all dead skin cells of skin, from big one to tiny one, to improve skin texture.</li>\r\n</ul>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-21 07:02:00', 1, 0, '2017-02-21 16:39:00'),
(858, 0, 78, 0, 0, 'PRO-858', 'SKIN79 Injection Cushion BB SPF50 free refill 14 g', 'InjectionCushionSkin79_7.jpg', '[SKIN79] Injection Cushion BB (SPF50+/PA+++) \r\n\r\n\r\n\r\n14g*2ea 2 Color / High adhesion\r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Completes extremely strong moisture cover by filling cover and moisture supplement in a pocket.<br />\r\n2. Perfectly cover with visible flaws and marks.<br />\r\n3. Injection cushion to show the crazy persistence tightly attached to skin.<br />\r\n4. Every time you use the contents in a pocket-shaped pocket, moist and fresh cherries.<br />\r\n<br />\r\n<strong>Color Option</strong><br />\r\n<br />\r\n#23 Natural Beige<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\nProduct 14g + Refill 14g + Extra Puff 1ea<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\nPuff Rinse lightly with ingredients and pat them on your face.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2017-02-27 12:02:20', 1, 0, '2017-03-14 08:49:43'),
(859, 0, 93, 0, 0, 'PRO-859', 'APRILSKIN Magic Snow Cushion Black 2.0 Version ', '9717443_f2f142c0-0457-4528-a1c4-b88b322f914e.jpg', '[APRILSKIN] Magic Snow Cushion Black 2.0 Version \r\n\r\n(SPF50+/PA+++) 15g 2 Color', '<p><strong>Feature</strong><br />\r\n1. Infused with 45% water-based to provide moisturizing vocerage. Long-lasting<br />\r\nMagic Snow Cushion gives a skin smooth, flawless and velvety complexion.<br />\r\n2. Foundation fluid is kept in mochi-type sponge bag only delivers adequate amount of<br />\r\nfoundation when cushion is pressed with a puff.<br />\r\nIt allows foundation fluid intact, keeping the contents in hygienic way.<br />\r\n3. Patened triple protection technique to ensure airtight and maintain moisturizing texture of<br />\r\nthe product and prevent any leakage.<br />\r\nClosing the outer lid automatically closes inner lid th enhance airtight and maintain hydration<br />\r\nin product.<br />\r\n<br />\r\n<strong>Color Option</strong><br />\r\n<br />\r\n#23 Natural Beige<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n15g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Remove translucent film from the mirror.<br />\r\n2. Open inner lid and remove the proctection film.<br />\r\n3. Gently press cushion with a provided puff to release the prefect amount of foundation.<br />\r\n4. Pat evenly on skin. Light and thin layer is adequate to cover.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2017-02-27 01:02:26', 1, 0, '2017-03-06 14:21:30'),
