(861, 0, 62, 0, 0, 'PRO-861', 'MIZON Collagen 100 30ml ', 'mizon.jpg', 'A must-have for anyone looking to help firm skin. Formulated with a generous helping of 90% marine collagen that firm hydrate, and plump the skin. Ideal for those looking for anti-aging products, as well as hydration. Appropriate for all skin types. \r\n', '<p>Ingredients</p>\r\n\r\n<p>Collagen(water/hydrolyzed Collagen), Butylene Glycol, Sodium Hyaluronate, Butylene Glycol, Sclerotium Gum (and) Phenoxyethanol (and) Water, Trehalose, Water(and)glycerine(and)palmitoyl Tripeptide-3, Water(and)acetyl, Hexapeptide-8 (and) Phenoxyethanol(and)methylparaben (and) Propylparaben(and)ethylparaben (and) Butylparaben (and) Isobutylparaben, Xanthan Gum, Peg-60 Hydrogenated Castor Oil, Water (and) Propylene Glycol (and) Hydrolyzed Extensin, Allantoin, Panthenol, 1,2-octanediol (and) Ethylhexylglycerin (and) Tropolone, Niacinamide, Disodium Edta</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>How to Use</p>\r\n\r\n<p>Apply after cleanser, toner, and essence. Pat onto skin in upward and outward motions until fully absorbed. Follow up with moisturizer.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-02-27 01:02:18', 1, 0, '2017-02-27 10:29:18'),
