(865, 0, 62, 0, 0, 'PRO-865', 'LANEIGE Lip Sleeping Mask 3g * 1pcs ', 'detail.jpg', '[LANEIGE] Lip Sleeping Mask 3g * 1pcs / Sour and sweet \r\n\r\nBerry incense\r\n', '<p><strong>Feature</strong><br />\r\n1. The dry, crunchy lips are rich in vitamin C and antioxidants, and gives smooth and bouncy lips<br />\r\nthat are full of various berry components.<br />\r\n2. Laneige&#39;s proprietary moisturizing technology helps to absorb the effects of hydro-ion mineral water,<br />\r\nevening primrose root extract, and Hunza apricot extract in the dense beta-glucan moisturizing membrane<br />\r\n(network) for up to 8 hours of sleep.<br />\r\n3. It is a berry-flavored product reminiscent of sweet and sour berry.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\nSample 3g * 1pcs<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Before you fall asleep, apply it with a dedicated spatula.<br />\r\n2. The next morning, gently wipe off with a tissue or a cotton swab.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 2, '2017-03-05 08:03:34', 1, 0, '2017-05-14 07:09:56'),
(866, 0, 62, 0, 0, 'PRO-866', 'APRILSKIN Magic Snow Cushion Black 2.0 Version SPF50+', '9717443_f2f142c0-0457-4528-a1c4-b88b322f914e1.jpg', '[APRILSKIN] Magic Snow Cushion Black 2.0 Version \r\n\r\n(SPF50+/PA+++) 15g \r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Infused with 45% water-based to provide moisturizing vocerage. Long-lasting<br />\r\nMagic Snow Cushion gives a skin smooth, flawless and velvety complexion.<br />\r\n2. Foundation fluid is kept in mochi-type sponge bag only delivers adequate amount of<br />\r\nfoundation when cushion is pressed with a puff.<br />\r\nIt allows foundation fluid intact, keeping the contents in hygienic way.<br />\r\n3. Patened triple protection technique to ensure airtight and maintain moisturizing texture of<br />\r\nthe product and prevent any leakage.<br />\r\nClosing the outer lid automatically closes inner lid th enhance airtight and maintain hydration<br />\r\nin product.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Volume</strong><br />\r\n15g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Remove translucent film from the mirror.<br />\r\n2. Open inner lid and remove the proctection film.<br />\r\n3. Gently press cushion with a provided puff to release the prefect amount of foundation.<br />\r\n4. Pat evenly on skin. Light and thin layer is adequate to cover.<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-06 05:03:09', 1, 0, '2017-03-06 17:51:15');
