(867, 0, 93, 0, 0, 'PRO-867', 'LANEIGE BB Cushion Pore Control - 1pack 15g+Refill, SPF50+ PA+++ ', 'color3.jpg', 'LANEIGE BB Cushion Pore Control - 1pack (15g+Refill, SPF50+ PA+++) (New)\r\n\r\n\r\n\r\n[LANEIGE]\r\n\r\nBB Cushion Pore Control - 1pack (15g+Refill, SPF50+ PA+++) (New)\r\n', '<p>The skin tends to look dull in one hour<br />\r\nafter applying makeup due to excessive sebum and sweat!<br />\r\nThe refreshing BB Cushion keeps the skin looking smooth,<br />\r\nclean and matte all day long by controlling excessive sebum while maintaining moisture.<br />\r\nMore effective two-step oil control system!<br />\r\n&#39;Semi-matt BB Cushion&#39; makes the skin look fresh, feel moisturized for long hours.</p>\r\n\r\n<p><strong>[How to use]</strong></p>\r\n\r\n<p>Apply onto puff and smooth along the texture of skin.<br />\r\nThen, pat to increase adherence.<br />\r\nApply another layer to improve coverage.<br />\r\nIf there is no more content after you press the cushion with your finger,<br />\r\nit means thet the product is finished.<br />\r\nReplace with a refill.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>- Options :</strong></p>\r\n\r\n<p>#11 Porcelain<br />\r\n#11C Cool Porcelain<br />\r\n#13 Ivory<br />\r\n#13C Cool Ivory<br />\r\n#21 Beige<br />\r\n#21C Cool Beige<br />\r\n#23 Sand<br />\r\n#23C Cool Sand</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-06 08:03:42', 1, 0, '2017-03-22 10:06:18'),
(868, 0, 93, 0, 0, 'PRO-868', 'THE FACE SHOP 24HR Full Stay CC SPF50 ', '24hr_41.jpg', 'The Face Shop 2015 New 24HR Full Stay CC\r\n\r\n(SPF50/PA+++) 16g  / Long lasting\r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Triple effect of Moisturizing + Coverage + Good fitting.<br />\r\n2. Long lasting and caky-proof coverage makeup.<br />\r\n3. As brightening skin, it revives skin natural radiance from deep within.<br />\r\n4. With its good fitting, it gives smooth &amp; sleek face skin look.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n16g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Open the pact and pump 1-2 times.<br />\r\n2. Apply on the face and pat gently on overall face.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-06 09:03:15', 1, 0, '2017-03-06 18:16:34'),
(869, 0, 62, 0, 0, 'PRO-869', 'MIZON Snail Repair Intensive Ampoule plus Cream ', '(KGrHqN,!lMFG7cb6cjhBRvnQCzWuw~~60_35.jpg', '[MIZON] Snail Repair Intensive Ampoule Special Edition \r\n\r\n(Ampoule + Cream)\r\n', '<p><strong>Feature</strong><br />\r\n* Snail Repair Intensive Ampoule<br />\r\n1. 80% of snail secretion extract &amp; E.G.F. 80% of snail secretion extract and E.G.F reinforce skin regeneration<br />\r\nwhile caring for acne scars, dry skin and more multiple skin problems.<br />\r\n2. Sticky texture. The formula is more thick and elastic because of the rich snail secretion extract concentration,<br />\r\nwhich delivers nutrition into skin more effectively.<br />\r\n3. Certified for Wrinkle care. Wrinkle care effect is certified. Peptides and 5 kinds of vitamins improve skin elasticity.<br />\r\n4. Protecting &amp; soothing &amp; moisturizing. Barberry root extract prevents skin troubles and helps to remove acne scars.<br />\r\nHyaluronic acid moisturizes skin effectively. 5 kinds of vitamins and cacao tree extract nourish skin.<br />\r\n5. Free of artificial coloring, frgrance, and paraben. Cornus fruit and pomegranate extract soothe sensitive<br />\r\nskin and protect skin from harmful factors. The formula is free of artificial coloring, frgrance, and paraben,<br />\r\nwhich is safe for sensitive skin.<br />\r\n<br />\r\n* All In One Snail Repair Cream<br />\r\n1. Outstanding skin regenerating effect &ndash; 92% snail secretion filtrate. Mucin from snail slime helps<br />\r\nskin regeneration.<br />\r\n2. Fine wrinkle care by adenosine &amp; peptide , certified for anti-aging. Adenosin and peptide certified<br />\r\nfor anti-aging give a skin firming effect.<br />\r\n3. Blemish care. Improves acne scars and blemishes during continual use.<br />\r\n4. Pore care. Beta-glucan, peptide, &amp; green tea extract add a synergy effect to the snail slime extract&rsquo;s<br />\r\nskin firming effect, helping to tighten large pores by improving skin elasticity.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Volume</strong><br />\r\nSnail Repair Intensive Ampoule 30ml<br />\r\nAll In One Snail Repair Cream 30ml (Promotional Item)<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n* Snail Repair Intensive Ampoule<br />\r\nApply an appropriate amount onto cleansed face, dabbing for absorption. Use before applying<br />\r\na facial mask pack for the maximized effect.<br />\r\n<br />\r\n* All In One Snail Repair Cream<br />\r\nApply an appropriate amount onto cleansed face, patting until absorbed.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-14 11:03:14', 1, 0, '2017-03-14 08:20:14'),
(870, 0, 62, 0, 0, 'PRO-870', 'SEANTREE Collagen 100 Mask Sheet', '16997841_1825678354358185_421545183520747319_n.jpg', '', '<p>Feature<br />\r\n1. Collagen ingredient strengthens elasticity on skin and gives concentrated care to make tight ...<br />\r\nskin, and plentiful of moisture supplement let you have moisty skin.<br />\r\n2. Hydrolyzed collagen (marine collagen) which is decomposed to make skin absorption useful is<br />\r\ncontained, it grants moisture supplement and elasticity effect at the same time.<br />\r\n3. It is a mask sheet that has enriched essence which enhances elasticity &amp; moisture index, Its<br />\r\nmoistness lasts for long time with just one use.<br />\r\nVolume<br />\r\n20ml<br />\r\n<br />\r\nHow to use<br />\r\n1. Adjust skin texture with toner after wash up.<br />\r\n2. Open up pouch, take out mask and adhere on face centrally.<br />\r\n3. Take a rest for 20 minutes and remove mask.<br />\r\n4. Gently pat for remaining essence on face to absorb.<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-14 11:03:54', 1, 0, '2017-03-14 08:39:54'),
