(872, 0, 62, 0, 0, 'PRO-872', 'ETUDE HOUSE Pink Vital Water Special Trial Kit [ Toner+Serum+Emulsion+Cream]', '17155771_1829467260645961_4281118112980127623_n.jpg', '"[ETUDE HOUSE] Pink Vital Water Special Trial Kit [ Toner+Serum+Emulsion+Cream]\r\n', '<p><strong>Feature</strong><br />\r\n* Pink Vital Water Facial Toner<br />\r\n1. Moisture toner for fresh skin.<br />\r\n2. Contains 72.65% of Pink Peach Water&trade;.<br />\r\n3. Long lasting energetic skin with Vitamin A/C/E and Organic mineral&rsquo;s boosting effect.<br />\r\n<br />\r\n* Pink Vital Water Serum<br />\r\nWater drop moisture formula is smoothly being absorbed into skin with energy.<br />\r\n<br />\r\n* Pink Vital Water Emulsion<br />\r\n1. Soft Milky Formula with Pink Peach Water&trade; and Vitamin A/C/E.<br />\r\n2. Smoothly absorbed Water Emulsion presents a energetic skin.<br />\r\n<br />\r\n* Pink Vital Water Cream<br />\r\n1. Milky cream formula is lightly spread out onto skin.<br />\r\n2. Water Cream for moist and live skin.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\nPink Vital Water Facial Toner 15ml<br />\r\nPink Vital Water Serum 5ml<br />\r\nPink Vital Water Emulsion 15ml<br />\r\nPink Vital Water Cream 10ml<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n* Pink Vital Water Facial Toner<br />\r\nAfter face washing, take appropriate amount and massage onto skin, pat to absorb.<br />\r\n<br />\r\n* Pink Vital Water Serum<br />\r\n1. Apply appropriate amount of product after a toner.<br />\r\n2. Gently pat to absorb any residue.<br />\r\n* Pink Vital Water Emulsion<br />\r\nBefore apply Serum, take appropriate amount onto eyelid, gently spread out. Pat to absorb any residue.<br />\r\n<br />\r\n* Pink Vital Water Cream<br />\r\nAt the end of a skin care step, massage with appropriate amount and tap to absorb.&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-14 11:03:12', 1, 0, '2017-03-14 20:52:12'),
(873, 0, 93, 0, 0, 'PRO-873', 'APRILSKIN Magic Snow Fixing Foundation SPF30/PA++  15g ', '17155872_1832944803631540_5387897865804990131_n.jpg', 'APRILSKIN Magic Snow Fixing Foundation SPF30/PA++  15g \r\n\r\nColor Available:  Natural Beige', '<p><strong>Feature</strong><br />\r\n1. Full matte coverage Magic Snow Fixing Foundation in innovative compact format ensures<br />\r\nperfect complexion and easy touch-up on-the-go.<br />\r\n2. Build in layers for coverage! Second-skin texture that looks just like skin.<br />\r\n3. Sebum control powder keeps makeup fresh all-day long! It delivers perfect complexion<br />\r\nwith matte finish.<br />\r\n4. Innovative mesh netting cushion! Mesh filter ensures even application.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Volume</strong><br />\r\n15g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Remove translucent film from the mirror.<br />\r\n2. Open inner lid and remove the attached film.<br />\r\n3. Gently press cushion to release the perfect amount of foundation on the puff.<br />\r\n4. Lightly pat the puff on skin.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 09:03:34', 1, 0, '2017-03-16 06:58:30'),
