(875, 0, 62, 0, 0, 'PRO-875', 'RIRE All Kill Blackhead Remover Stick 10g ', 'all_kill.jpg', '[RIRE] All Kill Blackhead Remover Stick 10g \r\n\r\n/ Rub it on skin 5 seconds\r\n', '<p><strong>Feature</strong><br />\r\n1. Easy to mamage blackheads, whiteheads and dead skin cells in pores.<br />\r\n2. It helps you have clean and soft skin by removing blackheads whiteheads buried deep in<br />\r\npores and old dead skin cells.<br />\r\n3. All you have to do is rub it on skin like rolling it to remove blackheads, whiteheads and<br />\r\ndead skin cells. And your worry about skin ends!<br />\r\n4. Beacause it contains natural extracts, it hepls skin smooth and gel moisty.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n10g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\nAfter washing a face, rub it on wet nose and chin like massaging and rinse it with water.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 10:03:54', 1, 0, '2017-03-16 07:02:54'),
(876, 0, 62, 0, 0, 'PRO-876', 'Dr.Jart+ V7 Radiance Serum 50ml ', 'list_l1573077256558a5b2e79c0f.jpg', 'Dr.Jart+ V7 Radiance Serum 50ml\r\n\r\n/ Radiance improvement treatment\r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Highly concentrated vitamin serum impriving skin radiance.<br />\r\n2. As its radiance capsules pop on the skin, it delivers its content deep into skin.<br />\r\n3. Certified whitening effect by Food &amp; drug ministration of Korea.<br />\r\n4. Skin tone improvement, pigmentation, blemish and frekels prevention effect, moisturizing and radiance improvement effects tested.<br />\r\n5. Its 7 types of vitamin makes skin healthy and revitalized.<br />\r\n<br />\r\n<strong>Volume</strong><br />\r\n50ml<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\nAfter the toner, apply appropriate amount on the skin and gently smooth over it.<br />\r\n<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 10:03:23', 1, 0, '2017-03-16 07:07:23'),
(877, 0, 93, 0, 0, 'PRO-877', 'ETUDE HOUSE Any Cushion Color Corrector (SPF34/PA++)14g ', 'green_etude.jpg', '[ETUDE HOUSE] Any Cushion Color Corrector \r\n\r\n(SPF34/PA++)14g 4 Color / Tone up\r\n\r\nColor Green\r\n', '<p><strong>Feature</strong><br />\r\n1. Combine skin care and tone correction.<br />\r\n2. Color Correction Cushion that uniformly corrects skin without imperfections.<br />\r\n3. Delicate tone correction of defect-correcting color.<br />\r\n4. Dark and blue darkening correction.<br />\r\n5. Smooth correction with stroving effect.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 12:03:47', 1, 0, '2017-03-16 09:15:47'),
(878, 0, 60, 0, 0, 'PRO-878', 'Sulwhasoo Camellia Hair Oil - 100ml', 'sul_022_light-500x500.jpg', 'Sulwhasoo Camellia Hair Oil - 100ml\r\n\r\nSulwhasoo \r\nCamellia Hair Oil \r\n', '<table border="0" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td>Sulwhasoo&#39;s holistic beauty care provides hair with a sleek and natural smoothness.<br />\r\n			<br />\r\n			Protects hair and optimizes the balance of moisture and oil.<br />\r\n			Natural Camellia oil maintains the optimal oil and moisture balance of<br />\r\n			your hair while protecting it from external stresses.<br />\r\n			<br />\r\n			Leaves a natural-looking smooth finish with a delicate shine.<br />\r\n			Goes on smoothly onto your hair without leaving excess residue and<br />\r\n			giving it body, a natural shine, and vibrancy.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>[How to use]</td>\r\n		</tr>\r\n		<tr>\r\n			<td>After removing dry with a towel and shampoo, Apply to hair ends.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 01:03:57', 1, 0, '2017-03-16 10:36:10'),
(879, 0, 62, 0, 0, 'PRO-879', 'Sulwhasoo Everefine Lifting Ampoule Serum - 50ml', 'sul_056_light-500x500.jpg', '[Sulwhasoo] Everefine Lifting Ampoule Serum - 50ml\r\n\r\n[Sulwhasoo] \r\nEverefine Lifting Ampoule Serum \r\n', '<table border="0" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td>[Description]</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nutrient-rich lifting line for women in their 50s and 60s.<br />\r\n			<br />\r\n			Nutrient-rich lifting line for women in their 50s and 60s.<br />\r\n			Nutrient-rich lifting serum resists signs of aging, including loss of elasticity<br />\r\n			and undernourished appearance by instantly penetrating into even the finest layers<br />\r\n			of skin and delivering an immaculate finish.<br />\r\n			<br />\r\n			Ancient herbal medicine mixed with Maeseondan<br />\r\n			and Shiitake extracts enhances skin lifting.<br />\r\n			Sulwhasoo&#39;s Maeseondan is made with Licorice, Ginkgo leaves<br />\r\n			and elasticity-enhancing coumestrol,<br />\r\n			which is found in Bean Leaves extract and amplified tenfold.<br />\r\n			With the Shiitake extract that intensively nourishes the skin,<br />\r\n			Maeseondan improves elasticity for supple skin.<br />\r\n			<br />\r\n			Delivering positive energy with the Plum Blossom fragrance.<br />\r\n			The subtle White Plum Blossom fragrance delivers rejuvenating positive energy.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>[How to use]</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Use daily, morning and night, after applying the emulsion.<br />\r\n			Apply 2~3 pumps evenly on face.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-03-16 01:03:48', 1, 0, '2017-03-16 10:30:48'),
