(882, 0, 62, 0, 0, 'PRO-882', 'APRILSKIN Magic Snow Cushion White SPF50+/PA+++)', 'aprilskin_mt_002_23_light.jpg', '[APRILSKIN] Magic Snow Cushion White (SPF50+/PA+++) \r\n\r\n15g \r\n\r\n', '<p><strong>Feature</strong><br />\r\n1. Contains more than 60% water-based serum with no smudging.<br />\r\n2. The natural moisture base provides excellent spreadability with no irritation.<br />\r\n3. Transparent colors for beautiful, clean baby skin.<br />\r\n4. Displays clean and transparent colors perfect for Asian skin.<br />\r\n5. SPF50+/PA+++ UV RAY Blocking, Whitening / Wrinkle improvement, 3-in-1 product.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Volume</strong><br />\r\n15g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Open Magic Snow Cushion White and remove the transparent film.<br />\r\n2. The liquid is still contained in the sponge.<br />\r\n3. Press the puff against the sponge to absorb the liquid.<br />\r\n4. Use a tiny amount for full coverage.</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-04-09 09:04:38', 1, 0, '2017-04-09 18:54:14'),
(883, 0, 62, 0, 0, 'PRO-883', 'APRILSKIN Magic Snow Cushion Black 2.0 Version PINK BEIGE 15g', '9717443_f2f142c0-0457-4528-a1c4-b88b322f914e2.jpg', '[APRILSKIN] Magic Snow Cushion Black 2.0 Version \r\n\r\n(SPF50+/PA+++) 15g  \r\n\r\ncolor: PINK BEIGE', '<p><strong>Feature</strong><br />\r\n1. Infused with 45% water-based to provide moisturizing vocerage. Long-lasting<br />\r\nMagic Snow Cushion gives a skin smooth, flawless and velvety complexion.<br />\r\n2. Foundation fluid is kept in mochi-type sponge bag only delivers adequate amount of<br />\r\nfoundation when cushion is pressed with a puff.<br />\r\nIt allows foundation fluid intact, keeping the contents in hygienic way.<br />\r\n3. Patened triple protection technique to ensure airtight and maintain moisturizing texture of<br />\r\nthe product and prevent any leakage.<br />\r\nClosing the outer lid automatically closes inner lid th enhance airtight and maintain hydration<br />\r\nin product.</p>\r\n\r\n<p><strong>Volume</strong><br />\r\n15g<br />\r\n<br />\r\n<strong>How to use</strong><br />\r\n1. Remove translucent film from the mirror.<br />\r\n2. Open inner lid and remove the proctection film.<br />\r\n3. Gently press cushion with a provided puff to release the prefect amount of foundation.<br />\r\n4. Pat evenly on skin. Light and thin layer is adequate to cover.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-04-09 09:04:28', 1, 0, '2017-04-09 18:56:28'),
(884, 0, 93, 0, 0, 'PRO-884', 'APRIL SKIN - Magic Snow Cushion Pink ', 'aprilskinpink1.jpg', 'Hydrating cushion compact perfectly conceals blemishes and imperfections with its airy coverage, leaving skin smooth, dewy and flawless. Infused with mineral water, blueberry and aloe extracts for a moist finish. The pink version is recommended for those ', '<p>Hydrating cushion compact perfectly conceals blemishes and imperfections with its airy coverage, leaving skin smooth, dewy and flawless. Infused with mineral water, blueberry and aloe extracts for a moist finish. The pink version is recommended for those</p>\r\n\r\n<p>Apply onto puff and gently dab on your cheeks, nose, forehead, and chin and from inside to outside along the skin texture.<br />\r\n&nbsp;</p>\r\n', '', '', NULL, '', NULL, NULL, 1, '2017-04-09 10:04:14', 1, 0, '2017-05-13 18:49:13'),
